 ('126', '127', 'en_us', NULL, NULL, NULL, '0.00', 'modern union of middle eastern cuisines', 'Mamnoon Restaurant', NULL, '206-906-9606', NULL, 'if your party is larger than six people, please call to inquire about availability and private dining options. if you are reserving for dinner, please note that the traditional lebanese street food from our window menu is only available at the community table and outdoor tables', NULL, NULL, '0', 'mamnoon', NULL, NULL, NULL, NULL, '2014-07-23 19:30:21', '2017-06-26 18:40:12', '9cce16ec-950e-494b-9faf-409f19d32225'),
 ('127', '128', 'en_us', NULL, NULL, NULL, '0.00', NULL, NULL, '[{\"col1\":\"brunch\",\"col2\":\"10:00a - 2:30p sa\\/su\",\"col3\":\"\"},{\"col1\":\"lunch\",\"col2\":\"11:30a - 4:00p daily\",\"col3\":\"\"},{\"col1\":\"happy hour\",\"col2\":\"4:00p - 6:00p daily\",\"col3\":\"\"},{\"col1\":\"dinner\",\"col2\":\"5:00p - 10:00p daily\",\"col3\":\"\"},{\"col1\":\"late night\",\"col2\":\"10:00p - 11:00p fr\\/sa\",\"col3\":\"\"},{\"col1\":\"to go\",\"col2\":\"11:30a - 10:00p su - th, 11:00p fr\\/sa\",\"col3\":\"\"}]', NULL, '1508 melrose avenue, seattle, 98122.', NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, '2014-07-23 19:36:49', '2017-04-18 17:12:38', '70ab9236-e6f6-4eef-8283-c39af67b9f3f'),
 ('130', '131', 'en_us', 'i-sg9LhRq 1080', NULL, '<h3>our story</h3><p>Food an essential part of all family and social interactions in the Middle East where people grow up with intense flavors, colorful, vibrant foods fresh from the marketplace, prepared simply and with a lot of passion. Aromatic herbs fill the streets and a spirit of warmth and generosity exudes welcome at any table.</p><p>Here at mamnoon, we share these strengths brought with us from Lebanon and Syria to the new world of Seattle – where modern curiosity, compassion, progressive values and tolerance are paving the way for harmonious integration and celebration of cultures and flavors.</p>', '0.00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, '2014-07-23 19:58:00', '2014-09-11 23:05:30', 'b8d2b8b1-7632-4154-b225-b1f356620f04'),
 ('132', '133', 'en_us', 'i-43bsJHr 1080', NULL, NULL, '0.00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, '2014-07-23 19:58:01', '2014-07-23 19:58:01', '72d6350f-f2f0-4810-ad9f-6676bccf68a2'),
 ('133', '134', 'en_us', 'i-x9xHm2v 1280', NULL, '<p>The manou\'she is a very common street food found in every Damascus and Beirut street, often made fresh in the same (furn) bakery that supplies the pita daily bread to the neighborhood. Ingredients are basically flour, water, salt, olive oil and za\'atar. Simple, fresh, but when put together with the right skill, the results are magical experiences of taste and texture. This is a centuries old tradition that until now has not been easy to experience in Seattle; one that we grew up with and missed terribly. We believe you will have the same magical experience when you have your first mano\'ushe.</p>', '0.00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, '2014-07-23 19:58:02', '2014-07-23 20:34:56', '864595b1-e04d-4f18-8fbe-d5e9c543bd23'),
