 ('442', '467', 'en_us', 'Café Blanc', NULL, '<p>At the end of every meal at mamnoon, we serve all our guests a small carafe of Café Blanc or “white coffee” to cap off their meal and facilitate digestion.  Known was “Ahweh Bayda” in Arabic, Café Blanc is made with orange blossom extract and hot water and is sometimes sweetened with sugar or honey.  Café Blanc is thought to have originated in Lebanon and is traditionally served after meals as a digestif and offered as a sign of hospitality at special occasions and gatherings all over the Arab world.  Naturally caffeine and alcohol free, Café Blanc is also said to soothe the nerves and aid with stomach aches.  Many Middle Eastern mothers will also give their colicky babies a small amount of orange blossom extract with water.</p><p>When making Café Blanc at home, remember that a little bit goes a long way.  We like ours alongside a sweet little treat like nokhochi or baklawa.</p><p><strong>Café Blanc </strong></p><ul>\r\n<li>2 cups hot water</li><li>1 t. orange blossom extract</li><li>Sugar or honey to taste (optional)</li></ul>', '0.00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '0', NULL, NULL, NULL, NULL, NULL, '2014-08-12 21:48:52', '2014-09-10 17:44:31', '4f387dc3-41cd-471b-b857-a1f38787d807'),
 ('443', '468', 'en_us', 'The power of giving', NULL, '<p>We are dedicated to giving back to the people and cultures that inspire all that we do at mamnoon.  Through various fundraising efforts, we have donated nearly $25,000 to the UNHCR Syrian Refugee Relief Fund to aid those displaced by the crisis in Syria and the Middle East.</p><p>Our ‘Khobz for Syria’ campaign donates 100% of the proceeds from a $5 basket of house-made specialty breads to the UNHCR.  From the start of this project, these baskets have been one of our most popular menu items and a wonderful way for the mamnoon community to get involved with the giving effort.</p><p> We are also part of a larger fundraising effort in partnership with glassybaby, a Seattle-based glass blowing studio.  Our restaurant features a “mamnoon special” glassybaby candle holder in an exclusive dark slate color.  $20 from the sale of every mamnoon glassybaby is donated to Syrian relief.</p><p> The mamnoon special glassbaby is part of the larger glassybaby giving effort, a campaign that supports various charities and has donated over $2,000,000 through the sales of these beautifully simple glass candle holders.  Thedouble-glazed slate glassybaby votives, on display throughout the restaurant, are only available at mamnoon.</p><p> We have also had an incredible community support through private events and individual donations.</p><p>For more information on mamnoon giving, or to make a donation, call 206.906.9606 or visit http://www.unhcr.org/emergency/5051e8cd6-52b1c61ec.html.</p>', '0.00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '0', NULL, NULL, NULL, NULL, NULL, '2014-08-12 22:27:44', '2014-09-10 21:30:21', '6589f326-f335-4891-94ba-356135b14157'),
