 ('158', '468', '6', '1', 'en_us', '6', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"The power of giving\",\"slug\":\"the-power-of-giving\",\"postDate\":1402038000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":[\"464\"],\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>We are dedicated to giving back to the people and cultures that inspire all that we do at mamnoon. Through various fundraising efforts, we have donated nearly $25,000 to the UNHCR Syrian Refugee Relief Fund to aid those displaced by the crisis in Syria and the Middle East.<\\/p>\"}},\"476\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"474\"],\"position\":\"right\"}},\"473\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>We are dedicated to giving back to the people and cultures that inspire all that we do at mamnoon. Through various fundraising efforts, we have donated nearly $25,000 to the UNHCR Syrian Refugee Relief Fund to aid those displaced by the crisis in Syria and the Middle East.<\\/p><p>Our \\u2018Khobz for Syria\\u2019 campaign donates 100% of the proceeds from a $5 basket of house-made specialty breads to the UNHCR. From the start of this project, these baskets have been one of our most popular menu items and a wonderful way for the mamnoon community to get involved with the giving effort.<\\/p><p>We are also part of a larger fundraising effort in partnership with glassybaby, a Seattle-based glass blowing studio. Our restaurant features a \\u201cmamnoon special\\u201d glassybaby candle holder in an exclusive dark slate color. $20 from the sale of every mamnoon glassybaby is donated to Syrian relief.<\\/p><p>The mamnoon special glassbaby is part of the larger glassybaby giving effort, a campaign that supports various charities and has donated over $2,000,000 through the sales of these beautifully simple glass candle holders. Thedouble-glazed slate glassybaby votives, on display throughout the restaurant, are only available at mamnoon.<\\/p><p>We have also had an incredible community support through private events and individual donations.<\\/p><p>For more information on mamnoon giving, or to make a donation, call 206.906.9606 or visit&nbsp;<a href=\\\"http:\\/\\/www.unhcr.org\\/emergency\\/5051e8cd6-52b1c61ec.html\\\" target=\\\"_blank\\\">http:\\/\\/www.unhcr.org\\/emergency\\/5051e8cd6-52b1c61ec.html<\\/a>.<\\/p>\"}},\"477\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"475\"],\"position\":\"full\"}}}}}', '2014-09-10 21:30:21', '2014-09-10 21:30:21', '2a8c6c93-a649-4ae2-8e6c-617151fba6fc'),
 ('159', '484', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Art at mamnoon\",\"slug\":\"art-at-mamnoon\",\"postDate\":1401433200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":[\"465\"],\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Mamnoon has recently added art to our dining room to showcase artists of the Middle East and Africa. Our walls speak to the power of women, love, and seduction.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"479\"],\"position\":\"center\"}},\"new3\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>This image by <strong>Mouneer al Sharaani<\\/strong> can be translated to \\\"Enchantment is in the the colors, the melodies, the dew drops, the fragrances, and the flowers\\u201d. The artist is a Syrian calligrapher, designer, and print maker living and working in Cairo. Al Sharaani gave birth to a new era of contemporary Arab calligraphy through the synthesis of traditional techniques and modern styles and has received international recognition for his revitalization of the medium.<\\/p>\"}},\"new4\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"480\"],\"position\":\"center\"}},\"new6\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Model-turned-photographer <strong style=\\\"background-color: initial;\\\">Fabrice Monteiro<\\/strong> is an emerging artist working in the fields of photojournalism, fashion photography, and portraiture.<\\/p><p>Born to a Beninese father and Belgian mother, his childhood straddled the diverse cultural lines often represented in his work. Monteiro\\u2019s images carry the weight of modernity and tradition and force the viewer to confront the complex and often uncomfortable aesthetics of race, culture, and imperialism.&nbsp;<\\/p><p>This image from his \\u2018Signares\\u2019 series explores the role of cloth and clothing during African colonization and their subsequent meaning in an era of Westernization. Powerful Signarese women were often the \\u2018official wives\\u2019 of European colonizers for the duration of their stay. Often celebrated for their beauty and business mind, these women played an important role in the socio-economic development of Senegal.<\\/p>\"}},\"new5\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"481\",\"482\"],\"position\":\"center\"}},\"new7\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>These photographs by Iranian photographer <strong>Babak Kazemi<\\/strong> are a contemporary interpretation of the legend of Shirin and Farhad.<\\/p><p>As the story goes, Farhad was a stonemason who was in love with the beautiful Shirin, who was also desired by the powerful King Khosrow.  Shirin knew of Farhad\\u2019s love and used it to make the King jealous.  King Khosrow attempted to get rid of Farhad by ordering him to complete an impossible task: to win Shirin\\u2019s hand, he must move a mountain. Farhad\\u2019s love proves to be stronger than either the King or Shirin had<\\/p><p>imagined, and he takes on the task with zeal. Amazed at the reports of Farhad\\u2019s progress, Shirin travel to the mountain to see for herself. After the long journey, though, she faints with fatigue and Farhad places both Shirin and her horse on his shoulders and carries them back to the palace. <\\/p><p>Kazemi revisits this 16th- century tragedy to comment on the contemporary struggle of lovers who must leave their homeland to find the freedom to love as they choose. For the artist, the story reveals the message that love can overcome even the most difficult situations.&nbsp;<\\/p>\"}},\"new8\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"483\"],\"position\":\"center\"}},\"new9\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong><\\/strong><strong>Hassan Hajjaj<\\/strong>, who was born in Morocco and raised in London, is a master of multiple mediums, including furniture, fashion, interior, and record album covers. Hajjaj synthesized these all into a series of sensational photo-portraits in \\u2018Kesh Angels\\u2019. These transcultural and trans-medium images depict a distinct subculture of young Moroccan women who work as henna tattoo artists and travel Marrakesh on motorbike.<\\/p><p>With pride and ease, the women pose with their bikes, wearing veils and abayas, against vivid backdrops. These photos are a jarring mix of old and new, East and West, global and local. Hajjaj plays with and upends stereotypes, presenting his subjects as both traditional and defiantly modern, which infuses his photos with electrifying tension.<\\/p>\"}}}}}', '2014-09-10 21:53:16', '2014-09-10 21:53:16', 'cd49a33b-9b10-4d1f-870b-6419f43b0e44'),
