nk\\\">graypant\\u2019s website<\\/a> for more images of the screens and details on other awesome projects they have going on.<\\/p>\"}}}}}', '2014-09-10 22:19:03', '2014-09-10 22:19:03', '1ffc6f50-1ba9-4a9a-b24b-dd82e983e8d1'),
