 ('179', '520', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"I Thought You Were Closed on Mondays? An update on what\'s been going on with mamnoon junoon.\",\"slug\":\"i-thought-you-were-closed-on-mondays-an-update-on-whats-been-going-on-with-mamnoon-junoon\",\"postDate\":1394780400,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Two junoons into our newly launched Monday night series and we are off to a rocking start! Mamnoon junoon was hatched as a way to bust outside the box and serve as a creative and fun way to explore aspects of the food and culture of the levant that we may not fit inside the repertoire of our normal dinner service.<\\/p><p>Our kickoff junoon event was a six course Moroccan feast that highlighted many of the dishes owner Wassef Haroun and sous chef Sean Dominoski discovered on a trip to Morocco last year. As mamnoon is a Syrian, Lebanese, and Persian restaurant, this junoon was a great chance to experiment with the food of a country that, while geographically close, is really pretty different than the flavors our kitchen usually employs. Some of the highlights from the menu were the merguez (harissa and lamb sausage), seven vegetable tajine with hand-rolled couscous, and a savory goat cheese and herb pastry.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"518\"],\"position\":\"center\"}},\"new3\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>We went in a totally different direction for the next month\\u2019s junoon, this time choosing to focus on engaging more than just your taste buds. MamnoonTV explored the videos and images of the levant in a rethinking of a night at the theater. We had projection screens set up throughout the restaurant playing clips from various Arabic TV show and music videos, and the entertainment was paired with theater-style snacks: jibneh nachos, za\\u2019atar popcorn, kefta sliders, and sujuk hot dogs.<\\/p>\"}},\"new4\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"519\"],\"position\":\"center\"}},\"new5\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>If you have suggestions for creative, entertaining, or simply delicious events, we\\u2019d love to hear from you! Drop us a line on the blog or on our&nbsp;<a href=\\\"https:\\/\\/www.facebook.com\\/mamnoonrestaurant\\\" target=\\\"_blank\\\">Facebook page<\\/a>.<\\/p>\"}}}}}', '2014-09-10 22:32:11', '2014-09-10 22:32:11', '8910cb8b-1522-45a8-8c23-a74ae6aadc46'),
 ('180', '527', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"mamnoonTV coming to you live march 3rd\",\"slug\":\"mamnoontv-coming-to-you-live-march-3rd\",\"postDate\":1393315200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"526\"],\"position\":\"center\"}},\"new2\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>mamnoonTV is the next addition in our monthly mamnoon junoon dinner series. Join us on monday, march 3rd for an evening that is guaranteed to turn your idea of a night at the theater on it\'s head.<\\/p><p>Our talented and twisted kitchen has prepared a menu of theater-themed dishes inspired by the tastes and flavors of mamnoon. Enjoy delicacies like za\'atar popcorn, jibneh nachos and kefta sliders against a backdrop of the videos and images of the levant.<\\/p><p>This playful and casual evening is a mamnoon rethinking of a classic. Come break bread with friends and treat all your senses to the magic of the middle east. <\\/p><p>Call 206.906.9606 or visit&nbsp;<a href=\\\"http:\\/\\/www.mamnoonrestaurant.com\\/\\\">http:\\/\\/www.mamnoonrestaurant.com\\/<\\/a> for reservations<\\/p>\"}}}}}', '2014-09-10 22:45:39', '2014-09-10 22:45:39', '2bf1bbc9-ab93-4e83-a771-24033f4f27c9'),
 ('181', '527', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"mamnoonTV coming to you live march 3rd\",\"slug\":\"mamnoontv-coming-to-you-live-march-3rd\",\"postDate\":1393315200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"528\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"526\"],\"position\":\"full\"}},\"529\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>mamnoonTV is the next addition in our monthly mamnoon junoon dinner series. Join us on monday, march 3rd for an evening that is guaranteed to turn your idea of a night at the theater on it\'s head.<\\/p><p>Our talented and twisted kitchen has prepared a menu of theater-themed dishes inspired by the tastes and flavors of mamnoon. Enjoy delicacies like za\'atar popcorn, jibneh nachos and kefta sliders against a backdrop of the videos and images of the levant.<\\/p><p>This playful and casual evening is a mamnoon rethinking of a classic. Come break bread with friends and treat all your senses to the magic of the middle east. <\\/p><p>Call 206.906.9606 or visit&nbsp;<a href=\\\"http:\\/\\/www.mamnoonrestaurant.com\\/\\\">http:\\/\\/www.mamnoonrestaurant.com\\/<\\/a> for reservations<\\/p>\"}}}}}', '2014-09-10 22:46:00', '2014-09-10 22:46:00', '597c00dc-bbcd-40ca-b494-53a878dd17e1'),
 ('182', '527', '6', '1', 'en_us', '3', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"mamnoonTV coming to you live march 3rd\",\"slug\":\"mamnoontv-coming-to-you-live-march-3rd\",\"postDate\":1393315200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"528\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"526\"],\"position\":\"center\"}},\"529\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>mamnoonTV is the next addition in our monthly mamnoon junoon dinner series. Join us on monday, march 3rd for an evening that is guaranteed to turn your idea of a night at the theater on it\'s head.<\\/p><p>Our talented and twisted kitchen has prepared a menu of theater-themed dishes inspired by the tastes and flavors of mamnoon. Enjoy delicacies like za\'atar popcorn, jibneh nachos and kefta sliders against a backdrop of the videos and images of the levant.<\\/p><p>This playful and casual evening is a mamnoon rethinking of a classic. Come break bread with friends and treat all your senses to the magic of the middle east. <\\/p><p>Call 206.906.9606 or visit&nbsp;<a href=\\\"http:\\/\\/www.mamnoonrestaurant.com\\/\\\">http:\\/\\/www.mamnoonrestaurant.com\\/<\\/a> for reservations<\\/p>\"}}}}}', '2014-09-10 22:46:16', '2014-09-10 22:46:16', '7bb3efc0-7fb6-42bc-b9d8-6c0f836855ea'),
 ('183', '532', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"What\'s the Deal With Drink Service?\",\"slug\":\"whats-the-deal-with-drink-service\",\"postDate\":1391155200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"530\"],\"position\":\"right\"}},\"new2\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Is it lunch? Is it happy hour? Is it okay if I want to just sit and drink alone?<\\/p><p>These are all questions that may be swirling through your head as you see blurbs and announcements about mamnoon\'s new \\\"Drink Service.\\\" But, really, the semantics don\'t matter that much - the takeaway is that we\'re expanding our services during what is typically the afternoon lull and you should get really excited about that.<\\/p><p>We\'ve coined it Drink Service in homage to the tea and coffee experience that is a staple of Middle Eastern hospitality. While it\'s not a happy hour per se, we\'ve got banging deals on drinks (both boozy and boring), food, and plates of delicious off-menu treats that come gratis with drinks. House-roasted nuts, Iranian pickled vegetables, a confection or two... think tapas-style: order a drink and you get a little sweet or savory nibble so you don\'t get sloshed on our community table.<\\/p><p>We\'re just trying to spread the love a little farther. Drink Service is conducted in the front of the restaurant at our community table to facilitate socialization and is a tribute of sorts to the warmth of Middle Eastern dining. We\'re trying to create a casual environment for friends to come in and enjoy the mamnoon energy with a tasty drink and delicious food.<\\/p><p>So stop by between 2:30 and 5:30 Tuesday- Sunday to see what the buzz is about. And maybe get one of your own.<\\/p>\"}},\"new3\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"531\"],\"position\":\"center\"}}}}}', '2014-09-10 22:49:03', '2014-09-10 22:49:03', '9209c289-6e48-41f8-ac53-4bded98a529a'),
 ('184', '532', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"What\'s the Deal With Drink Service?\",\"slug\":\"whats-the-deal-with-drink-service\",\"postDate\":1391155200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"533\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"530\"],\"position\":\"center\"}},\"534\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Is it lunch? Is it happy hour? Is it okay if I want to just sit and drink alone?<\\/p><p>These are all questions that may be swirling through your head as you see blurbs and announcements about mamnoon\'s new \\\"Drink Service.\\\" But, really, the semantics don\'t matter that much - the takeaway is that we\'re expanding our services during what is typically the afternoon lull and you should get really excited about that.<\\/p><p>We\'ve coined it Drink Service in homage to the tea and coffee experience that is a staple of Middle Eastern hospitality. While it\'s not a happy hour per se, we\'ve got banging deals on drinks (both boozy and boring), food, and plates of delicious off-menu treats that come gratis with drinks. House-roasted nuts, Iranian pickled vegetables, a confection or two... think tapas-style: order a drink and you get a little sweet or savory nibble so you don\'t get sloshed on our community table.<\\/p><p>We\'re just trying to spread the love a little farther. Drink Service is conducted in the front of the restaurant at our community table to facilitate socialization and is a tribute of sorts to the warmth of Middle Eastern dining. We\'re trying to create a casual environment for friends to come in and enjoy the mamnoon energy with a tasty drink and delicious food.<\\/p><p>So stop by between 2:30 and 5:30 Tuesday- Sunday to see what the buzz is about. And maybe get one of your own.<\\/p>\"}},\"535\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"531\"],\"position\":\"center\"}}}}}', '2014-09-10 22:49:40', '2014-09-10 22:49:40', 'e8f1416c-69ba-493d-b5d8-b9425bab5f04'),
