 ('190', '537', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Mamnoon Junoon!\",\"slug\":\"mamnoon-junoon\",\"postDate\":1390982400,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\tWe are so excited to announce the start of Mamnoon Junoon, a series held on the first Monday of each month focusing on foods, arts and humanities. We are kicking off with a six course Moroccan dinner on Monday, Feb. 3. In Arabic, Junoon means a crazy party, a fete if you will.<\\/p><p>\\r\\n\\tThrough this dinner, we will bring aspects of Middle Eastern hospitality to help melt the ice that builds up with the Seattle Freeze. The dinner will be served family-style and will be done with community seating to facilitate discussion, socialization and mutual appreciation of the delicious and perhaps unfamiliar food on the table. We hope this to be a bonhomie of friends and strangers sitting down to enjoy a beautiful meal together.<\\/p><hr><p style=\\\"text-align: center;\\\"><strong>\\r\\n\\tmezze<\\/strong><\\/p><p style=\\\"text-align: center;\\\"><strong><em>\\r\\n\\tsmall bites<\\/em><\\/strong><\\/p><p style=\\\"text-align: center;\\\">\\r\\n\\tcarotte et orange<\\/p><p style=\\\"text-align: center;\\\"><em>\\r\\n\\tshredded carrot, cara cara orange<\\/em><\\/p><p style=\\\"text-align: center;\\\">\\r\\n\\tconcombre doux<\\/p><p style=\\\"text-align: center;\\\"><em>\\r\\n\\tsweet cucumber, orange blossom water<\\/em><\\/p><p style=\\\"text-align: center;\\\">\\r\\n\\tmerguez<\\/p><p style=\\\"text-align: center;\\\"><em>\\r\\n\\tlamb sausage, harissa<\\/em><\\/p><p style=\\\"text-align: center;\\\"><em><br><\\/em><\\/p><p style=\\\"text-align: center;\\\"><strong>\\r\\n\\tsalade<\\/strong><\\/p><p style=\\\"text-align: center;\\\"><em><strong>\\r\\n\\tsalad<\\/strong><\\/em><\\/p><p style=\\\"text-align: center;\\\">\\r\\n\\tfennouil<\\/p><p style=\\\"text-align: center;\\\"><em>\\r\\n\\tshaved fennel, oil cured olive, soft herbs<\\/em><\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>\\r\\n\\tbriwats<\\/strong><\\/p><p style=\\\"text-align: center;\\\"><strong><em>\\r\\n\\tpastry<\\/em><\\/strong><\\/p><p style=\\\"text-align: center;\\\">\\r\\n\\tfromage de chevre<\\/p><p style=\\\"text-align: center;\\\"><em>\\r\\n\\tfresh goat cheese, parsley, chive, tarragon<\\/em><\\/p><p style=\\\"text-align: center;\\\">\\r\\n\\t\\u00e9paule d\'agneau confite<\\/p><p style=\\\"text-align: center;\\\"><em>\\r\\n\\tlamb shoulder confit, warm spices, onion<\\/em><\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>\\r\\n\\tl\\u00e9gume<\\/strong><\\/p><p style=\\\"text-align: center;\\\"><strong><em>\\r\\n\\tvegetable<\\/em><\\/strong><\\/p><p style=\\\"text-align: center;\\\">\\r\\n\\ttajine<\\/p><p style=\\\"text-align: center;\\\"><em>\\r\\n\\tseven vegetable tagine, saffron, ginger, hand-rolled couscous, smen, fresh buttermilk<\\/em><\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>\\r\\n\\tpoisson<\\/strong><\\/p><p style=\\\"text-align: center;\\\"><em><strong>\\r\\n\\tfish<\\/strong><\\/em><\\/p><p style=\\\"text-align: center;\\\">\\r\\n\\tbar r\\u00f4ti<\\/p><p style=\\\"text-align: center;\\\"><em>\\r\\n\\troasted sea bass, chermoula, herb salad<\\/em><\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>\\r\\n\\tfriandises<\\/strong><\\/p><p style=\\\"text-align: center;\\\"><strong><em>\\r\\n\\ttreats<\\/em><\\/strong><\\/p><p style=\\\"text-align: center;\\\">\\r\\n\\tgazelle horns<\\/p><p style=\\\"text-align: center;\\\">\\r\\n\\ttahini cookies<\\/p><p style=\\\"text-align: center;\\\">\\r\\n\\ttangerines<\\/p><hr><p>Dinner is $65 per person and does not include gratuity, tax and beverage. We apologize for the inconvenience but we are unable to make substitutions as it is a set menu. Reservations are required for the event as space is limited. Please note that because of the communal nature of the meal, parties less than 8 may be grouped at a table with others. If your party prefers to be at a private table please make a note on your reservation and we will try our best to accommodate, but no promises. Reservations can be made at&nbsp;<a href=\\\"http:\\/\\/mamnoonrestaurant.com\\\">http:\\/\\/mamnoonrestaurant.com<\\/a>&nbsp;or at 206.906.9606.<\\/p><p>Mamnoon to you!<\\/p>\"}}}}}', '2014-09-10 22:57:50', '2014-09-10 22:57:50', 'bfe903a5-5ba0-40bc-bd91-c688f7f2d6e2'),
