\\\"text-align: center;\\\"><em>shaved fennel, oil cured olive, soft herbs<\\/em><\\/p><p style=\\\"text-align: center;\\\"><em><br><\\/em><\\/p><p style=\\\"text-align: center;\\\"><strong>briwats<\\/strong><\\/p><p style=\\\"text-align: center;\\\"><strong><em>pastry<\\/em><\\/strong><\\/p><p style=\\\"text-align: center;\\\">fromage de chevre<\\/p><p style=\\\"text-align: center;\\\"><em>fresh goat cheese, parsley, chive, tarragon<\\/em><\\/p><p style=\\\"text-align: center;\\\">\\u00e9paule d\'agneau confite<\\/p><p style=\\\"text-align: center;\\\"><em>lamb shoulder confit, warm spices, onion<\\/em><\\/p><p style=\\\"text-align: center;\\\"><em><br><\\/em><\\/p><p style=\\\"text-align: center;\\\"><strong>l\\u00e9gume<\\/strong><\\/p><p style=\\\"text-align: center;\\\"><strong><em>vegetable<\\/em><\\/strong><\\/p><p style=\\\"text-align: center;\\\">tajine<\\/p><p style=\\\"text-align: center;\\\"><em>seven vegetable tagine, saffron, ginger, hand-rolled couscous, smen, fresh buttermilk<\\/em><\\/p><p style=\\\"text-align: center;\\\"><em><br><\\/em><\\/p><p style=\\\"text-align: center;\\\"><strong>poisson<\\/strong><\\/p><p style=\\\"text-align: center;\\\"><em><strong>fish<\\/strong><\\/em><\\/p><p style=\\\"text-align: center;\\\">bar r\\u00f4ti<\\/p><p style=\\\"text-align: center;\\\"><em>roasted sea bass, chermoula, herb salad<\\/em><\\/p><p style=\\\"text-align: center;\\\"><em><br><\\/em><\\/p><p style=\\\"text-align: center;\\\"><strong>friandises<\\/strong><\\/p><p style=\\\"text-align: center;\\\"><strong><em>treats<\\/em><\\/strong><\\/p><p style=\\\"text-align: center;\\\">gazelle horns<\\/p><p style=\\\"text-align: center;\\\">tahini cookies<\\/p><p style=\\\"text-align: center;\\\">tangerines<\\/p><hr id=\\\"horizontalrule\\\">\"}},\"new2\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Dinner is $65 per person and does not include gratuity, tax and beverage. We apologize for the inconvenience but we are unable to make substituti