 ('197', '537', '6', '1', 'en_us', '7', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Mamnoon Junoon!\",\"slug\":\"mamnoon-junoon\",\"postDate\":1390982400,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"538\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\tWe are so excited to announce the start of Mamnoon Junoon, a series held on the first Monday of each month focusing on foods, arts and humanities. We are kicking off with a six course Moroccan dinner on Monday, Feb. 3. In Arabic, Junoon means a crazy party, a fete if you will.<\\/p><p>\\r\\n\\tThrough this dinner, we will bring aspects of Middle Eastern hospitality to help melt the ice that builds up with the Seattle Freeze. The dinner will be served family-style and will be done with community seating to facilitate discussion, socialization and mutual appreciation of the delicious and perhaps unfamiliar food on the table. We hope this to be a bonhomie of friends and strangers sitting down to enjoy a beautiful meal together.<\\/p>\"}},\"539\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<hr>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong>mezze<\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong><em>small bites<\\/em><\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\tcarotte et orange\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<em>shredded carrot, cara cara orange<\\/em>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\tconcombre doux\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<em>sweet cucumber, orange blossom water<\\/em>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\tmerguez\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<em>lamb sausage, harissa<\\/em>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong>salade<\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<em><strong>salad<\\/strong><\\/em>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\tfennouil\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<em>shaved fennel, oil cured olive, soft herbs<\\/em>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong>briwats<\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong><em>pastry<\\/em><\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\tfromage de chevre\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<em>fresh goat cheese, parsley, chive, tarragon<\\/em>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t\\u00e9paule d\'agneau confite\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<em>lamb shoulder confit, warm spices, onion<\\/em>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong>l\\u00e9gume<\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong><em>vegetable<\\/em><\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\ttajine\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<em>seven vegetable tagine, saffron, ginger, hand-rolled couscous, smen, fresh buttermilk<\\/em>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong>poisson<\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<em><strong>fish<\\/strong><\\/em>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\tbar r\\u00f4ti\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<em>roasted sea bass, chermoula, herb salad<\\/em>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong>friandises<\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong><em>treats<\\/em><\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\tgazelle horns\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\ttahini cookies\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\ttangerines\\r\\n<\\/p>\\r\\n<hr id=\\\"horizontalrule\\\">\"}},\"540\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Dinner is $65 per person and does not include gratuity, tax and beverage. We apologize for the inconvenience but we are unable to make substitutions as it is a set menu. Reservations are required for the event as space is limited. Please note that because of the communal nature of the meal, parties less than 8 may be grouped at a table with others. If your party prefers to be at a private table please make a note on your reservation and we will try our best to accommodate, but no promises. Reservations can be made at <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/\\\">http:\\/\\/mamnoonrestaurant.com<\\/a> or at 206.906.9606.<\\/p><p>Mamnoon to you!<\\/p>\"}}}}}', '2014-09-10 23:08:52', '2014-09-10 23:08:52', '14c5c85b-131f-44c3-9beb-c83c5c039e4d'),
 ('198', '544', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Spotlight: MamnoonToo Manager Zack Chamberlain\",\"slug\":\"spotlight-mamnoontoo-manager-zack-chamberlain\",\"postDate\":1390464000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong><\\/strong><strong>By Zack Chamberlain<\\/strong><\\/p><p><strong><\\/strong>As told to Molly Sinnott<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"541\"],\"position\":\"right\"}},\"new3\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Bread is always gonna be bread. It\\u2019s so simple, but so necessary and that necessity adds complexity. Any main dish on a dinner table is going to change, but bread is always going to be there and be comprised of more or less the same ingredients. There\\u2019s beauty in that simplicity.<\\/p><p>Garrett asked me to come on about two weeks before the restaurant opened, and at the beginning it was really just more to help out. I think in a lot of ways that helped me learn things from the ground up and get to know people involved in the restaurant in a different way. This is my fifth restaurant opening in my career and I really love the energy that comes with opening a restaurant. But I\\u2019ve never worked a streetside window before, which is really cool. I\\u2019ve found out that I am much more of a people person than I ever thought I was in terms of being up front and talking to customers. It\\u2019s incredibly dynamic and I find a lot of joy in that.  We get to see smiling faces all day and we get instant feedback from customers, which I really appreciate. I also just like making people happy and watching them leave satisfied. &nbsp;<\\/p>\"}},\"new4\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"542\"],\"position\":\"left\"}},\"new5\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Our front kitchen is specifically designed to produce this Lebanese-style street food. Being Seattle and not a city that really has a vibrant street food scene, it has kind of morphed into a to-go window and full service lunch. It also offers a great alternative to the more aggressively priced sit down formal dinner that is our back dining room. But I think our front window really balances the two types of cuisines we offer as far as fun and functional and takeaway versus fancy and formal and sit-down. We went through a lot of trial and error. Just getting people to try our food was really tough and it was hard to get people hooked. So we were out there on the street giving out samples and talking things up. We opened completely organically, though, and we haven\\u2019t really done any advertising at all. So throughout the past year there\\u2019s been a real evolution of the food we offer up front. For example, we\\u2019ve changed things from \\u2018kulage\\u2019 to \\u2018sandwich\\u2019 because really it just looks like a sandwich and we\\u2019ve adapted some of the elements from a traditional kulage to make it look more like something that Americans will eat for lunch. We\\u2019ve had to make it a bit more accessible and easy to order. I think there was a bit of resistance at first but we\\u2019ve stayed pretty close to our original path and I think we\\u2019re winning in the long run. Sometimes you have to wait for people to take, and people took. It\\u2019s exciting.<\\/p><p>My job is basically getting everything to function and to be cohesive and I get a huge amount of satisfaction from that. The menu was completely made when I got here, but I had to pull it off logistically. I\\u2019m really more of a logistical and detail-minded person than a fancy creator of brand new foods.  Which really goes back to simplicity and my initial attraction to bread. It\\u2019s the necessities, the staples. So it\\u2019s the fact that the two aspects of the restaurant kind of feed each other-- one is a little more playful and one\\u2019s more serious-- but they really balance each other out. And the cohesion of the whole place is really important to me, bridging the gap between front and back of the house and between the to-go window and the back dining room. So in a way its larger than a restaurant, it\'s how people come together to celebrate their passions.&nbsp;<\\/p>\"}},\"new6\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"543\"],\"position\":\"center\"}}}}}', '2014-09-10 23:13:50', '2014-09-10 23:13:50', '7dde07b1-7a09-42b0-ae1c-4b4923d2621d'),
