each other-- one is a little more playful and one\\u2019s more serious-- but they really balance each other out. And the cohesion of the whole place is really important to me, bridging the gap between front and back of the house and between the to-go window and the back dining room. So in a way its larger than a restaurant, it\'s how people come together to celebrate their passions.&nbsp;<\\/p>\"}},\"550\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"543\"],\"position\":\"center\"}}}}}', '2014-09-10 23:14:21', '2014-09-10 23:14:21', 'aa32e88d-79c0-4271-8e6b-14bb4485d03d'),
