 ('201', '544', '6', '1', 'en_us', '4', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Spotlight: MamnoonToo Manager Zack Chamberlain\",\"slug\":\"spotlight-mamnoontoo-manager-zack-chamberlain\",\"postDate\":1390464000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":[\"465\"],\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"545\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>By Zack Chamberlain<br><\\/strong>As told to Molly Sinnott<\\/p>\"}},\"546\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"541\"],\"position\":\"right\"}},\"547\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Bread is always gonna be bread. It\\u2019s so simple, but so necessary and that necessity adds complexity. Any main dish on a dinner table is going to change, but bread is always going to be there and be comprised of more or less the same ingredients. There\\u2019s beauty in that simplicity.<\\/p><p>Garrett asked me to come on about two weeks before the restaurant opened, and at the beginning it was really just more to help out. I think in a lot of ways that helped me learn things from the ground up and get to know people involved in the restaurant in a different way. This is my fifth restaurant opening in my career and I really love the energy that comes with opening a restaurant. But I\\u2019ve never worked a streetside window before, which is really cool. I\\u2019ve found out that I am much more of a people person than I ever thought I was in terms of being up front and talking to customers. It\\u2019s incredibly dynamic and I find a lot of joy in that.  We get to see smiling faces all day and we get instant feedback from customers, which I really appreciate. I also just like making people happy and watching them leave satisfied. &nbsp;<\\/p>\"}},\"548\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"542\"],\"position\":\"left\"}},\"549\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Our front kitchen is specifically designed to produce this Lebanese-style street food. Being Seattle and not a city that really has a vibrant street food scene, it has kind of morphed into a to-go window and full service lunch. It also offers a great alternative to the more aggressively priced sit down formal dinner that is our back dining room. But I think our front window really balances the two types of cuisines we offer as far as fun and functional and takeaway versus fancy and formal and sit-down. We went through a lot of trial and error. Just getting people to try our food was really tough and it was hard to get people hooked. So we were out there on the street giving out samples and talking things up. We opened completely organically, though, and we haven\\u2019t really done any advertising at all. So throughout the past year there\\u2019s been a real evolution of the food we offer up front. For example, we\\u2019ve changed things from \\u2018kulage\\u2019 to \\u2018sandwich\\u2019 because really it just looks like a sandwich and we\\u2019ve adapted some of the elements from a traditional kulage to make it look more like something that Americans will eat for lunch. We\\u2019ve had to make it a bit more accessible and easy to order. I think there was a bit of resistance at first but we\\u2019ve stayed pretty close to our original path and I think we\\u2019re winning in the long run. Sometimes you have to wait for people to take, and people took. It\\u2019s exciting.<\\/p><p>My job is basically getting everything to function and to be cohesive and I get a huge amount of satisfaction from that. The menu was completely made when I got here, but I had to pull it off logistically. I\\u2019m really more of a logistical and detail-minded person than a fancy creator of brand new foods.  Which really goes back to simplicity and my initial attraction to bread. It\\u2019s the necessities, the staples. So it\\u2019s the fact that the two aspects of the restaurant kind of feed each other-- one is a little more playful and one\\u2019s more serious-- but they really balance each other out. And the cohesion of the whole place is really important to me, bridging the gap between front and back of the house and between the to-go window and the back dining room. So in a way its larger than a restaurant, it\'s how people come together to celebrate their passions.&nbsp;<\\/p>\"}},\"550\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"543\"],\"position\":\"center\"}}}}}', '2014-09-10 23:15:35', '2014-09-10 23:15:35', '314b4eb9-389a-4842-825b-e9625abd2eb0'),
 ('202', '555', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Spotlight: Executive Chef Garrett Melkonian\",\"slug\":\"spotlight-executive-chef-garrett-melkonian\",\"postDate\":1390377600,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":[\"465\"],\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong><\\/strong><strong>By Garrett Melkonian<\\/strong><br>As told to Molly Sinnott<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"551\"],\"position\":\"center\"}},\"new3\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>It\\u2019s kind of amazing how so many of the things that we do here and the approach to hospitality and feeding people is pretty much a direct reflection of what I remember from my childhood. Everything always revolved around food and people and cooking was how they showed people love and respect and admiration. It was the metaphorical hug, to have people eat. It\\u2019s amazing how much this place has been able to connect me to some of those really vivid memories. It\\u2019s wasn\\u2019t until I found myself in a situation that is so closely connected to what initially inspired me to cook that I really remembered these things. It was making dolmeh with Racha\\u2019s mom and starting to have a flood of memories of watching my grandmother do it and having her teach me how to roll grape leaves. It\'s that kind of thing that has made everything feel very fortuitous and really come full circle for me. There is a real feeling behind the hospitality that we do here. There\\u2019s a sincerity that exists in that culture that\\u2019s expressed through food and it\\u2019s been remarkable to be able to take all that I\\u2019ve learned through food and use it to honor my heritage and who I am.<\\/p>\"}},\"new4\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"552\"],\"position\":\"right\"}},\"new5\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>There\\u2019s a difference between feeding someone and celebrating a cuisine. The restaurants that are out there that serve large quantities of very inexpensive Middle Eastern food are not really celebrating the cuisine and they\\u2019re not really celebrating the culture. There\\u2019s beauty that exists within this food and there\\u2019s a level of preparation that must take place. We\\u2019re taking something that is inherently family style and rustic and presenting it with an aesthetic and a refinement that doesn\\u2019t move away from the fundamentals, but maybe makes it taste just a little bit better or look a little bit more beautiful. To have an outlet to really showcases that and starts to use more celebrated ingredients&mdash;  local meat and beautiful organic produce&mdash; and to bring those elements together is something that hasn\\u2019t really been done before with this food. What we do here is very focused. It doesn\\u2019t mean that we can\\u2019t incorporate the same elements of \\u2018local, organic, sustainable\\u2019 that other Seattle restaurants are depending upon and building their name upon, we use some of that, but we\\u2019re doing it in a way that\\u2019s intensely focused. We\\u2019re working within pretty rigid parameters when you think about it and as much as we might do something that is maybe outside of the box of Middle Eastern cuisine, it still has to have that authenticity.<\\/p>\"}},\"new6\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"553\"],\"position\":\"left\"}},\"new7\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>We\\u2019ve changed so much in the last year and I think the evolution will continue. It\\u2019s necessary for a restaurant to evolve because if you don\\u2019t, you become static and boring and you become an experience that somebody\\u2019s already had. Part of the reason we\\u2019re able to do what we\\u2019re doing now is that there\\u2019s a trust that we\\u2019ve built that has allowed us a little bit more creative freedom. It\\u2019s allowed us to start to pull ingredients that are decidedly northwest&mdash;on one plate we are celebrating two places at once. When we first opened, it was really more about celebrating the origins and at points we had to use ingredients that were out of season in order to hit all the authentic dishes. But right now you\\u2019re looking at a Middle Eastern restaurant that doesn\\u2019t have tabbouleh on the dinner menu. That\\u2019s not something that could have happened when we first opened. We had to prove that we could do all of those other things first and provide a sense of comfort through authenticity.  But we showed that we are restaurant with sincerity and some semblance of an old soul, so we were able to take the cuisine and push it forward. And I hope that in the future we\\u2019ll start to move away from being somewhat of a black sheep of a restaurant. There was a feeling in the beginning that we were a little bit of a novelty. But we\\u2019re moving into a place where we\\u2019re being taken very seriously as a restaurant, and not just a Middle Eastern restaurant.<\\/p>\"}},\"new8\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"554\"],\"position\":\"right\"}},\"new9\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>I think people who are really observant don\\u2019t necessarily look for inspiration but stumble upon it. I could be inspired by a conversation that I have with Racha and Wassef about a memory from their childhood, or it could be a memory of my own, or it could be going to a 7-11 at 3 o\\u2019clock in the morning and seeing something that I find really delicious. For me, the most important thing about inspiration is that it requires a harmony between two things: there must be a healthy combination of passion and humility. To be inspired by something is to acknowledge that something or someone has done something that is worthy of dedicating your energy to. And then you must have passion in order to put inspiration into motion. Those two things are at the heart of what we do here. This is a truly inspired restaurant. And everything else sort of stems from there. It comes at the most unexpected times and the most unexpected places as long as you\\u2019re open to that.<\\/p><p>I really believe that we are at the forefront of the movement for Middle Eastern cuisine. Our restaurant is staying really true to form and doing at a level that the likes of which don\\u2019t really exist, but I think that it will one day. In hindsight&mdash;and this doesn\\u2019t come from a place of arrogance, it\\u2019s a hope&mdash; I would hope that as the movement starts to take places and this becomes more than just a trend, that we will be considered the restaurant that helped shape that and really set the bar for it. I think we\\u2019re really paving the way for something greater. You won\\u2019t necessarily see it now and you might not see it a year from now, but there is a much larger thing that is happening. It\\u2019s not tangible, but is definitely palpable.<\\/p>\"}}}}}', '2014-09-10 23:20:34', '2014-09-10 23:20:34', 'b1f096d3-4b6c-4a03-8083-ea4b6658c83f'),
 ('203', '555', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Spotlight: Executive Chef Garrett Melkonian\",\"slug\":\"spotlight-executive-chef-garrett-melkonian\",\"postDate\":1390377600,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":[\"465\"],\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"556\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>By Garrett Melkonian<\\/strong><br>As told to Molly Sinnott<\\/p>\"}},\"557\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"551\"],\"position\":\"center\"}},\"558\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>It\\u2019s kind of amazing how so many of the things that we do here and the approach to hospitality and feeding people is pretty much a direct reflection of what I remember from my childhood. Everything always revolved around food and people and cooking was how they showed people love and respect and admiration. It was the metaphorical hug, to have people eat. It\\u2019s amazing how much this place has been able to connect me to some of those really vivid memories. It\\u2019s wasn\\u2019t until I found myself in a situation that is so closely connected to what initially inspired me to cook that I really remembered these things. It was making dolmeh with Racha\\u2019s mom and starting to have a flood of memories of watching my grandmother do it and having her teach me how to roll grape leaves. It\'s that kind of thing that has made everything feel very fortuitous and really come full circle for me. There is a real feeling behind the hospitality that we do here. There\\u2019s a sincerity that exists in that culture that\\u2019s expressed through food and it\\u2019s been remarkable to be able to take all that I\\u2019ve learned through food and use it to honor my heritage and who I am.<\\/p>\"}},\"559\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"552\"],\"position\":\"right\"}},\"560\":{\"type\":\"text\",\"