019s a trust that we\\u2019ve built that has allowed us a little bit more creative freedom. It\\u2019s allowed us to start to pull ingredients that are decidedly northwest&mdash;on one plate we are celebrating two places at once. When we first opened, it was really more about celebrating the origins and at points we had to use ingredients that were out of season in order to hit all the authentic dishes. But right now you\\u2019re looking at a Middle Eastern restaurant that doesn\\u2019t have tabbouleh on the dinner menu. That\\u2019s not something that could have happened when we first opened. We had to prove that we could do all of those other things first and provide a sense of comfort through authenticity.  But we showed that we are restaurant with sincerity and some semblance of an old soul, so we were able to take the cuisine and push it forward. And I hope that in the future we\\u2019ll start to move away from being somewhat of a black sheep of a restaurant. There was a feeling in the beginning that we were a little bit of a novelty. But we\\u2019re moving into a place where we\\u2019re being taken very seriously as a restaurant, and not just a Middle Eastern restaurant.<\\/p>\"}},\"563\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"554\"],\"position\":\"right\"}},\"564\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>I think people who are really observant don\\u2019t necessarily look for inspiration but stumble upon it. I could be inspired by a conversation that I have with Racha and Wassef about a memory from their childhood, or it could be a memory of my own, or it could be going to a 7-11 at 3 o\\u2019clock in the morning and seeing something that I find really delicious. For me, the most important thing about inspiration is that it requires a harmony between two things: there must be a healthy combination of passion and humility. To be inspired by something is to acknowledge that something or someone has done something that is worthy of dedicating your energy to. And then you must have passion in order to put inspiration into motion. Those two things are at the heart of what we do here. This is a truly inspired restaurant. And everything else sort of stems from there. It comes at the most unexpected times and the most unexpected places as long as you\\u2019re open to that.<\\/p><p>I really believe that we are at the forefront of the movement for Middle Eastern cuisine. Our restaurant is staying really true to form and doing at a level that the likes of which don\\u2019t really exist, but I think that it will one day. In hindsight&mdash;and this doesn\\u2019t come from a place of arrogance, it\\u2019s a hope&mdash; I would hope that as the movement starts to take places and this becomes more than just a trend, that we will be considered the restaurant that helped shape that and really set the bar for it. I think we\\u2019re really paving the way for something greater. You won\\u2019t necessarily see it now and you might not see it a year from now, but there is a much larger thing that is happening. It\\u2019s not tangible, but is definitely palpable.<\\/p>\"}}}}}', '2014-09-10 23:22:12', '2014-09-10 23:22:12', 'a177cd2a-a43e-44cd-9448-ddbb9627308e'),
 ('204', '566', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Mamnoon Spotlight: Racha Haroun\",\"slug\":\"mamnoon-spotlight-racha-haroun\",\"postDate\":1390032000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong><\\/strong><strong>Mamnoon co-owner Racha Haroun on the Middle Eastern palate and impressing the moms.<\\/strong><\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"565\"],\"position\":\"center\"}},\"new3\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong><\\/strong><strong>Mamnoon has just recently celebrated one year in business. Congrats! Tell me a bit about the journey so far.<\\/strong><\\/p><p>It\'s been exciting-challenging but necessary. Since I am Syrian and Iranian, I feel that it\'s through the food that guests have been able to appreciate the warmth and compassion that have been part of our cultures for thousands of years. <\\/p><p>I grew up eating both foods and for many years shared my love and respect for the food with our friends. It felt like the right time to share with our adopted home, Seattle. We feel honored that people appreciate the experience and share the love of the food.  <\\/p><p>All the recent events and news are masking the good that\\u2019s in these ancient civilizations and I feel compelled to share these positive aspects with Seattle and the greater Northwest community. <\\/p><p><strong>How would you describe the role you play at the restaurant?<\\/strong><\\/p><p>I really love the creative aspect of mamnoon. Art has always been a very important part of my life and I taught myself to cook the foods that I grew up with while living in Seattle. <\\/p><p>I am proud to be part of the creative process of bringing mamnoon to life. Curating the guest experience from start to finish, the feel and the taste.  <\\/p><p>I was raised with the palate to know and appreciate good Lebanese, Syrian and Iranian cuisines. Our culinary team is exceptionally talented, but not necessarily totally experienced in the cuisine and the desired outcomes. I work closely with our executive chef Garrett Melkonian and the rest of the talented kitchen staff and have been excited to see that they\'ve started to acquire the palate and can now make authentic dishes better than I ever made. Even our most critical guests, our moms, approve! We apply a lot of creativity in presenting dishes that are common in the middle east, but new to most of our guests, to help make the dishes less mysterious and more approachable.<\\/p><p><strong>What have been some of the most rewarding and challenging aspects of the process?<\\/strong><\\/p><p>The most rewarding part is realizing that our hearts are in the right place. We are proud of our foods but we wanted to showcase it in a modern Northwest setting. <\\/p><p>We noticed that our children are very proud of our achievement and the fact that hard work and perseverance pays off. The hardest part has been the constant awareness that our families are living in a tense war situation with a very uncertain future. Caring and nurturing mamnoon keeps us busy and sane, while really highlighting the beautiful aspects of our culture.<\\/p>\"}}}}}', '2014-09-10 23:45:14', '2014-09-10 23:45:14', '326921df-2631-4aba-9cba-96a84ee8381c'),
 ('205', '566', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Mamnoon Spotlight: Racha Haroun\",\"slug\":\"mamnoon-spotlight-racha-haroun\",\"postDate\":1390032000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"567\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>Mamnoon co-owner Racha Haroun on the Middle Eastern palate and impressing the moms.<\\/strong><\\/p>\"}},\"568\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"565\"],\"position\":\"center\"}},\"569\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>Mamnoon has just recently celebrated one year in business. Congrats! Tell me a bit about the journey so far.<\\/strong><\\/p><p>It\'s been exciting-challenging but necessary. Since I am Syrian and Iranian, I feel that it\'s through the food that guests have been able to appreciate the warmth and compassion that have been part of our cultures for thousands of years. <\\/p><p>I grew up eating both foods and for many years shared my love and respect for the food with our friends. It felt like the right time to share with our adopted home, Seattle. We feel honored that people appreciate the experience and share the love of the food.  <\\/p><p>All the recent events and news are masking the good that\\u2019s in these ancient civilizations and I feel compelled to share these positive aspects with Seattle and the greater Northwest community.<br> <\\/p><p><strong>How would you describe the role you play at the restaurant?<\\/strong><\\/p><p>I really love the creative aspect of mamnoon. Art has always been a very important part of my life and I taught myself to cook the foods that I grew up with while living in Seattle. <\\/p><p>I am proud to be part of the creative process of bringing mamnoon to life. Curating the guest experience from start to finish, the feel and the taste.  <\\/p><p>I was raised with the palate to know and appreciate good Lebanese, Syrian and Iranian cuisines. Our culinary team is exceptionally talented, but not necessarily totally experienced in the cuisine and the desired outcomes. I work closely with our executive chef Garrett Melkonian and the rest of the talented kitchen staff and have been excited to see that they\'ve started to acquire the palate and can now make authentic dishes better than I ever made. Even our most critical guests, our moms, approve! We apply a lot of creativity in presenting dishes that are common in the middle east, but new to most of our guests, to help make the dishes less mysterious and more approachable.<\\/p><p><strong>What have been some of the most rewarding and challenging aspects of the process?<\\/strong><\\/p><p>The most rewarding part is realizing that our hearts are in the right place. We are proud of our foods but we wanted to showcase it in a modern Northwest setting. <\\/p><p>We noticed that our children are very proud of our achievement and the fact that hard work and perseverance pays off. The hardest part has been the constant awareness that our families are living in a tense war situation with a very uncertain future. Caring and nurturing mamnoon keeps us busy and sane, while really highlighting the beautiful aspects of our culture.<\\/p>\"}}}}}', '2014-09-10 23:45:38', '2014-09-10 23:45:38', 'b00048ba-b220-4559-b30b-54ff0776ad7d'),
 ('206', '566', '6', '1', 'en_us', '3', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Mamnoon Spotlight: Racha Haroun\",\"slug\":\"mamnoon-spotlight-racha-haroun\",\"postDate\":1390032000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"567\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>Mamnoon co-owner Racha Haroun on the Middle Eastern palate and impressing the moms.<\\/strong><\\/p>\"}},\"568\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"565\"],\"position\":\"center\"}},\"569\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\t<strong>Mamnoon has just recently celebrated one year in business. Congrats! Tell me a bit about the journey so far.<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tIt\'s been exciting-challenging but necessary. Since I am Syrian and Iranian, I feel that it\'s through the food that guests have been able to appreciate the warmth and compassion that have been part of our cultures for thousands of years.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI grew up eating both foods and for many years shared my love and respect for the food with our friends. It felt like the right time to share with our adopted home, Seattle. We feel honored that people appreciate the experience and share the love of the food.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tAll the recent events and news are masking the good that\\u2019s in these ancient civilizations and I feel compelled to share these positive aspects with Seattle and the greater Northwest community.<\\/br>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<strong>How would you describe the role you play at the restaurant?<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI really love the creative aspect of mamnoon. Art has always been a very important part of my life and I taught myself to cook the foods that I grew up with while living in Seattle.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI am proud to be part of the creative process of bringing mamnoon to life. Curating the guest experience from start to finish, the feel and the taste.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI was raised with the palate to know and appreciate good Lebanese, Syrian and Iranian cuisines. Our culinary team is exceptionally talented, but not necessarily totally experienced in the cuisine and the desired outcomes. I work closely with our executive chef Garrett Melkonian and the rest of the talented kitchen staff and have been excited to see that they\'ve started to acquire the palate and can now make authentic dishes better than I ever made. Even our most critical guests, our moms, approve! We apply a lot of creativity in presenting dishes that are common in the middle east, but new to most of our guests, to help make the dishes less mysterious and more approachable.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<strong>What have been some of the most rewarding and challenging aspects of the process?<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe most rewarding part is realizing that our hearts are in the right place. We are proud of our foods but we wanted to showcase it in a modern Northwest setting.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tWe noticed that our children are very proud of our achievement and the fact that hard work and perseverance pays off. The hardest part has been the constant awareness that our families are living in a tense war situation with a very uncertain future. Caring and nurturing mamnoon keeps us busy and sane, while really highlighting the beautiful aspects of our culture.\\r\\n<\\/p>\"}}}}}', '2014-09-10 23:46:17', '2014-09-10 23:46:17', '913526f7-31ae-4cdd-9be4-6d9b27fe144c'),
 ('207', '566', '6', '1', 'en_us', '4', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Mamnoon Spotlight: Racha Haroun\",\"slug\":\"mamnoon-spotlight-racha-haroun\",\"postDate\":1390032000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"567\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>Mamnoon co-owner Racha Haroun on the Middle Eastern palate and impressing the moms.<\\/strong><\\/p>\"}},\"568\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"565\"],\"position\":\"center\"}},\"569\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\t<strong>Mamnoon has just recently celebrated one year in business. Congrats! Tell me a bit about the journey so far.<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tIt\'s been exciting-challenging but necessary. Since I am Syrian and Iranian, I feel that it\'s through the food that guests have been able to appreciate the warmth and compassion that have been part of our cultures for thousands of years.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI grew up eating both foods and for many years shared my love and respect for the food with our friends. It felt like the right time to share with our adopted home, Seattle. We feel honored that people appreciate the experience and share the love of the food.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tAll the recent events and news are masking the good that\\u2019s in these ancient civilizations and I feel compelled to share these positive aspects with Seattle and the greater Northwest community.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<strong>How would you describe the role you play at the restaurant?<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI really love the creative aspect of mamnoon. Art has always been a very important part of my life and I taught myself to cook the foods that I grew up with while living in Seattle.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI am proud to be part of the creative process of bringing mamnoon to life. Curating the guest experience from start to finish, the feel and the taste.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI was raised with the palate to know and appreciate good Lebanese, Syrian and Iranian cuisines. Our culinary team is exceptionally talented, but not necessarily totally experienced in the cuisine and the desired outcomes. I work closely with our executive chef Garrett Melkonian and the rest of the talented kitchen staff and have been excited to see that they\'ve started to acquire the palate and can now make authentic dishes better than I ever made. Even our most critical guests, our moms, approve! We apply a lot of creativity in presenting dishes that are common in the middle east, but new to most of our guests, to help make the dishes less mysterious and more approachable.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<strong>What have been some of the most rewarding and challenging aspects of the process?<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe most rewarding part is realizing that our hearts are in the right place. We are proud of our foods but we wanted to showcase it in a modern Northwest setting.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tWe noticed that our children are very proud of our achievement and the fact that hard work and perseverance pays off. The hardest part has been the constant awareness that our families are living in a tense war situation with a very uncertain future. Caring and nurturing mamnoon keeps us busy and sane, while really highlighting the beautiful aspects of our culture.\\r\\n<\\/p>\"}}}}}', '2014-09-10 23:46:32', '2014-09-10 23:46:32', '0b03b428-a4c7-4442-b5a9-82caa442badf'),
 ('208', '571', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"We\'re pleased to announce the winners of our Cocktail Naming Contest! \",\"slug\":\"were-pleased-to-announce-the-winners-of-our-cocktail-naming-contest\",\"postDate\":1389340800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p style=\\\"text-align: center;\\\">Below you\'ll find the 1st and 2nd place winners for all 11 our of specialty cocktails.<\\/p><p style=\\\"text-align: center;\\\">Thank you so much to everyone who participated and for all the creative outpouring!<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 1<\\/strong><br>1st place: SXSE<br>2nd place: High West Drifter<\\/p><p style=\\\"text-align: center;\\\"><br><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 2<\\/strong><br>1st place: Desert Rose<br>2nd place: Marianne<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 3<\\/strong><br>1st place: Mamnoon Mule<br>2nd place: Kickin\\u2019 Kabul<\\/p><p style=\\\"text-align: center;\\\"><br><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 4<\\/strong><br>1st place: Mighty Aphrodite<br>2nd place: Sassie Lassie<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 5<\\/strong><br>1st place: Old Beirut<br>2nd place: Figgin\\u2019 A,<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 6<\\/strong><br>1st place: Mediterranean Crossing<br>2nd place: Levantine Elixir<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 7<\\/strong><br>1st place: The French Rind<br>2nd place: Gin(ie) in a Bottle<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 8<\\/strong><br>1st place: Mid East Algonquin<br>2nd place: Chic Sheik<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 9<\\/strong><br>1st place: Night Owl<br>2nd place: Turkish Sunrise<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 10<\\/strong><br>1st place: Habibti<br>2nd place: Persephone Rising<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 11<\\/strong><br>1st place: Sheherazad\\u2019s Fire<br>2nd place: The Devil\\u2019s Wife<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"570\"],\"position\":\"center\"}}}}}', '2014-09-10 23:51:19', '2014-09-10 23:51:19', '56e5e8e1-4cfa-481e-aa90-700afd5db5b2'),
 ('209', '571', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"We\'re pleased to announce the winners of our Cocktail Naming Contest! \",\"slug\":\"were-pleased-to-announce-the-winners-of-our-cocktail-naming-contest\",\"postDate\":1389340800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"572\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Below you\'ll find the 1st and 2nd place winners for all 11 our of specialty cocktails.<\\/p><p>Thank you so much to everyone who participated and for all the creative outpouring!<\\/p><p><strong>No. 1<\\/strong><br>1st place: SXSE<br>2nd place: High West Drifter<\\/p><p><strong>No. 2<\\/strong><br>1st place: Desert Rose<br>2nd place: Marianne<\\/p><p><strong>No. 3<\\/strong><br>1st place: Mamnoon Mule<br>2nd place: Kickin\\u2019 Kabul<\\/p><p><strong>No. 4<\\/strong><br>1st place: Mighty Aphrodite<br>2nd place: Sassie Lassie<\\/p><p><strong>No. 5<\\/strong><br>1st place: Old Beirut<br>2nd place: Figgin\\u2019 A,<\\/p><p><strong>No. 6<\\/strong><br>1st place: Mediterranean Crossing<br>2nd place: Levantine Elixir<\\/p><p><strong>No. 7<\\/strong><br>1st place: The French Rind<br>2nd place: Gin(ie) in a Bottle<\\/p><p><strong>No. 8<\\/strong><br>1st place: Mid East Algonquin<br>2nd place: Chic Sheik<\\/p><p><strong>No. 9<\\/strong><br>1st place: Night Owl<br>2nd place: Turkish Sunrise<\\/p><p><strong>No. 10<\\/strong><br>1st place: Habibti<br>2nd place: Persephone Rising<\\/p><p><strong>No. 11<\\/strong><br>1st place: Sheherazad\\u2019s Fire<br>2nd place: The Devil\\u2019s Wife<\\/p>\"}},\"573\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"570\"],\"position\":\"center\"}}}}}', '2014-09-10 23:51:53', '2014-09-10 23:51:53', '87a348e3-9d03-45ee-9278-dbdcd9598fd8'),
 ('210', '571', '6', '1', 'en_us', '3', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"We\'re pleased to announce the winners of our Cocktail Naming Contest! \",\"slug\":\"were-pleased-to-announce-the-winners-of-our-cocktail-naming-contest\",\"postDate\":1389340800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"572\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Below you\'ll find the 1st and 2nd place winners for all 11 our of specialty cocktails.<\\/p><p>Thank you so much to everyone who participated and for all the creative outpouring!<\\/p><p style=\\\"text-align: center;\\\"><strong>No. 1<\\/strong><br>1st place: SXSE<br>2nd place: High West Drifter<\\/p><p style=\\\"text-align: center;\\\"><strong>No. 2<\\/strong><br>1st place: Desert Rose<br>2nd place: Marianne<\\/p><p style=\\\"text-align: center;\\\"><strong>No. 3<\\/strong><br>1st place: Mamnoon Mule<br>2nd place: Kickin\\u2019 Kabul<\\/p><p style=\\\"text-align: center;\\\"><strong>No. 4<\\/strong><br>1st place: Mighty Aphrodite<br>2nd place: Sassie Lassie<\\/p><p style=\\\"text-align: center;\\\"><strong>No. 5<\\/strong><br>1st place: Old Beirut<br>2nd place: Figgin\\u2019 A,<\\/p><p style=\\\"text-align: center;\\\"><strong>No. 6<\\/strong><br>1st place: Mediterranean Crossing<br>2nd place: Levantine Elixir<\\/p><p style=\\\"text-align: center;\\\"><strong>No. 7<\\/strong><br>1st place: The French Rind<br>2nd place: Gin(ie) in a Bottle<\\/p><p style=\\\"text-align: center;\\\"><strong>No. 8<\\/strong><br>1st place: Mid East Algonquin<br>2nd place: Chic Sheik<\\/p><p style=\\\"text-align: center;\\\"><strong>No. 9<\\/strong><br>1st place: Night Owl<br>2nd place: Turkish Sunrise<\\/p><p style=\\\"text-align: center;\\\"><strong>No. 10<\\/strong><br>1st place: Habibti<br>2nd place: Persephone Rising<\\/p><p style=\\\"text-align: center;\\\"><strong>No. 11<\\/strong><br>1st place: Sheherazad\\u2019s Fire<br>2nd place: The Devil\\u2019s Wife<\\/p>\"}},\"573\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"570\"],\"position\":\"center\"}}}}}', '2014-09-10 23:52:20', '2014-09-10 23:52:20', '4f380dcb-d224-4cc9-8d10-d7f5107c7b54'),
 ('211', '575', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Last but not least - the Mamnoon No. 11!\",\"slug\":\"last-but-not-least-the-mamnoon-no-11\",\"postDate\":1386921600,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>The Mamnoon No. 11 is not a cocktail for the faint of heart. We\'ve got plenty of drinks that will please just about anyone with a tongue, but this is a drink order for those who like a little bit of risk. This spice bomb is made with vodka, apricot liqueur and lime juice - then topped with a few hearty squirts of fresno pepper extract. A beautiful way to open up your palate before a meal, the No. 11 will make your mouth-and eyes-water.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"574\"],\"position\":\"center\"}}}}}', '2014-09-10 23:53:45', '2014-09-10 23:53:45', 'bbbdab17-ed72-4bbe-a9dc-3087149bde38'),
 ('212', '579', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"The Mamnoon No. 10!\",\"slug\":\"the-mamnoon-no-10\",\"postDate\":1386921600,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>If you\'re lookin\' to add a little romance to your evening, the Mamnoon No. 10 is the cocktail for you. We originally had this brut prosecco, pomegranate syrup and rose water concoction as a Valentine\'s Day special, but it was such a hit we had to add it on full time. Subtly sweet and refreshing, this bubbling beauty is perfect for champagne lovers who like a little adventure.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"578\"],\"position\":\"center\"}}}}}', '2014-09-10 23:55:18', '2014-09-10 23:55:18', '4126416a-5e87-446c-a817-4eb2fe5882a9'),
 ('213', '579', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"The Mamnoon No. 10!\",\"slug\":\"the-mamnoon-no-10\",\"postDate\":1386921600,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"580\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>If you\'re lookin\' to add a little romance to your evening, the Mamnoon No. 10 is the cocktail for you. We originally had this brut prosecco, pomegranate syrup and rose water concoction as a Valentine\'s Day special, but it was such a hit we had to add it on full time. Subtly sweet and refreshing, this bubbling beauty is perfect for champagne lovers who like a little adventure.<\\/p>\"}},\"581\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"578\"],\"position\":\"center\"}}}}}', '2014-09-10 23:55:46', '2014-09-10 23:55:46', '3045ecf4-3225-4719-b084-3acf23e3ed73'),
 ('214', '583', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Ain\'t it fine, the No. 9\",\"slug\":\"aint-it-fine-the-no-9\",\"postDate\":1386837000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>The Mamnoon No. 9 is a cocktail, pick-me-up and dessert all rolled into one scrumptious little dollop of drink and this mixology masterpiece deserves a name that conjures the same je ne sais pas as the drink itself. Our master bartender starts with fresh Turkish Coffee (espresso with cardamom) and adds a healthy dose of vodka. He could stop right there. But instead he adds walnut liqueur, coffee liqueur and chocolate bitters and shakes the hell out of it. The result is the beautifully frothy, perfectly drinkable No. 9 that leaves you blissfully buzzed in so many ways.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"582\"],\"position\":\"center\"}}}}}', '2014-09-10 23:57:08', '2014-09-10 23:57:08', '8a2f5aab-49fa-4ec1-9e41-1f07ea80a7cd'),
 ('215', '587', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"And now the Mamnoon No. 8!\",\"slug\":\"and-now-the-mamnoon-no-8\",\"postDate\":1386835200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>The Mamnoon No. 8 is a deceptive little number--just because it looks pretty and you may have to stick out your pinky when you drink it, this guy still packs a lot of punch. Made with bourbon, pomegranate grenadine and grapefruit juice, this is a cocktail for those who balk at the word \\\"cocktail.\\\" Deliciously tart with a hint of sweetness, the No. 8 will convert even the most steadfast beer drinkers in the group.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"586\"],\"position\":\"center\"}}}}}', '2014-09-10 23:58:29', '2014-09-10 23:58:29', 'aa936226-bb02-4038-ad8e-6f495a1f9a9b'),
 ('223', '600', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"A Little Slice of Heaven\",\"slug\":\"a-little-slice-of-heaven\",\"postDate\":1386750600,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>The Mamnoon No. 7 is as refreshing as it is easy to drink. Not sure what to order? The No. 7 is sure to please even the pickiest palates. Made with gin and moscato wine and floated with grapefruit liqueur, this effervescent cocktail is packed with punch.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"590\"],\"position\":\"left\"}}}}}', '2014-09-11 00:05:42', '2014-09-11 00:05:42', '58b50d4f-ab42-4fa1-8eaf-848e2cb6e58a'),
 ('224', '600', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"A Little Slice of Heaven\",\"slug\":\"a-little-slice-of-heaven\",\"postDate\":1386748800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"601\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>The Mamnoon No. 7 is as refreshing as it is easy to drink. Not sure what to order? The No. 7 is sure to please even the pickiest palates. Made with gin and moscato wine and floated with grapefruit liqueur, this effervescent cocktail is packed with punch.<\\/p>\"}},\"602\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"590\"],\"position\":\"center\"}}}}}', '2014-09-11 00:06:32', '2014-09-11 00:06:32', '73f3c48d-76a8-4d97-bf39-8057e9a6d650'),
 ('225', '603', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"And now.. the Mamnoon No. 6!\",\"slug\":\"and-now-the-mamnoon-no-6\",\"postDate\":1386748800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>The Mamnoon No.6 is a delicious symphony of delicate passionfruit syrup and bitingly bitter Aperol. Throw in a healthy glug of vodka and a spritz of Arrack (a traditional Middle Eastern anise-flavored liqueur) this bittersweet fruit bomb will leave you thirsting for more.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"596\"],\"position\":\"center\"}}}}}', '2014-09-11 00:07:36', '2014-09-11 00:07:36', 'e522eb34-44e1-41af-b17a-086849a2648d'),
 ('226', '607', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"The moment you\'ve been waiting for.. the No. 5!\",\"slug\":\"the-moment-youve-been-waiting-for-the-no-5\",\"postDate\":1386664200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>The No. 5 is a Mamnoon favorite! Our most popular drink deserves a name that lives up to it\'s well-earned reputation. This little daddy is a sipping cocktail made with Johnny Drum Bourbon, walnut liqueur and bitters.  Perfectly fruity and nutty--but not too sweet--the No. 5 is ideal for Manhattan lovers looking to add a little excitement to their routine.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"606\"],\"position\":\"center\"}}}}}', '2014-09-11 00:08:52', '2014-09-11 00:08:52', '4f769ed1-5b92-4a41-9bbc-a30cd42cb52e'),
 ('227', '611', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Want some more? It\'s the No. 4!\",\"slug\":\"want-some-more-its-the-no-4\",\"postDate\":1386662400,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Those bold enough to try the Mamnoon No. 4 are rewarded with a smooth, uniquely fresh and almost tropical experience. This flirty little number has a greek yogurt base--intrigued yet?--and is made with Swedish Punsch (an aromatic and spicy sugar-cane spirit,) cherry liqueur and orange flower water. It\'s fruity and fun and will surprise even the most well-versed palates!<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"610\"],\"position\":\"center\"}}}}}', '2014-09-11 00:09:51', '2014-09-11 00:09:51', 'd1da7f9a-1368-4d23-881c-6fe4f059c02e'),
 ('228', '615', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"The Mamnoon No. 3!\",\"slug\":\"the-mamnoon-no-3\",\"postDate\":1386403200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>This super refreshing, easy-to-drink little number is like a Moscow Mule with a twist. It\'s made with Kummel, a caraway and fennel liqueur. It\'s mixed with lime and ginger beer and sprinkled with curry powder.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"614\"],\"position\":\"center\"}}}}}', '2014-09-11 00:10:48', '2014-09-11 00:10:48', '6eda2e33-c8dd-45ad-9cda-b7204cc82d2f'),
 ('229', '619', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Next Up: the Mamnoon No. 2!\",\"slug\":\"next-up-the-mamnoon-no-2\",\"postDate\":1386316800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>The angelic-looking Mamnoon No. 2 is a drink to get the party started. This margherita-all-grown-up is made with blanco tequila, Salers Aperitif (boldly bitter with a touch of sweetness) and grapefruit liqueur. Bright and refreshing, we dare ya to have just one.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"618\"],\"position\":\"center\"}}}}}', '2014-09-11 00:11:42', '2014-09-11 00:11:42', 'ff54a067-3022-4684-8f23-4e21305ad5d8'),
 ('230', '623', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Let\'s kick it off with the Mamnoon No.1!\",\"slug\":\"lets-kick-it-off-with-the-mamnoon-no-1\",\"postDate\":1386144000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Let\'s start off the naming game with one for the whiskey lovers. Mamnoon No. 1 is a sipping cocktail with oat whiskey, coffee liqueur and cardamom bitters. Come in and try one to get those gears turning. Submit your ideas in the comment section!<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"622\"],\"position\":\"center\"}}}}}', '2014-09-11 00:13:01', '2014-09-11 00:13:01', '15ac75f8-feda-4feb-9dd4-34a802f839cf'),
 ('231', '627', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Cocktail Naming Contest!\",\"slug\":\"cocktail-naming-contest\",\"postDate\":1385884800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"626\"],\"position\":\"center\"}},\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Start prepping your palates!<\\/p><p>Mamnoon is hosting a Cocktail Naming Contest to name our drinks #1-11 and we need your help coming up with the most appropriate, creative or outlandish titles.<\\/p><p>The contest runs from December 1- December 31st and we\'ll be accepting submissions on all cocktails throughout the month. Make sure you check back periodically as we\'ll be releasing preparation and ingredient details for each cocktail that will help in the naming process.<\\/p><p>Submissions are limited to one per person per cocktail-- so come up with something fitting for all 11 to increase your chances of winning! Did we mention there\'d be prizes??<\\/p><p>The first place name that is chosen will win a $50 mamnoon gift certificate. The runner-up plus a friend will be able to enjoy a newly-minted mamnoon cocktail on us.<\\/p><p>Submissions will be judged by a panel of mamnoon experts and winners will be announced in early January. <\\/p><p>Submit your names in the comment section of the blog, via Facebook or Twitter or come into the restaurant to fill out a paper submission form.<\\/p><p>Stop by today to sample the cocktails and let the creative juices flow!<\\/p>\"}}}}}', '2014-09-11 00:15:14', '2014-09-11 00:15:14', 'bcf07fa5-20bd-4292-a899-10e7db44f0b2'),
 ('232', '630', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"399\",\"title\":\"Welcome and Mamnoon!\",\"slug\":\"welcome-and-mamnoon\",\"postDate\":1385798400,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Hi there and welcome to the blog for mamnoon restaurant!<\\/p><p>We\'ll be using this blog as a place to showcase everything mamnoon so make sure to stay tuned for menu updates, photos, background stories, events, recipes, contests, and much more. We\'ve been going full throttle in Seattle for 1 year now and we anticipate many more years to come. Check back for the background story as to how we got here and how we see it unfolding in the future. We could not have arrived here without your amazing support and for that we say, mamnoon!<\\/p><p>As part of of our blog launch, we will be posting all the details of our upcoming cocktail naming contest which runs from Dec 1st-31st so keep an eye out for the final details (and most importantly the magnificent prizes) as the month unfolds!<\\/p>\"}}}}}', '2014-09-11 00:16:17', '2014-09-11 00:16:17', '2ae1e543-1714-45df-82cb-82dfdbe4e7c2'),
