 ('322', '775', '3', '394', 'en_us', '2', '', '{\"typeId\":\"3\",\"authorId\":\"394\",\"title\":\"mamnoon delivers!  \",\"slug\":\"mamnoon-delivers\",\"postDate\":1420659900,\"expiryDate\":null,\"enabled\":0,\"fields\":{\"2\":\"<p>you can now get the mamnoon too menu at home using the clever caviar service.&nbsp; click here for details: <a href=\\\"https:\\/\\/www.trycaviar.com\\/seattle\\/mamnoon-628\\\">mamnoon delivery<\\/a><\\/p>\"}}', '2015-01-28 20:28:32', '2015-01-28 20:28:32', '481173db-2323-475f-a091-899adf8a15a8'),
 ('323', '780', '3', '394', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"394\",\"title\":\"February special events!\",\"slug\":\"february-special-events\",\"postDate\":1422477351,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<p>We are starting February with 2 events of note: &nbsp;<\\/p><p>We close at 2:30 pm on Feb 1. We\'ve prepared a special take-out or delivery party meal in honor of the super bowl, details here: <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/blog\\/mamnoon-superbowl-meal-home#entry:776\\\">mamnoon superbowl meal @ home<\\/a>.<\\/p><p>Monday Feb 2nd dinner is a mamnoon junoon.&nbsp; We will offer net proceeds to the Malki-SCM Children Center - helping refugee Syrian children cope with trauma in Jordan. We will also have some menu surprises and classical Arabic Oud music. Please book now, it\'s filling up fast. <\\/p>\"}}', '2015-01-28 20:35:51', '2015-01-28 20:35:51', 'b7ccb9ca-7931-4c29-8bfb-b0ead9a2dcee'),
 ('324', '782', '6', '394', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"394\",\"title\":\"mamnoon junoon feb 2nd\",\"slug\":\"mamnoon-junoon-feb-2nd\",\"postDate\":1422479241,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><img src=\\\"\\/assets\\/blog\\/mamnoon-junoon-headline.jpg#asset:781\\\"><\\/p><p>After a few month\'s hiatus for the holidays, mamnoon junoon is back for monday feb 2nd dinner!<\\/p><p>While the holidays were a great busy period for us here, it was also an unbelievably terrible period for Syrian refugees. The numbers are increasing, the living conditions are getting harder and most of the levant\\/turkey was hit with one of the worst winters on record.&nbsp;<\\/p><p>One of mamnoon\'s goals is to connect you with the people and cultures&nbsp;of the Levant in positive, compassionate and delicious ways.  we have always had an active charity component via our giving to UNHCR (over $25K to date). &nbsp;In addition many of you have asked throughout our existence how to help in direct ways, beyond donating through our Khobz for Syria, Mukassarat, or \\\"mamnoon special\\\" GlassyBaby.&nbsp; We did some research and&nbsp; decided to focus this junoon and the charity effort where we can all make the most impact.&nbsp; <\\/p><p>We will be offering the net proceeds from the night to the Malki-SCM Children Center. This great effort is made possible by the local <a href=\\\"https:\\/\\/salaamculturalmuseum.wordpress.com\\/\\\">Salaam Cultural Museum<\\/a> organization.&nbsp; They have created a few \\\"normal\\\" safe zones with basic schooling, play and art therapy for refugee Syrian children in Jordan. The need is immense and every cent raised here goes directly to the centers.&nbsp; We could not think of a better, more effective way to help those in most need, with the the most future.  <br> <\\/p><p>We need you  to make it a huge night.<\\/p><p>Our famous Chelow Kebab will make a comeback  as well as a special off-menu dessert.  in addition we\\u2019ll have live  classical Arabic Oud music courtesy of Stephen Elaimy, House of Tarab.<br> <br> Please reserve and share, this will be a great way to enjoy a mamnoon feast while doing good. hope to see you here<\\/p><p>mamnoon team<br><\\/p>\"}}}}}', '2015-01-28 21:07:21', '2015-01-28 21:07:21', '5ada1e9d-8d2d-432a-a037-43e5bf0387f8'),
 ('325', '780', '3', '394', 'en_us', '2', '', '{\"typeId\":\"3\",\"authorId\":\"394\",\"title\":\"February special events!\",\"slug\":\"february-special-events\",\"postDate\":1422477300,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<p>We close at 2:30 pm on Feb 1. We prepared a take-out\\/delivery meal for superbowl, get yours here: <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/blog\\/mamnoon-superbowl-meal-home#entry:776:url\\\">mamnoon superbowl meal @ home<\\/a>.<\\/p><p>Monday Feb 2nd dinner is a <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/blog\\/mamnoon-junoon-feb-2nd#entry:782\\\">special mamnoon junoon<\\/a>.&nbsp; We will offer net proceeds to the Malki-SCM Children Center for refugee Syrian children. We will also have some menu surprises and classical Arabic Oud music. Please book now, it\'s filling up fast. <\\/p>\"}}', '2015-01-28 21:11:59', '2015-01-28 21:11:59', 'fc34721c-1d84-43e5-9f68-0e440e3ec448'),
