alling (206) 906 9606 or emailing reservations@mamnoonrestaurant.com<\\/p><p>mamnoon<br><\\/p>\"}},\"923\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"920\"],\"position\":\"right\"}}}}}', '2015-10-08 03:43:55', '2015-10-08 03:43:55', '9f2fd63e-a795-4424-84cd-b63c85664b85'),
