 ('628', '1184', '6', '394', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"394\",\"title\":\"tarab 4 syria fundraiser\",\"slug\":\"tarab-4-syria-fundraiser\",\"postDate\":1468890526,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new3\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1182\"],\"position\":\"center\"}},\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1181\"],\"position\":\"right\"}},\"new2\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<h3><em>tarab: &nbsp;a state of euphoria invoked by music<\\/em>&nbsp;<img src=\\\"\\/assets\\/blog\\/arabic-tarab.jpg#asset:1183\\\"><\\/h3><div>We\'ve all felt it, &nbsp;out of the blue while listening to some piece of music - you get overwhelmed with emotion, get goosebumps, feel ecstatic or feel very sad and start tearing up. Often you\'ll catch yourself unconsciously tapping your feet, humming a tune accompanying a distant radio, or get lost in your work while music is blasting. &nbsp;Sometimes you\'ll burst into song at a concert with thousands of others in unison, other times you\'re with a group of friends jamming endlessly over the same riffs with a simple drum and guitar. &nbsp;Music has its way with us, it connects with higher order perception functions and works on emotions directly, without interpreters, translators or coordinating rational guardians. &nbsp;<\\/div><div><br><\\/div><div>Music is a great unifier, &nbsp;even if no one in a group can agree with the interpretation, they will all share a common visceral experience. &nbsp;In that way music is like food, &nbsp;food is experienced in the same visceral unifying way. &nbsp; b&nbsp;I\'ve often said that when you\'re eating a man\'ousheh in mamnoon or mamnoon street, you are so much closer at that moment to someone eating a man\'ousheh in Beirut. This is absolutely true of music, when you hear the traditional&nbsp;<a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=DrJ4DUP1oss\\\" target=\\\"_blank\\\">Umm Kalthoum<\\/a>,&nbsp;&nbsp;<a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=YZVdkE6e9B4\\\" target=\\\"_blank\\\">Sabah Fakhri<\\/a>, &nbsp;<a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=151IbT6ucO4&index=3&list=PL3Onu1mdV7YGWyXc36KrX3mRNvJJmFF9l\\\" target=\\\"_blank\\\">Fairuz<\\/a> or the ultra modern <a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=avEm0Rui2N8\\\" target=\\\"_blank\\\">hellopsychaleppo<\\/a> you are so much closer to Middle Easterners through shared experience and emotion.&nbsp;<\\/div><div><br><\\/div><p>One of the most amazing things to witness at mamnoon is how people of all kinds, races, religions come together, socialize and connect&nbsp;in the same medium of great food, surroundings and music. &nbsp;We\'ve been told&nbsp;that it\'s a unique and very appealing draw&nbsp;of the mamnoon dining experience. A&nbsp;key element for our exciting new <a href=\\\"https:\\/\\/www.facebook.com\\/mbarseattle\\/?fref=ts\\\" target=\\\"_blank\\\">mbar<\\/a> project is to replicate this diverse and ultra-social experience in an unbelievable geographic setting.&nbsp;<\\/p><div><br><\\/div><div>Charity is a core part of the mamnoon mission. We have raised substantial funds over the years to help Syrian Refugees with incredible support from a generous and worldly Seattle and its amazing inhabitants. &nbsp;Over the years the Refugee crisis has only gotten worse and its effects deeper and deeper. &nbsp;It has all the hallmarks of becoming a multi-generational disaster, impacting not only those fleeing the strife today, but also their kids and depressingly their kids\' kids.&nbsp;<\\/div><div><br><\\/div><div>It\'s worth reflecting on this fact for a bit - the large scale Palestinian refugee crisis in the Middle East started with the events of 1948. There are Palestinian refugee camps in neighboring countries that have been continuously inhabited since then - 65+ years of refugee-dom. &nbsp;The situation in the camps is deplorable and the worst part is the lack of opportunity afforded the inhabitants. &nbsp;The Syrian Refugee crisis scale is at least 10 times larger than that and there is no end in sight to the conflict. &nbsp; It seems that refugees get stuck in a&nbsp;vicious cycle where one generation leaves the subsequent generation less able to help themselves.&nbsp;Already the impacts on neighboring countries, the EU and events around the world are straining existing aid, financial and political systems. Just imagine what can happen over decades.&nbsp;<\\/div><div><br><\\/div><div>My experience with higher education and working in the US has taught me a valuable lesson, &nbsp;anyone with some freedom,&nbsp; the right motivation, &nbsp;education and work opportunities can build a good future for themselves, family and give back to the community. &nbsp;It\'s really that simple. &nbsp;If we can help educate and create opportunities for Syrian Refugee children they will be able to build better futures for themselves and help bootstrap others. &nbsp;This is a virtuous cycle. &nbsp;The only downside is that it\'s not immediate and needs to be nurtured for some time to get going.&nbsp;<\\/div><div><br><\\/div><div>This has changed our strategy for charity, &nbsp;instead of galvanizing giving for general aid (which is still necessary), we\'ve chosen to focus on organizations and set-ups that can provide the safety, education and opportunities to start the virtuous cycle going, even if it is for relatively few. &nbsp;The hope is that by doing so we can positively impact the lives of few today, and many more tomorrow.&nbsp;<\\/div><p><br><\\/p><p>We\'ve found a great&nbsp;organization to help us with this: &nbsp;<a href=\\\"https:\\/\\/www.rescue.org\\/\\\" target=\\\"_blank\\\">International Rescue Committee<\\/a><span class=\\\"redactor-unlink\\\"><\\/span>. &nbsp;The IRC&nbsp;has been at the forefront of aid operations with Syrian Refugees, and has upped its efforts on helping build futures for children. I\'ll post more details on the project we will be targeting:&nbsp;Reyhanli Youth Center in Turkey.&nbsp;<\\/p><p>We have close to hand many&nbsp;elements for a primordial soup of humanity, if we can put them together and add some spark maybe we can create something that lives on. &nbsp;That was the idea behind tarab 4 syria - to see if we can put everything together, and apply your spark.&nbsp;<\\/p><p>The event takes place over 2 days, in 3 locations:<\\/p><p>-&nbsp; On August 4th, and for 35$ there will be an all you can eat&nbsp;mamnoon street and anar food and drink menu and entertained by&nbsp;musicians Black Giraffe and Dj Dana Dub, Dj Spank&nbsp;from 4-9 pm. &nbsp;&nbsp;<\\/p><p>- On August 4th we will have an all inclusive&nbsp;special a la zao\'ak menu at mamnoon with Musar Arak and curated paired wines&nbsp;for 250$\\/person, music provided by House of Tarab. &nbsp;Details of the menu will be available shortly. &nbsp;reservations strongly recommended.&nbsp;<\\/p><p>- On August 5th, we will host an invite-only event&nbsp;from 5-9 pm&nbsp;with a special tasting menu by Jason Stratton and some of his Top Chef colleagues. The menu&nbsp;paired with Chateau Musar wines and will be the first ever event held at mbar. &nbsp;Music will be provided by Dj Riz.&nbsp;Please inquire with jonny@mamnoonrestaurant.com about this event.&nbsp;<\\/p><p>- On August 5th starting 9 pm, we will host an invite-only&nbsp;tarab 4 syria party on the mbar rooftop deck&nbsp;featuring bites and special drinks, as well as music by DJ Riz and Hellopsycaleppo. &nbsp; Please inquire with jonny@mamnoonrestaurant.com about this event.&nbsp;<\\/p><p><br><\\/p><p><br><\\/p><p><br><\\/p><p><br><\\/p><p><br><\\/p><p><br><\\/p><p><br><\\/p>\"}}}}}', '2016-07-19 01:08:46', '2016-07-19 01:08:46', '08f04c44-8c88-4e80-bd33-a408f730fd6d'),
