d is experienced in the same visceral way by everyone. &nbsp;&nbsp;I\'ve often said that when you\'re eating a man\'ousheh in mamnoon or mamnoon street, you are so much closer at that moment to someone eating a man\'ousheh in Beirut. This is absolutely true of music, when you hear the traditional&nbsp;<a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=DrJ4DUP1oss\\\" target=\\\"_blank\\\">Umm Kalthoum<\\/a>,&nbsp;&nbsp;<a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=YZVdkE6e9B4\\\" target=\\\"_blank\\\">Sabah Fakhri<\\/a>, &nbsp;<a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=151IbT6ucO4&index=3&list=PL3Onu1mdV7YGWyXc36KrX3mRNvJJmFF9l\\\" target=\\\"_blank\\\">Fairuz<\\/a> or the ultra modern <a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=avEm0Rui2N8\\\" target=\\\"_blank\\\">hellopsychaleppo<\\/a> you are so much closer to Middle Easterners through shared experience and emotion.&nbsp;<\\/div>\\r\\n\\r\\n\\r\\n\\r\\n<div><br><\\/div>\\r\\n\\r\\n\\r\\n\\r\\n<p>One of the most amazing things to witness at mamnoon is how people of all kinds, races, religions come together, socialize and connect&nbsp;in the same medium of great food, surroundings and music. &nbsp;We\'ve been told&nbsp;that it\'s a unique and very appealing draw&nbsp;of the mamnoon dining experience. A&nbsp;key element for our exciting new <a href=\\\"https:\\/\\/www.facebook.com\\/mbarseattle\\/?fref=ts\\\" target=\\\"_blank\\\">mbar<\\/a> project is to replicate this diverse and ultra-social experience in an unbelievable geographic setting.&nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<div><br><\\/div>\\r\\n\\r\\n\\r\\n\\r\\n<div>Charity is a core part of the mamnoon mission. We have raised substantial funds over the years to help Syrian Refugees with incredible support from a generous and worldly Seattle and its amazing inhabitants. &nbsp;Over the years the Refugee crisis has only gotten worse and its effects deeper and deeper. &nbsp;It has all the hallmarks of becoming a multi-generational disaster, impacting not only those fleeing the strife today, but also their kids and depressingly their kids\' kids.&nbsp;<\\/div>\\r\\n\\r\\n\\r\\n\\r\\n<div><br><\\/div>\\r\\n\\r\\n\\r\\n\\r\\n<div>It\'s worth reflecting on this fact for a bit - the large scale Palestinian refugee crisis in the Middle East started with the events of 1948. There are Palestinian refugee camps in neighboring countries that have been continuously inhabited since then - 65+ years of refugee-dom. &nbsp;The situation in the camps is deplorable and the worst part is the lack of opportunity afforded the inhabitants. &nbsp;The Syrian Refugee crisis scale is at least 10 times larger than that and there is no end in sight to the conflict. &nbsp; It seems that refugees get stuck in a&nbsp;vicious cycle where one generation leaves the subsequent generation less able to help themselves.&nbsp;Already the impacts on neighboring countries, the EU and events around the world are straining existing aid, financial and political systems. Just imagine what can happen over decades.&nbsp;<\\/div>\\r\\n\\r\\n\\r\\n\\r\\n<div><br><\\/div>\\r\\n\\r\\n\\r\\n\\r\\n<div>My experience with higher education and working in the US has taught me a valuable lesson, &nbsp;anyone with some freedom,&nbsp; the right motivation, &nbsp;education and work opportunities can build a good future for themselves, family and give back to the community. &nbsp;It\'s really that simple. &nbsp;If we can help educate and create opportunities for Syrian Refugee children they will be able to build better futures for themselves and help bootstrap others. &nbsp;This is a virtuous cycle. &nbsp;The only downside is that it\'s not immediate and needs to be nurtured for some time to get going.&nbsp;<\\/div>\\r\\n\\r\\n\\r\\n\\r\\n<div><br><\\/div>\\r\\n\\r\\n\\r\\n\\r\\n<div>This has changed our strategy for charity, &nbsp;instead of galvanizing giving for general aid (which is still necessary), we\'ve chosen to focus on organizations and set-ups that can provide the safety, education and opportunities to start the virtuous cycle going, even if it is for relatively few. &nbsp;The hope is that by doing so we can positively impact the lives of few today, and many more tomorrow.&nbsp;<\\/div>\\r\\n\\r\\n\\r\\n\\r\\n<p><br><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>We\'ve found a great&nbsp;organization to help us with this: &nbsp;<a href=\\\"https:\\/\\/www.rescue.org\\/\\\" target=\\\"_blank\\\">International Rescue Committee<\\/a>. &nbsp;The IRC&nbsp;has been at the forefront of aid operations with Syrian Refugees, and has upped its efforts on helping build futures for children. I\'ll post more details on the project we will be targeting:&nbsp;Reyhanli Youth Center in Turkey.&nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>We have close to hand many&nbsp;elements for a primordial soup of humanity, if we can put them together and add some spark maybe we can create something that lives on. &nbsp;That was the idea behind tarab 4 syria - to see if we can put everything together, and apply your spark.&nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>The event takes place over 2 days, in 3 locations:<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>-&nbsp; On August 4th, and for 35$ there will be an all you can eat&nbsp;mamnoon street and anar food and drink menu and entertained by&nbsp;musicians Black Giraffe and Dj Dana Dub, Dj Spank&nbsp;from 4-9 pm. &nbsp;&nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>- On August 4th we will have an all inclusive&nbsp;special a la zao\'ak menu at mamnoon with Musar Arak and curated paired wines&nbsp;for 250$\\/person, music provided by House of Tarab. &nbsp;Details of the menu will be available shortly. &nbsp;reservations strongly recommended.&nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>- On August 5th, we will host an invite-only event&nbsp;from 5-9 pm&nbsp;with a special tasting menu by Jason Stratton and some of his Top Chef colleagues. The menu&nbsp;paired with Chateau Musar wines and will be the first ever event held at mbar. &nbsp;Music will be provided by Dj Riz.&nbsp;Please inquire with jonny@mamnoonrestaurant.com about this event.&nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>- On August 5th starting 9 pm, we will host an invite-only&nbsp;tarab 4 syria party on the mbar rooftop deck&nbsp;featuring bites and special drinks, as well as music by DJ Riz and Hellopsycaleppo. &nbsp; Please inquire with jonny@mamnoonrestaurant.com about this event.&nbsp;<\\/p>\\r\\n\\r\\n<p><br><\\/p>\\r\\n\\r\\n<p>Come join us and get into your tarab and do lasting good.&nbsp; There will be many ways to participate, for all budgets and preferences.&nbsp; I look forward to seeing many of you there.&nbsp;<\\/p>\\r\\n\\r\\n<p><br><\\/p>\\r\\n\\r\\n<p>Wassef<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p><br><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p><br><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p><br><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p><br><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p><br><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p><br><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p><br><\\/p>\"}}}}}', '2016-08-04 14:53:36', '2016-08-04 14:53:36', '3383ade0-fda8-4601-bfe6-824f65fd940a'),
 ('633', '921', '6', '394', 'en_us', '5', '', '{\"typeId\":\"6\",\"authorId\":\"395\",\"title\":\"Soup for Syria Fundraiser,  Thursday October 22, 2015\",\"slug\":\"soup-for-syria-fundraiser-thursday-october-22-2015\",\"postDate\":1444276200,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"923\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"920\"],\"position\":\"right\"}},\"922\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Dominating the news from around the world, we are troubled by the plight of Syrian refugees fleeing their country in massive numbers- taking little to nothing of their home and possessions and striving to find a country in which to build a better life.<br>On Thursday, October 22nd, we will partner with local retailer, Elliot Bay Book Company, to organize a fundraising event in the restaurant with 100% of the money designated toward 3 organizations: <a href=\\\"http:\\/\\/www.mercycorps.org\\/countries\\/syria\\\">Mercy Corps<\\/a>,   <a href=\\\"http:\\/\\/www.msf.org\\/syria\\\">Medecins Sans Fronti\\u00e8res<\\/a> and <a href=\\\"http:\\/\\/www.karamfoundation.org\\/\\\">Karam Foundation<\\/a>. We hope that you will come out to support them. <br><\\/p>\\r\\n\\r\\n<p>Inspired by the cookbook, <a href=\\\"http:\\/\\/www.soupforsyria.com\\/book.php\\\">Soup for Syria<\\/a>, from Lebanese author, Barbara Massaad, Chef Jason Stratton has enlisted support from Seattle\\u2019s culinary community.<br><\\/p>\\r\\n\\r\\n<p>In the dining room, Jason and friends will construct a fantastic, multi-course dinner with beverage pairings. The dinner will include a copy of Barbara\\u2019s book.  The cost of the dinner is $250 per person (+ tax and gratuity).<br><\\/p>\\r\\n\\r\\n<p>Half-dozen chefs will contribute a soup for an all-you-can-eat, Soup, Bread and Beverage for $35, available at the communal table and Mamnoon Street. Seating will be on a first come, first served basis.<br>{Please note that these will be the only menus offered on that evening.}<\\/p>\\r\\n\\r\\n<p>plan to come in for the soup or reserve now by calling (206) 906 9606 or emailing reservations@mamnoonrestaurant.com<\\/p>\\r\\n\\r\\n<p>mamnoon<br><\\/p>\"}}}}}', '2016-08-04 14:53:50', '2016-08-04 14:53:50', 'a01e12b0-f14a-4466-941f-69ced9fc6a4c'),
 ('634', '1188', '3', '394', 'en_us', '3', '', '{\"typeId\":\"3\",\"authorId\":\"394\",\"title\":\"announcing \\\"tarab 4 syria\\\"  fund raiser tonight and tomorrow\",\"slug\":\"announcing-tarab-4-syria-fund-raiser-events-on-august-4th-and-5th\",\"postDate\":1469043420,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"2\":\"<p>Our \\\"tarab 4 syria\\\"&nbsp; fund raiser is on tonight and tomorrow at mbar.&nbsp; Looking forward to seeing you. The program and fund raising link is <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/blog\\/tarab-4-syria-fundraiser#entry:1184:url\\\">here<\\/a><\\/p>\"}}', '2016-08-04 14:56:05', '2016-08-04 14:56:05', 'a28fd02a-b4a9-4e2f-bc94-8fae465c3606'),
