 ('798', '1330', '6', '1083', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1083\",\"title\":\"bread service\",\"slug\":\"bread-service\",\"postDate\":1479520177,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p class=\\\"MsoNormal\\\">The civil war in Syria is in its 5&lt;sup&gt;th&lt;\\/sup&gt; year and has taken an immense toll on the lives of everyday people there.&nbsp; The extreme situation, there and elsewhere in the Middle East, weighs heavily on our hearts and minds.&nbsp; mamnoon has successfully corralled the community in Seattle to support several charitable activities to help with this dire situation.&nbsp; Unfortunately, today millions do not have access to basics like bread and clean drinking water.&nbsp; This heartbreaking truth reminds us how lucky we are to live in a place that we do have access to those things and so much more.<u><\\/u><u><\\/u><\\/p>\\r\\n\\r\\n<p class=\\\"MsoNormal\\\">mamnoon is a beacon for modern middle eastern hospitality, and for years we\\u2019ve welcomed you with our fresh bread and our exclusive za\\u2019atar imported from the region \\u2013 the very best of what our culture can provide.&nbsp; While we still believe in providing this level of hospitality, we can no longer justify giving bread away when so many can\\u2019t get it at all.&nbsp; Another impact of the chaos in the region is that our spices and exclusive za\'atar have become very difficult to import.&nbsp; Under the circumstances we are changing the way that we are approaching our bread service.&nbsp; <br><br>Starting on Monday November 21st, we will no longer offer our barbari bread to start our meals.&nbsp; We will continue to offer our incredible freshly baked pita with your meal, but will move the za\'atar and olive oil to our menu at a nominal charge.&nbsp; We are going to continue to provide the highest quality spices and flavors, and our hope is that everyone will enjoy these offerings with an awareness of the deep connection to a region that is experiencing a shortage of basics, like bread, that we are so lucky to have.<br><br>Our mission is to bridge cultures, and it is sometimes through seemingly very small gestures that this bridge is crossed.&nbsp; If you are moved to do so, we always have ways of donating to charities that have shown their commitment to efficient humanitarian work, and we are happy to connect you to them.&nbsp; Several times throughout the year we host fundraisers, and currently we have retail items available that support charities that we have vetted.&nbsp; Our hope is that our daily work in creating food and flavor experiences, that link us to cultures that are far from Seattle, generates an understanding of the humanity that we all share.&nbsp; <br><br>mamnoon to you.<\\/p>\"}}}}}', '2016-11-19 01:49:37', '2016-11-19 01:49:37', 'eee50991-c417-4196-9dbc-94d369432491'),
 ('799', '1330', '6', '1083', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"1083\",\"title\":\"bread service\",\"slug\":\"bread-service\",\"postDate\":1479520140,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"1331\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p class=\\\"MsoNormal\\\">The civil war in Syria is in its 5th year and has taken an immense toll on the lives of everyday people there.&nbsp; The extreme situation, there and elsewhere in the Middle East, weighs heavily on our hearts and minds.&nbsp; mamnoon has successfully corralled the community in Seattle to support several charitable activities to help with this dire situation.&nbsp; Unfortunately, today millions do not have access to basics like bread and clean drinking water.&nbsp; This heartbreaking truth reminds us how lucky we are to live in a place that we do have access to those things and so much more.<\\/p>\\r\\n\\r\\n<p class=\\\"MsoNormal\\\">mamnoon is a beacon for modern middle eastern hospitality, and for years we\\u2019ve welcomed you with our fresh bread and our exclusive za\\u2019atar imported from the region \\u2013 the very best of what our culture can provide.&nbsp; While we still believe in providing this level of hospitality, we can no longer justify giving bread away when so many can\\u2019t get it at all.&nbsp; Another impact of the chaos in the region is that our spices and exclusive za\'atar have become very difficult to import.&nbsp; Under the circumstances we are changing the way that we are approaching our bread service.&nbsp; <br><br>Starting on Monday November 21st, we will no longer offer our barbari bread to start our meals.&nbsp; We will continue to offer our incredible freshly baked pita with your meal, but will move the za\'atar and olive oil to our menu at a nominal charge.&nbsp; We are going to continue to provide the highest quality spices and flavors, and our hope is that everyone will enjoy these offerings with an awareness of the deep connection to a region that is experiencing a shortage of basics, like bread, that we are so lucky to have.<br><br>Our mission is to bridge cultures, and it is sometimes through seemingly very small gestures that this bridge is crossed.&nbsp; If you are moved to do so, we always have ways of donating to charities that have shown their commitment to efficient humanitarian work, and we are happy to connect you to them.&nbsp; Several times throughout the year we host fundraisers, and currently we have retail items available that support charities that we have vetted.&nbsp; Our hope is that our daily work in creating food and flavor experiences, that link us to cultures that are far from Seattle, generates an understanding of the humanity that we all share.&nbsp; <br><br>mamnoon to you.<\\/p>\"}}}}}', '2016-11-19 01:50:02', '2016-11-19 01:50:02', '0b1f11e6-3309-4fcb-a8bf-3a61c526383f'),
 ('800', '1330', '6', '1083', 'en_us', '3', '', '{\"typeId\":\"6\",\"authorId\":\"1083\",\"title\":\"bread service\",\"slug\":\"bread-service\",\"postDate\":1479520140,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"1331\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p class=\\\"MsoNormal\\\">The civil war in Syria is in its 5th year and has taken an immense toll on the lives of everyday people there.&nbsp; The extreme situation, there and elsewhere in the Middle East, weighs heavily on our hearts and minds.&nbsp; mamnoon has successfully corralled the community in Seattle to support several charitable activities to help with this dire situation.&nbsp; Unfortunately, today millions do not have access to basics like bread and clean drinking water.&nbsp; This heartbreaking truth reminds us how lucky we are to live in a place that we do have access to those things and so much more.<\\/p>\\r\\n\\r\\n<p class=\\\"MsoNormal\\\">mamnoon is a beacon for modern middle eastern hospitality, and for years we\\u2019ve welcomed you with our fresh bread and our exclusive za\\u2019atar imported from the region \\u2013 the very best of what our culture can provide.&nbsp; While we still believe in providing this level of hospitality, we can no longer justify giving bread away when so many can\\u2019t get it at all.&nbsp; Another impact of the chaos in the region is that our spices and exclusive za\'atar have become very difficult to import.&nbsp; Under the circumstances we are changing the way that we are approaching our bread service.&nbsp; <br><br>Starting on Monday November 21st, we will no longer offer our barbari bread to start our meals.&nbsp; We will continue to offer our incredible, freshly baked pita with your meal, but will move the za\'atar and olive oil to our menu at a nominal charge.&nbsp; We are going to continue to provide the highest quality spices and flavors, and our hope is that everyone will enjoy these offerings with an awareness of the deep connection to a region that is experiencing a shortage of basics, like bread, that we are so lucky to have.<br><br>Our mission is to bridge cultures, and it is sometimes through seemingly very small gestures that this bridge is crossed.&nbsp; If you are moved to do so, we always have ways of donating to charities that have shown their commitment to efficient humanitarian work, and we are happy to connect you to them.&nbsp; Several times throughout the year we host fundraisers, and currently we have retail items available that support charities that we have vetted.&nbsp; Our hope is that our daily work in creating food and flavor experiences, that link us to cultures that are far from Seattle, generates an understanding of the humanity that we all share.&nbsp; <br><br>mamnoon to you.<\\/p>\"}}}}}', '2016-11-19 01:52:37', '2016-11-19 01:52:37', '7811c73e-d01e-447c-a046-7e89a29bd31b'),
 ('801', '1332', '6', '394', 'en_us', '1', NULL, '{\"typeId\":\"6\",\"authorId\":\"394\",\"title\":\"mamnoon turns 4\",\"slug\":\"mamnoon-turns-4\",\"postDate\":1479948100,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":[]}', '2016-11-24 00:41:41', '2016-11-24 00:41:41', '89b96882-5646-42a7-ac89-a6b9299aacef'),
 ('802', '1332', '6', '394', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"394\",\"title\":\"mamnoon turns 4\",\"slug\":\"mamnoon-turns-4\",\"postDate\":1479948060,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1333\"],\"position\":\"left\"}},\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong class=\\\"redactor-inline-converted\\\">mamnoon turns 4!<\\/strong><\\/p>\\r\\n\\r\\n<p>mamnoon debuted on 11\\/19\\/2012. We opened to an incredible reception by the&nbsp; amazing people of Seattle and we have been going strong ever since.&nbsp; &nbsp;<br>mamnoon\'s mission is to bridge the ancient and deep Middle Eastern cultures with the progressive and forward looking Northwest culture.&nbsp; We are doing it by staying as true as possible to the roots of the food and hospitality while projecting these cultures into the future, one that is influenced by our experiences here over the last 25 years. <br>We are proud of what we\'ve been able to do with your help. We are extremely thankful to you for giving us the opportunity to serve you and the community at large, and for making us feel very much part of the fabric of Capitol Hill, Seattle. <\\/p>\\r\\n\\r\\n<p><strong>mamnoon 4th anniversary week<\\/strong><br>There will be many opportunities for you to&nbsp; celebrate and enjoy our 4th anniversary throughout the week starting 11\\/28. <br>From Monday to Thursday all items on our super hot happy hour menu will be for $4<br>On Friday and Saturday Executive Chef Carrie Marshaney has prepared a special 4 course tasting menu for $44, with special wine pairing for $24.&nbsp; Please mention your interest in the tasting menu when you reserve<br>Through out the week you can enjoy a Champagne and Harra Frites special for $24 - featuring our amazing harra frites, za\'atar mayo and a half bottle of Chandon Brut Classic.<br>We hope to celebrate with you soon.<\\/p>\"}},\"new3\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1334\"],\"position\":\"left\"}}}}}', '2016-11-24 00:43:49', '2016-11-24 00:43:49', '114b923d-81d2-4800-b722-c06cf4fae8c3'),
 ('803', '1338', '3', '394', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"394\",\"title\":\"mamnoon turns 4 \",\"slug\":\"mamnoon-turns-4\",\"postDate\":1479948319,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"2\":\"<p>mamnoon is celebrating its 4th anniversary next week, come join us, <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/blog\\/mamnoon-turns-4#entry:1332\\\">details here<\\/a><\\/p>\"}}', '2016-11-24 00:45:19', '2016-11-24 00:45:19', '89aa4fd0-1fc2-436e-9843-998755b0f74e'),
