 ('823', '1338', '3', '394', 'en_us', '2', '', '{\"typeId\":\"3\",\"authorId\":\"394\",\"title\":\"mamnoon turns 4 \",\"slug\":\"mamnoon-turns-4\",\"postDate\":1479948300,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"2\":\"<p>mamnoon is celebrating its 4th anniversary for a week starting today, come join us, <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/blog\\/mamnoon-turns-4#entry:1332:url\\\">details here<\\/a><\\/p>\"}}', '2016-11-28 21:25:22', '2016-11-28 21:25:22', 'e0dd77fa-b3fd-4cce-8240-f07dd9d7b0fd'),
 ('824', '1332', '6', '394', 'en_us', '3', '', '{\"typeId\":\"6\",\"authorId\":\"394\",\"title\":\"mamnoon turns 4\",\"slug\":\"mamnoon-turns-4\",\"postDate\":1479948060,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"1335\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1333\"],\"position\":\"left\"}},\"1336\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong class=\\\"redactor-inline-converted\\\">mamnoon turns 4!<\\/strong><\\/p>\\r\\n\\r\\n<p>mamnoon debuted on 11\\/19\\/2012. We opened to an incredible reception by the&nbsp; amazing people of Seattle and we have been going strong ever since.&nbsp; &nbsp;<br>mamnoon\'s mission is to bridge the ancient and deep Middle Eastern cultures with the progressive and forward looking Northwest culture.&nbsp; We are doing it by staying as true as possible to the roots of the food and hospitality while projecting these cultures into the future, one that is influenced by our experiences here over the last 25 years. <br>We are proud of what we\'ve been able to do with your help. We are extremely thankful to you for giving us the opportunity to serve you and the community at large, and for making us feel very much part of the fabric of Capitol Hill, Seattle. <\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p><strong class=\\\"redactor-inline-converted\\\">mamnoon 4th anniversary week<\\/strong><br>There will be many opportunities for you to&nbsp; celebrate and enjoy our 4th anniversary throughout the week starting 11\\/28. <br>From Monday to Thursday all items on our super hot happy hour menu will be for $4<br>On Friday and Saturday Executive Chef Carrie Marshaney has prepared a special 4 course tasting menu for $44, with special wine pairing for $24.&nbsp; Please mention your interest in the tasting menu when you reserve<br>Through out the week you can enjoy a Champagne and Harra Frites special for $24 - featuring our amazing harra frites, za\'atar mayo and a half bottle of Chandon Brut Classic.<\\/p><p><strong>Helping the White Helmets<\\/strong><br><\\/p><p>We will also be donating 15% of our revenue during this week to the life saving heroes of the White Helmets: <a href=\\\"https:\\/\\/www.whitehelmets.org\\/en\\\">https:\\/\\/www.whitehelmets.org\\/e...<\\/a>We hope that we can share all our good fortunes with those most needing support in Syria.<\\/p><p>&nbsp;<br>We hope to celebrate with you soon.<\\/p>\"}},\"1337\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1334\"],\"position\":\"left\"}}}}}', '2016-11-28 21:27:56', '2016-11-28 21:27:56', 'c4d2cf0f-0fca-4105-8797-ddd9091fc09e'),
 ('825', '1338', '3', '394', 'en_us', '3', '', '{\"typeId\":\"3\",\"authorId\":\"394\",\"title\":\"mamnoon turns 4 \",\"slug\":\"mamnoon-turns-4\",\"postDate\":1479948300,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"2\":\"<p>thank you for making our 4th anniversary last week a huge success -&nbsp; <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/blog\\/mamnoon-turns-4#entry:1332:url\\\">details here<\\/a><\\/p>\"}}', '2016-12-09 17:37:56', '2016-12-09 17:37:56', 'd0871d39-73df-4ba5-9113-d754bd380fc7'),
