 ('828', '1358', '6', '1083', 'en_us', '1', NULL, '{\"typeId\":null,\"authorId\":\"1083\",\"title\":\"New Year\'s Eve\",\"slug\":\"new-years-eve\",\"postDate\":1482029961,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"38\":\"\",\"48\":\"1\",\"46\":\"\",\"47\":[\"1356\",\"1357\"],\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>This New Year\'s Eve mamnoon will be offering a four course tasting menu for everyone that comes in for dinner!&nbsp; We will forego our a la carte options for a $65\\/person menu with an optional wine pairing for $30\\/person.<\\/p><h5>Course One: Cold Mezze<\\/h5><p>spot prawns with hummus<\\/p><p>fattoush salad<\\/p><p>dolmeh, yogurt, barberries<\\/p><p>lamb kibbeh nayeh<\\/p><p>rabbit liver mousse<\\/p><h5>Course Two: Hot Mezze<\\/h5><p>kibbeh, tarrator<\\/p><p>spinach borek<\\/p><p>eggplant, lamb, yogurt, pomegranate<\\/p><p>khobz bi fleifleh<\\/p><h5>Course Three: Meshoui<\\/h5><p>served with chelow rice<\\/p><p>trout, herbs, barberries, angelica, almonds, new potatoes<\\/p><p><em>or<\\/em><\\/p><p>filet mignon, mushrooms, confit garlic, spiced au jus<\\/p><h5>Course Four: Dessert<\\/h5><p>turkish affogato, cardamom, pistachio biscotti<\\/p><p><em>or<\\/em><\\/p><p>labneh mousse parfait, pear, quince sorbet, turkish delight<\\/p>\"}}}}}', '2016-12-18 02:59:21', '2016-12-18 02:59:21', '02137a6a-b407-4d65-bea0-ba852d1eedc4'),
 ('829', '1360', '3', '1083', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1083\",\"title\":\"Holiday Hours\",\"slug\":\"holiday-hours\",\"postDate\":1481961600,\"expiryDate\":1484035200,\"enabled\":1,\"parentId\":null,\"fields\":{\"2\":\"<p>mamnoon will be closed for Christmas eve, Christmas, and New Year\'s Day.&nbsp; Please come join us for <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/blog\\/new-years-eve#entry:1358\\\">New Year\'s Eve and enjoy a tasting menu<\\/a> and a&nbsp;celebratory toast at midnight!<\\/p><p>We will also be closed to throw a belated holiday party for our wonderful employees on Monday January 9th.<\\/p><p>mamnoon to you<\\/p>\"}}', '2016-12-18 03:01:40', '2016-12-18 03:01:40', 'fa1e43d7-961a-47ac-b805-8fa22fb76103'),
