 ('962', '1440', '6', '1083', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1083\",\"title\":\"President\'s Day\",\"slug\":\"presidents-day\",\"postDate\":1487145600,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1436\"],\"position\":\"center\"}},\"new3\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Charity is a core part of the mamnoon mission. We have raised substantial funds over the years to help refugees with incredible support from the&nbsp;generous and worldly city of&nbsp;Seattle and its amazing inhabitants. Over the years the refugee crisis has only gotten worse and its effects continue to grow&nbsp;deeper. That\'s why this&nbsp;President\'s Day, we will be donating 10% of our revenue from lunch to the American Civil Liberties Union&nbsp;to fight for the rights of immigrants and refugees.<\\/p>\\r\\n\\r\\n<p>Hopefully you\'ve got the day off and will come join us in contributing to the mission of the ACLU by&nbsp;having lunch with us. We hope to see you here.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>mamnoon to you<\\/p>\"}},\"new4\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1438\"],\"position\":\"center\"}}}}}', '2017-02-12 02:45:28', '2017-02-12 02:45:28', 'c9c99fa0-db28-4c33-ae5a-b5da59421c6b'),
 ('963', '1440', '6', '399', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"1083\",\"title\":\"President\'s Day\",\"slug\":\"presidents-day\",\"postDate\":1487145600,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"1441\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1436\"],\"position\":\"center\"}},\"1442\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Charity is a core part of the mamnoon mission. We have raised substantial funds over the years to help refugees with incredible support from the&nbsp;generous and worldly city of&nbsp;Seattle and its amazing inhabitants. Over the years the refugee crisis has only gotten worse and its effects continue to grow&nbsp;deeper. That\'s why this&nbsp;President\'s Day, we will be donating 10% of our revenue to the American Civil Liberties Union&nbsp;to fight for the rights of immigrants and refugees.<\\/p>\\r\\n\\r\\n<p>Hopefully you\'ve got the day off and will come join us in contributing to the mission of the ACLU by&nbsp;having lunch, happy hour, or dinner with us. We hope to see you here.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>mamnoon to you<\\/p>\"}},\"1443\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1438\"],\"position\":\"center\"}}}}}', '2017-02-12 23:28:35', '2017-02-12 23:28:35', 'b1c8dce9-13b8-4424-9877-e48b38fbc2fe'),
 ('964', '1440', '6', '399', 'en_us', '3', '', '{\"typeId\":\"6\",\"authorId\":\"1083\",\"title\":\"President\'s Day\",\"slug\":\"presidents-day\",\"postDate\":1487145600,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"1441\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1436\"],\"position\":\"center\"}},\"1442\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Come help us raise money for the ACLU on February 20th, President\'s Day!<\\/p><p>Charity is a core part of the mamnoon mission. We have raised substantial funds over the years to help refugees with incredible support from the&nbsp;generous and worldly city of&nbsp;Seattle and its amazing inhabitants. Over the years the refugee crisis has only gotten worse and its effects continue to grow&nbsp;deeper. That\'s why this&nbsp;President\'s Day, we will be donating 10% of our revenue to the American Civil Liberties Union&nbsp;to fight for the rights of immigrants and refugees.<\\/p>\\r\\n\\r\\n<p>Hopefully you\'ve got the day off and will come join us in contributing to the mission of the ACLU by&nbsp;having lunch, happy hour, or dinner with us. We hope to see you here.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>mamnoon to you<\\/p>\"}},\"1443\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"1438\"],\"position\":\"center\"}}}}}', '2017-02-12 23:35:57', '2017-02-12 23:35:57', '744cdd74-7f76-490c-8e5a-7611fc9f0e2c'),
