INSERT INTO `craft_matrixcontent_postblocks` (`id`, `elementId`, `locale`, `field_text_body`, `field_image_position`, `field_recipe_recipeName`, `field_recipe_ingredients`, `field_recipe_instructions`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '470', 'en_us', '<p>At the end of every meal at mamnoon, we serve all our guests a small carafe of Café Blanc or “white coffee” to cap off their meal and facilitate digestion. Known was “Ahweh Bayda” in Arabic, Café Blanc is made with orange blossom extract and hot water and is sometimes sweetened with sugar or honey. Café Blanc is thought to have originated in Lebanon and is traditionally served after meals as a digestif and offered as a sign of hospitality at special occasions and gatherings all over the Arab world. Naturally caffeine and alcohol free, Café Blanc is also said to soothe the nerves and aid with stomach aches. Many Middle Eastern mothers will also give their colicky babies a small amount of orange blossom extract with water.</p><p>When making Café Blanc at home, remember that a little bit goes a long way. We like ours alongside a sweet little treat like nokhochi or baklawa.</p>', NULL, NULL, NULL, NULL, '2014-09-10 17:23:29', '2014-09-10 17:44:32', 'c002ed21-1c2a-4486-85d3-7e492f968166'),
 ('2', '471', 'en_us', NULL, NULL, 'Café Blanc', '[{\"col1\":\"2 cups\",\"col2\":\"hot water\"},{\"col1\":\"1 t.\",\"col2\":\"orange blossom extract\"},{\"col1\":\"\",\"col2\":\"sugar or honey to taste (optional)\"}]', '', '2014-09-10 17:23:29', '2014-09-10 17:44:32', '6f31c4b4-6124-4be5-a243-a9bb7f4a0510'),
 ('3', '472', 'en_us', NULL, 'right', NULL, NULL, NULL, '2014-09-10 17:23:29', '2014-09-10 17:44:32', '044f8333-3614-461c-b8e0-6d029a147010'),
 ('4', '473', 'en_us', '<p>We are dedicated to giving back to the people and cultures that inspire all that we do at mamnoon. Through various fundraising efforts, we have donated nearly $25,000 to the UNHCR Syrian Refugee Relief Fund to aid those displaced by the crisis in Syria and the Middle East.</p><p>Our ‘Khobz for Syria’ campaign donates 100% of the proceeds from a $5 basket of house-made specialty breads to the UNHCR. From the start of this project, these baskets have been one of our most popular menu items and a wonderful way for the mamnoon community to get involved with the giving effort.</p><p>We are also part of a larger fundraising effort in partnership with glassybaby, a Seattle-based glass blowing studio. Our restaurant features a “mamnoon special” glassybaby candle holder in an exclusive dark slate color. $20 from the sale of every mamnoon glassybaby is donated to Syrian relief.</p><p>The mamnoon special glassbaby is part of the larger glassybaby giving effort, a campaign that supports various charities and has donated over $2,000,000 through the sales of these beautifully simple glass candle holders. Thedouble-glazed slate glassybaby votives, on display throughout the restaurant, are only available at mamnoon.</p><p>We have also had an incredible community support through private events and individual donations.</p><p>For more information on mamnoon giving, or to make a donation, call 206.906.9606 or visit&nbsp;<a href=\"http://www.unhcr.org/emergency/5051e8cd6-52b1c61ec.html\" target=\"_blank\">http://www.unhcr.org/emergency/5051e8cd6-52b1c61ec.html</a>.</p>', NULL, NULL, NULL, NULL, '2014-09-10 17:43:49', '2014-09-10 21:30:21', '0ed993aa-4014-48af-b826-05df8bd1872a'),
 ('5', '476', 'en_us', NULL, 'right', NULL, NULL, NULL, '2014-09-10 21:27:37', '2014-09-10 21:30:21', '727a105c-d034-4762-8a66-1cca71f36b89'),
 ('6', '477', 'en_us', NULL, 'full', NULL, NULL, NULL, '2014-09-10 21:27:37', '2014-09-10 21:30:21', '5caa0db3-d036-46d8-8a34-4266456d529a'),
 ('7', '478', 'en_us', '<p>We are dedicated to giving back to the people and cultures that inspire all that we do at mamnoon. Through various fundraising efforts, we have donated nearly $25,000 to the UNHCR Syrian Refugee Relief Fund to aid those displaced by the crisis in Syria and the Middle East.</p>', NULL, NULL, NULL, NULL, '2014-09-10 21:30:21', '2014-09-10 21:30:21', '51cd02c9-7f3b-48d9-be5c-fc2333c532d6'),
 ('8', '485', 'en_us', '<p>Mamnoon has recently added art to our dining room to showcase artists of the Middle East and Africa. Our walls speak to the power of women, love, and seduction.</p><hr id=\"horizontalrule\">', NULL, NULL, NULL, NULL, '2014-09-10 21:53:16', '2014-09-10 22:12:16', 'b174a631-24c0-4e57-b061-ea0b882b9985'),
 ('9', '486', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 21:53:16', '2014-09-10 22:12:16', 'c247a21b-9fe7-488f-a4d2-26add2ea4c61'),
 ('10', '487', 'en_us', '<p>This image by <strong>Mouneer al Sharaani</strong> can be translated to \"Enchantment is in the the colors, the melodies, the dew drops, the fragrances, and the flowers”. The artist is a Syrian calligrapher, designer, and print maker living and working in Cairo. Al Sharaani gave birth to a new era of contemporary Arab calligraphy through the synthesis of traditional techniques and modern styles and has received international recognition for his revitalization of the medium.</p><hr id=\"horizontalrule\">', NULL, NULL, NULL, NULL, '2014-09-10 21:53:16', '2014-09-10 22:12:16', 'f5679bf5-6fa8-4c1b-b1de-f0eda9f865e5'),
 ('11', '488', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 21:53:16', '2014-09-10 22:12:16', 'a8def478-c4a6-4fd6-b03d-827662392745'),
 ('12', '489', 'en_us', '<p>Model-turned-photographer <strong>Fabrice Monteiro</strong> is an emerging artist working in the fields of photojournalism, fashion photography, and portraiture.</p><p>Born to a Beninese father and Belgian mother, his childhood straddled the diverse cultural lines often represented in his work. Monteiro’s images carry the weight of modernity and tradition and force the viewer to confront the complex and often uncomfortable aesthetics of race, culture, and imperialism.&nbsp;</p><p>This image from his ‘Signares’ series explores the role of cloth and clothing during African colonization and their subsequent meaning in an era of Westernization. Powerful Signarese women were often the ‘official wives’ of European colonizers for the duration of their stay. Often celebrated for their beauty and business mind, these women played an important role in the socio-economic development of Senegal.</p><hr id=\"horizontalrule\">', NULL, NULL, NULL, NULL, '2014-09-10 21:53:16', '2014-09-10 22:12:16', 'a51b9c62-da9e-4852-8b37-f167a4705abf'),
 ('13', '490', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 21:53:16', '2014-09-10 22:12:16', '70a4a7a4-9993-48c7-9f2e-da2fcc3e01b1'),
 ('14', '491', 'en_us', '<p>These photographs by Iranian photographer <strong>Babak Kazemi</strong> are a contemporary interpretation of the legend of Shirin and Farhad.</p><p>As the story goes, Farhad was a stonemason who was in love with the beautiful Shirin, who was also desired by the powerful King Khosrow.  Shirin knew of Farhad’s love and used it to make the King jealous.  King Khosrow attempted to get rid of Farhad by ordering him to complete an impossible task: to win Shirin’s hand, he must move a mountain. Farhad’s love proves to be stronger than either the King or Shirin had</p><p>imagined, and he takes on the task with zeal. Amazed at the reports of Farhad’s progress, Shirin travel to the mountain to see for herself. After the long journey, though, she faints with fatigue and Farhad places both Shirin and her horse on his shoulders and carries them back to the palace. </p><p>Kazemi revisits this 16th- century tragedy to comment on the contemporary struggle of lovers who must leave their homeland to find the freedom to love as they choose. For the artist, the story reveals the message that love can overcome even the most difficult situations.&nbsp;</p><hr id=\"horizontalrule\">', NULL, NULL, NULL, NULL, '2014-09-10 21:53:16', '2014-09-10 22:12:16', '6517b1ae-4a67-43e9-a6c4-e3c0fe4a8e9c'),
 ('15', '492', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 21:53:16', '2014-09-10 22:12:16', '65d59a9f-2c28-481b-8aa6-8c1a552a587c'),
 ('16', '493', 'en_us', '<p><strong>Hassan Hajjaj</strong>, who was born in Morocco and raised in London, is a master of multiple mediums, including furniture, fashion, interior, and record album covers. Hajjaj synthesized these all into a series of sensational photo-portraits in ‘Kesh Angels’. These transcultural and trans-medium images depict a distinct subculture of young Moroccan women who work as henna tattoo artists and travel Marrakesh on motorbike.</p><p>With pride and ease, the women pose with their bikes, wearing veils and abayas, against vivid backdrops. These photos are a jarring mix of old and new, East and West, global and local. Hajjaj plays with and upends stereotypes, presenting his subjects as both traditional and defiantly modern, which infuses his photos with electrifying tension.</p>', NULL, NULL, NULL, NULL, '2014-09-10 21:53:16', '2014-09-10 22:12:16', 'b8750128-ddc1-412c-9ec5-33e0e6606db3'),
 ('17', '494', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 21:54:08', '2014-09-10 22:12:16', 'fb1cc7db-dbb5-4d8a-af48-11cd6220ece1'),
 ('18', '499', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 22:09:47', '2014-09-10 22:12:22', 'f28c6bda-6adf-4a34-bf5d-ab664657db6e'),
 ('19', '500', 'en_us', '<p>I was born into a family from Lattakia, a Syrian coastal city. My childhood was blessed with amazing food, inquisitive intellects, music, curiosity and a big dose of social, cultural and religious open-mindedness. The Levant was in rapid development from the mid ‘60’s to the early 70’s fueled by optimism, trade and development funds from the massive oil resources of the Arabian Gulf countries. The new breed of educated Lebanese and Syrian engineers, businessmen and traders created a unique cultural blend of western advances influenced by centuries old traditions and talents.</p><p>Sadly this period was stunted by escalating conflicts and tensions with Israel and a civil war in Lebanon that started in ’75 that lasted well into the 80’s. Meanwhile, the newly developed Arabian Gulf countries continued to move at warp speed to construct whole nations from scratch – much of it fueled by Levantine talent, blood, sweat and tears.</p><p>We moved to Dubai in ’77 after it was no longer possible to stay in Beirut. The go-getting and welcoming atmosphere in Dubai was contagious and it became a true home. Dubai was a truly diverse environment – all nationalities imaginable working in all fields. The diversity was reflected everywhere and with it came the appreciation of other cultures, as well as getting a keen understanding of the enormous richness and value of the Levantine cultures and way of life. Essentially Dubai provided proof that the culture is exportable, welcome and adaptable to many environments.</p><p>I went on to study computer science as an undergrad in Cedar Rapids, Iowa, and as a grad in Houston, Texas. I was fortunate to be studying CS at a time of great advances in the field and at the birth of the PC revolution. I went back to the middle east after my university studies.</p><p>At the time, there was no real work for my skill set – few companies needed serious programming – so I did some sales and sales support, while I wrote programs on the side for private clients. It was an interesting mix – on the one hand I had huge exposure to all types of people and personalities, and a work schedule that matched theirs (siesta or beach in the afternoon!), on the other I was trying to stay current with technology and make a career out of programming. A client approached me with a task: convert a program for the Mac operating system to support Arabic usage. While I was working on that I was approached by a Microsoft regional exec and eventually hired to do similar work at Microsoft – in Seattle!  </p><p>Microsoft wanted to make their products work with languages that are written and read from right to left: Arabic, Farsi, Hebrew, Urdu&hellip; While potentially large markets, Microsoft wanted to spend a minimum on R&amp;D until the revenue came in. They looked for an engineer that could do the Arabic adaptation, and then have the other languages be an easy translation. </p><p>In 3 years I shipped Arabic/Hebrew DOS, Windows, Word for Windows before going on to work on very different projects at Microsoft.</p><p>In summer of ’00, after a fun career at Microsoft, we moved to France to try something family oriented and different. We settled in Paris and had a full dose of joie de vie – it was a fantastic experience, four years of discovery, fun, travel, learning and interesting work.</p><p>A prominent feature in most Parisian neighborhoods is a weekly marche – a farmers market that takes place in a designated open area. You can find amazing meat cuts, fish, fruits, veggies, cheeses, wines, baked goods and&hellip; mana’eesh. Any marche you go to will have a stall that makes saj (domed grill) mana’eesh and a variety of mezze. Cross the channel to London and Levantine food is virtually a staple – entire high streets lined with mana’eesh, shawarama and varieties of Lebanese and Syrian restaurants. These thrive due to wide appeal to customers in their locales.</p><p>My work with a startup took me back to the US in ’06. We had many choices of where to go, but Racha and we wanted to be back in Seattle. It just felt right. It felt like going home. We didn’t think of it as a permanent move back, rather talking about it as an “indefinite” move. The return was a great relief.</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:09:47', '2014-09-10 22:12:22', 'dda3f02e-0b51-4eba-b20e-7f3f009e21e6'),
 ('20', '501', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 22:09:47', '2014-09-10 22:12:22', 'f7a2cda9-37de-4324-8b7f-e42787970a9d'),
 ('21', '502', 'en_us', '<p>Paris society has its cultural constraints – because of the closeness and the density, the Lebanese groups acted Lebanese, Syrians acted Syrian, and the French acted French. There was a lot of mixing of course, but we didn’t feel there were truly hybridized communities. Seattle, like many US cities, offers a fairly big hybrid community, albeit one that doesn’t have too many Levantine cultural elements. We felt a genuine open-mindedness and ability to absorb other culture’s elements proven by how well Seattleites adopted Japanese, Thai, Vietnamese and other Asian cultures and made them part of the daily lives.</p><p>Over the years we’ve expressed our cultures through a variety of ways, but the highest impact by far was when Racha prepared Lebanese, Syrian or Persian food and served at our dinners and parties.  Of course the foods are delicious and accessible and she’s an amazing cook, but the main reason has to do with the reception and the way guests are treated the <em>accueil</em>.</p><p>The feedback from our friends is that our cultures are welcoming, accommodating, adaptable, progressive and contemporary but more importantly they remember the visceral delicious sensations generated by eating the foods, taking in the smells and sights. There is a direct correlation between a positive visceral stimulus with an unfamiliar context, resulting in this context being familiarized in a very positive way.</p><p>This was the “aha” moment for us and the start of the mission – we got excited about the prospect of building a business around these principles and to create the postive visceral stimuli and experiences accessible in the broadest way possible. It was also clear that we hoped to for the mission to be a progressive beacon that the local culture can be proud of.</p><p>This was the genus of mamnoon – and a fantastic problem for a geek like me to go work on. I don’t have a culinary background; I am not a foodie or wine connoisseur. I am not a typical sample of the Lebanese or Syrian cultures either, but I am very curious, I am a tinkerer and have a lot of humility to try new things and fail at them and I have no issues calling for help if I need it.</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:09:47', '2014-09-10 22:12:22', '84672543-33c9-4e31-aeff-072f93aae646'),
 ('22', '503', 'en_us', NULL, 'right', NULL, NULL, NULL, '2014-09-10 22:09:47', '2014-09-10 22:12:22', 'ddb1889c-540e-4dd6-b386-52f7f6d20c45'),
 ('23', '504', 'en_us', '<p>The mamnoon project was a complete collaboration between Racha and me entering into many areas that we have never been before, and like every other project I have been in, mamnoon is a headlong full contact affair – made more intense by the fact that Racha is fully in it as well. This is a new and intense family dynamic. We both bring it home and live it day and night. It has helped us do better for mamnoon in a very natural way, and has added a dimension of authenticity that is unparalleled.</p><p>I am talking about mamnoon in very personal way, but what really makes it relevant and vibrant to all of us today is the team that has gelled behind the mission. We are simply blessed to have some of the most talented individuals in the industry believe in what we are trying to do and to have taken on the mission as their own. This is a testament that what we have lived and believe in is universal. The excitement, passion and drive we see in the staff translates to amazing guest experiences and a net cultural transfer – all of it for the better.</p><p>As the main geek at mamnoon my work is endless, there is a lot I need to do tinkering here and there – helping on the technology, working on processes and learning what it is that we can do to make the mamnoon experience universally compelling. If you come by one day and see me around with a laptop, measuring tape, on top of a ladder, under a piece of equipment, or talking to a guest- don’t be surprised, I’m just geeking out. </p><p>Wassef</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:09:47', '2014-09-10 22:12:23', '1bfc2360-9201-4840-994d-20d7e8ea4325'),
 ('24', '510', 'en_us', NULL, 'full', NULL, NULL, NULL, '2014-09-10 22:18:25', '2014-09-10 23:06:43', '3c922c84-63f2-4eb8-be7e-75bced8cc7c4'),
 ('25', '511', 'en_us', '<p>They do more than provide some intimacy and sound-buffering in our lounge: the laser cut poplar wood screens built for us by Seattle’s immensely talented graypants studios are an integral part of the aesthetic and flow of our restaurant. <em>Mashrabiya</em> are latticed wood screens that are a common fixture in Middle Eastern homes and are designed for a combination of shade, privacy, and air circulation. Our screens take elements of the traditional <em>mashrabiya</em> and add a Northwest flair-- the varying levels of opacity created by the star cut-outs were inspired by the patterns of light and shadows in a forest of trees. The wooden screens are a beautiful embodiment of the balance between old and new world, tradition and innovation, and beauty and function found at mamnoon.</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:18:25', '2014-09-10 23:06:43', '9d9d31ef-20fb-4ae8-9c54-b7f3a1ccca85'),
 ('26', '512', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 22:18:25', '2014-09-10 23:06:43', 'a9d4c0ad-da5e-46ed-8f01-ada8502036f1'),
 ('27', '513', 'en_us', '<p>Fun fact: the leftover cut-outs from the screens are used as holders for specials and announcements on table throughout the restaurant.</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:18:25', '2014-09-10 23:06:43', '22cdce43-bfb9-4670-8976-eccf78a1a694'),
 ('28', '514', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 22:18:25', '2014-09-10 23:06:43', 'fa64d42b-1a5c-4ac8-ba6a-ed9da97a83a2'),
 ('29', '515', 'en_us', '<p>Check out&nbsp;<a href=\"http://www.graypants.com/project/mamnoon-screens/?lang=us\" target=\"_blank\">graypant’s website</a> for more images of the screens and details on other awesome projects they have going on.</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:18:25', '2014-09-10 23:06:43', 'a283ea79-c46e-4a17-89aa-5fa9b06d40f4'),
 ('30', '517', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 22:19:03', '2014-09-10 23:06:43', '1f4eccdd-811d-4f40-87ec-8a46c3793490'),
 ('31', '521', 'en_us', '<p>Two junoons into our newly launched Monday night series and we are off to a rocking start! Mamnoon junoon was hatched as a way to bust outside the box and serve as a creative and fun way to explore aspects of the food and culture of the levant that we may not fit inside the repertoire of our normal dinner service.</p><p>Our kickoff junoon event was a six course Moroccan feast that highlighted many of the dishes owner Wassef Haroun and sous chef Sean Dominoski discovered on a trip to Morocco last year. As mamnoon is a Syrian, Lebanese, and Persian restaurant, this junoon was a great chance to experiment with the food of a country that, while geographically close, is really pretty different than the flavors our kitchen usually employs. Some of the highlights from the menu were the merguez (harissa and lamb sausage), seven vegetable tajine with hand-rolled couscous, and a savory goat cheese and herb pastry.</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:32:11', '2014-09-10 22:32:11', 'b1f6c827-76f1-4155-a68f-ac59d6e95282'),
 ('32', '522', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 22:32:11', '2014-09-10 22:32:11', 'a348a5c2-1c2f-4f3c-bdc0-b69536d4199d'),
 ('33', '523', 'en_us', '<p>We went in a totally different direction for the next month’s junoon, this time choosing to focus on engaging more than just your taste buds. MamnoonTV explored the videos and images of the levant in a rethinking of a night at the theater. We had projection screens set up throughout the restaurant playing clips from various Arabic TV show and music videos, and the entertainment was paired with theater-style snacks: jibneh nachos, za’atar popcorn, kefta sliders, and sujuk hot dogs.</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:32:11', '2014-09-10 22:32:11', '39f287f6-c1b7-4a43-8189-006c71391661'),
 ('34', '524', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 22:32:11', '2014-09-10 22:32:11', '5119f9f2-ce96-429a-aea1-810b19694a00'),
 ('35', '525', 'en_us', '<p>If you have suggestions for creative, entertaining, or simply delicious events, we’d love to hear from you! Drop us a line on the blog or on our&nbsp;<a href=\"https://www.facebook.com/mamnoonrestaurant\" target=\"_blank\">Facebook page</a>.</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:32:11', '2014-09-10 22:32:11', 'c16d8180-2ccc-42ef-bf9a-39ba0676c7fa'),
 ('36', '528', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 22:45:39', '2014-09-10 22:46:16', '521971e3-13ab-46c5-87d1-f4d898d1dbe5'),
 ('37', '529', 'en_us', '<p>mamnoonTV is the next addition in our monthly mamnoon junoon dinner series. Join us on monday, march 3rd for an evening that is guaranteed to turn your idea of a night at the theater on it\'s head.</p><p>Our talented and twisted kitchen has prepared a menu of theater-themed dishes inspired by the tastes and flavors of mamnoon. Enjoy delicacies like za\'atar popcorn, jibneh nachos and kefta sliders against a backdrop of the videos and images of the levant.</p><p>This playful and casual evening is a mamnoon rethinking of a classic. Come break bread with friends and treat all your senses to the magic of the middle east. </p><p>Call 206.906.9606 or visit&nbsp;<a href=\"http://www.mamnoonrestaurant.com/\">http://www.mamnoonrestaurant.com/</a> for reservations</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:45:39', '2014-09-10 22:46:16', '1e629a47-5ecd-42b4-9612-e863695d333c'),
 ('38', '533', 'en_us', NULL, 'right', NULL, NULL, NULL, '2014-09-10 22:49:03', '2014-09-10 22:52:30', '22e62b18-af04-4ab9-871a-69055c9bc571'),
 ('39', '534', 'en_us', '<hr id=\"horizontalrule\">\r\n<p>Is it lunch? Is it happy hour? Is it okay if I want to just sit and drink alone?</p><hr id=\"horizontalrule\"><p>These are all questions that may be swirling through your head as you see blurbs and announcements about mamnoon\'s new \"Drink Service.\" But, really, the semantics don\'t matter that much - the takeaway is that we\'re expanding our services during what is typically the afternoon lull and you should get really excited about that.</p><p>We\'ve coined it Drink Service in homage to the tea and coffee experience that is a staple of Middle Eastern hospitality. While it\'s not a happy hour per se, we\'ve got banging deals on drinks (both boozy and boring), food, and plates of delicious off-menu treats that come gratis with drinks. House-roasted nuts, Iranian pickled vegetables, a confection or two... think tapas-style: order a drink and you get a little sweet or savory nibble so you don\'t get sloshed on our community table.</p><p>We\'re just trying to spread the love a little farther. Drink Service is conducted in the front of the restaurant at our community table to facilitate socialization and is a tribute of sorts to the warmth of Middle Eastern dining. We\'re trying to create a casual environment for friends to come in and enjoy the mamnoon energy with a tasty drink and delicious food.</p><p>So stop by between 2:30 and 5:30 Tuesday- Sunday to see what the buzz is about. And maybe get one of your own.</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:49:03', '2014-09-10 22:52:30', '00ddfc9a-a7bf-41f2-b64a-936052304499'),
 ('40', '535', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 22:49:03', '2014-09-10 22:52:30', 'a4128b26-541c-4c1c-a88b-6f512c34eb21'),
 ('42', '538', 'en_us', '<p>\r\n	We are so excited to announce the start of Mamnoon Junoon, a series held on the first Monday of each month focusing on foods, arts and humanities. We are kicking off with a six course Moroccan dinner on Monday, Feb. 3. In Arabic, Junoon means a crazy party, a fete if you will.</p><p>\r\n	Through this dinner, we will bring aspects of Middle Eastern hospitality to help melt the ice that builds up with the Seattle Freeze. The dinner will be served family-style and will be done with community seating to facilitate discussion, socialization and mutual appreciation of the delicious and perhaps unfamiliar food on the table. We hope this to be a bonhomie of friends and strangers sitting down to enjoy a beautiful meal together.</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:57:50', '2014-09-10 23:08:52', 'ce16f400-9383-4e4c-82e0-a83f6c59efa5'),
 ('43', '539', 'en_us', '<hr>\r\n<p>\r\n	<strong>mezze</strong>\r\n</p>\r\n<p>\r\n	<strong><em>small bites</em></strong>\r\n</p>\r\n<p>\r\n	carotte et orange\r\n</p>\r\n<p>\r\n	<em>shredded carrot, cara cara orange</em>\r\n</p>\r\n<p>\r\n	concombre doux\r\n</p>\r\n<p>\r\n	<em>sweet cucumber, orange blossom water</em>\r\n</p>\r\n<p>\r\n	merguez\r\n</p>\r\n<p>\r\n	<em>lamb sausage, harissa</em>\r\n</p>\r\n<p>\r\n	<em><br>\r\n	</em>\r\n</p>\r\n<p>\r\n	<strong>salade</strong>\r\n</p>\r\n<p>\r\n	<em><strong>salad</strong></em>\r\n</p>\r\n<p>\r\n	fennouil\r\n</p>\r\n<p>\r\n	<em>shaved fennel, oil cured olive, soft herbs</em>\r\n</p>\r\n<p>\r\n	<em><br>\r\n	</em>\r\n</p>\r\n<p>\r\n	<strong>briwats</strong>\r\n</p>\r\n<p>\r\n	<strong><em>pastry</em></strong>\r\n</p>\r\n<p>\r\n	fromage de chevre\r\n</p>\r\n<p>\r\n	<em>fresh goat cheese, parsley, chive, tarragon</em>\r\n</p>\r\n<p>\r\n	épaule d\'agneau confite\r\n</p>\r\n<p>\r\n	<em>lamb shoulder confit, warm spices, onion</em>\r\n</p>\r\n<p>\r\n	<em><br>\r\n	</em>\r\n</p>\r\n<p>\r\n	<strong>légume</strong>\r\n</p>\r\n<p>\r\n	<strong><em>vegetable</em></strong>\r\n</p>\r\n<p>\r\n	tajine\r\n</p>\r\n<p>\r\n	<em>seven vegetable tagine, saffron, ginger, hand-rolled couscous, smen, fresh buttermilk</em>\r\n</p>\r\n<p>\r\n	<em><br>\r\n	</em>\r\n</p>\r\n<p>\r\n	<strong>poisson</strong>\r\n</p>\r\n<p>\r\n	<em><strong>fish</strong></em>\r\n</p>\r\n<p>\r\n	bar rôti\r\n</p>\r\n<p>\r\n	<em>roasted sea bass, chermoula, herb salad</em>\r\n</p>\r\n<p>\r\n	<em><br>\r\n	</em>\r\n</p>\r\n<p>\r\n	<strong>friandises</strong>\r\n</p>\r\n<p>\r\n	<strong><em>treats</em></strong>\r\n</p>\r\n<p>\r\n	gazelle horns\r\n</p>\r\n<p>\r\n	tahini cookies\r\n</p>\r\n<p>\r\n	tangerines\r\n</p>\r\n<hr id=\"horizontalrule\">', NULL, NULL, NULL, NULL, '2014-09-10 22:59:43', '2014-09-10 23:08:52', '50f8d19a-d32a-4aa2-b109-cf911ec1e11c'),
 ('44', '540', 'en_us', '<p>Dinner is $65 per person and does not include gratuity, tax and beverage. We apologize for the inconvenience but we are unable to make substitutions as it is a set menu. Reservations are required for the event as space is limited. Please note that because of the communal nature of the meal, parties less than 8 may be grouped at a table with others. If your party prefers to be at a private table please make a note on your reservation and we will try our best to accommodate, but no promises. Reservations can be made at <a href=\"http://mamnoonrestaurant.com/\">http://mamnoonrestaurant.com</a> or at 206.906.9606.</p><p>Mamnoon to you!</p>', NULL, NULL, NULL, NULL, '2014-09-10 22:59:43', '2014-09-10 23:08:52', '033572eb-67f9-4b5e-b79f-eb3be4a19110'),
 ('45', '545', 'en_us', '<p><strong>By Zack Chamberlain<br></strong>As told to Molly Sinnott</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:13:50', '2014-09-10 23:15:35', '3e1aabb1-d4da-407b-8bf3-044a86817f8b'),
 ('46', '546', 'en_us', NULL, 'right', NULL, NULL, NULL, '2014-09-10 23:13:50', '2014-09-10 23:15:35', '358a091d-338c-4912-b182-8ec6d0c96a1a'),
 ('47', '547', 'en_us', '<p>Bread is always gonna be bread. It’s so simple, but so necessary and that necessity adds complexity. Any main dish on a dinner table is going to change, but bread is always going to be there and be comprised of more or less the same ingredients. There’s beauty in that simplicity.</p><p>Garrett asked me to come on about two weeks before the restaurant opened, and at the beginning it was really just more to help out. I think in a lot of ways that helped me learn things from the ground up and get to know people involved in the restaurant in a different way. This is my fifth restaurant opening in my career and I really love the energy that comes with opening a restaurant. But I’ve never worked a streetside window before, which is really cool. I’ve found out that I am much more of a people person than I ever thought I was in terms of being up front and talking to customers. It’s incredibly dynamic and I find a lot of joy in that.  We get to see smiling faces all day and we get instant feedback from customers, which I really appreciate. I also just like making people happy and watching them leave satisfied. &nbsp;</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:13:50', '2014-09-10 23:15:35', '376baa79-9f04-4bc3-a259-2ec64b45d658'),
 ('48', '548', 'en_us', NULL, 'left', NULL, NULL, NULL, '2014-09-10 23:13:50', '2014-09-10 23:15:35', '22e65875-1f0f-4220-9bd8-5ea483a03a47'),
 ('49', '549', 'en_us', '<p>Our front kitchen is specifically designed to produce this Lebanese-style street food. Being Seattle and not a city that really has a vibrant street food scene, it has kind of morphed into a to-go window and full service lunch. It also offers a great alternative to the more aggressively priced sit down formal dinner that is our back dining room. But I think our front window really balances the two types of cuisines we offer as far as fun and functional and takeaway versus fancy and formal and sit-down. We went through a lot of trial and error. Just getting people to try our food was really tough and it was hard to get people hooked. So we were out there on the street giving out samples and talking things up. We opened completely organically, though, and we haven’t really done any advertising at all. So throughout the past year there’s been a real evolution of the food we offer up front. For example, we’ve changed things from ‘kulage’ to ‘sandwich’ because really it just looks like a sandwich and we’ve adapted some of the elements from a traditional kulage to make it look more like something that Americans will eat for lunch. We’ve had to make it a bit more accessible and easy to order. I think there was a bit of resistance at first but we’ve stayed pretty close to our original path and I think we’re winning in the long run. Sometimes you have to wait for people to take, and people took. It’s exciting.</p><p>My job is basically getting everything to function and to be cohesive and I get a huge amount of satisfaction from that. The menu was completely made when I got here, but I had to pull it off logistically. I’m really more of a logistical and detail-minded person than a fancy creator of brand new foods.  Which really goes back to simplicity and my initial attraction to bread. It’s the necessities, the staples. So it’s the fact that the two aspects of the restaurant kind of feed each other-- one is a little more playful and one’s more serious-- but they really balance each other out. And the cohesion of the whole place is really important to me, bridging the gap between front and back of the house and between the to-go window and the back dining room. So in a way its larger than a restaurant, it\'s how people come together to celebrate their passions.&nbsp;</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:13:50', '2014-09-10 23:15:35', '2220b7e1-e360-4b33-8915-1dd98f020585'),
 ('50', '550', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 23:13:50', '2014-09-10 23:15:35', '643bf9aa-7da0-42ba-b256-32fb77564a30'),
 ('51', '556', 'en_us', '<p><strong>By Garrett Melkonian</strong><br>As told to Molly Sinnott</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:20:34', '2014-09-10 23:22:11', '47b900d3-65f3-413b-8ef8-1877cb412eef'),
 ('52', '557', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 23:20:34', '2014-09-10 23:22:12', 'f10c2634-047d-48b7-8a7d-0fa8074e3642'),
 ('53', '558', 'en_us', '<p>It’s kind of amazing how so many of the things that we do here and the approach to hospitality and feeding people is pretty much a direct reflection of what I remember from my childhood. Everything always revolved around food and people and cooking was how they showed people love and respect and admiration. It was the metaphorical hug, to have people eat. It’s amazing how much this place has been able to connect me to some of those really vivid memories. It’s wasn’t until I found myself in a situation that is so closely connected to what initially inspired me to cook that I really remembered these things. It was making dolmeh with Racha’s mom and starting to have a flood of memories of watching my grandmother do it and having her teach me how to roll grape leaves. It\'s that kind of thing that has made everything feel very fortuitous and really come full circle for me. There is a real feeling behind the hospitality that we do here. There’s a sincerity that exists in that culture that’s expressed through food and it’s been remarkable to be able to take all that I’ve learned through food and use it to honor my heritage and who I am.</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:20:34', '2014-09-10 23:22:12', '5238bc76-7087-4a4f-ab67-1e1f6c3f1859'),
 ('54', '559', 'en_us', NULL, 'right', NULL, NULL, NULL, '2014-09-10 23:20:34', '2014-09-10 23:22:12', '415b7f5d-6f56-40b7-ab79-b07014fd7c34'),
 ('55', '560', 'en_us', '<p>There’s a difference between feeding someone and celebrating a cuisine. The restaurants that are out there that serve large quantities of very inexpensive Middle Eastern food are not really celebrating the cuisine and they’re not really celebrating the culture. There’s beauty that exists within this food and there’s a level of preparation that must take place. We’re taking something that is inherently family style and rustic and presenting it with an aesthetic and a refinement that doesn’t move away from the fundamentals, but maybe makes it taste just a little bit better or look a little bit more beautiful. To have an outlet to really showcases that and starts to use more celebrated ingredients&mdash;  local meat and beautiful organic produce&mdash; and to bring those elements together is something that hasn’t really been done before with this food. What we do here is very focused. It doesn’t mean that we can’t incorporate the same elements of ‘local, organic, sustainable’ that other Seattle restaurants are depending upon and building their name upon, we use some of that, but we’re doing it in a way that’s intensely focused. We’re working within pretty rigid parameters when you think about it and as much as we might do something that is maybe outside of the box of Middle Eastern cuisine, it still has to have that authenticity.</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:20:34', '2014-09-10 23:22:12', '481a7e15-e49c-4709-a45d-2075095c19a4'),
 ('56', '561', 'en_us', NULL, 'left', NULL, NULL, NULL, '2014-09-10 23:20:34', '2014-09-10 23:22:12', '18b4a393-6a5d-4945-8ed3-5000c73509a5'),
 ('57', '562', 'en_us', '<p>We’ve changed so much in the last year and I think the evolution will continue. It’s necessary for a restaurant to evolve because if you don’t, you become static and boring and you become an experience that somebody’s already had. Part of the reason we’re able to do what we’re doing now is that there’s a trust that we’ve built that has allowed us a little bit more creative freedom. It’s allowed us to start to pull ingredients that are decidedly northwest&mdash;on one plate we are celebrating two places at once. When we first opened, it was really more about celebrating the origins and at points we had to use ingredients that were out of season in order to hit all the authentic dishes. But right now you’re looking at a Middle Eastern restaurant that doesn’t have tabbouleh on the dinner menu. That’s not something that could have happened when we first opened. We had to prove that we could do all of those other things first and provide a sense of comfort through authenticity.  But we showed that we are restaurant with sincerity and some semblance of an old soul, so we were able to take the cuisine and push it forward. And I hope that in the future we’ll start to move away from being somewhat of a black sheep of a restaurant. There was a feeling in the beginning that we were a little bit of a novelty. But we’re moving into a place where we’re being taken very seriously as a restaurant, and not just a Middle Eastern restaurant.</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:20:34', '2014-09-10 23:22:12', 'b236b4f8-eb2e-4d60-b03d-2da7693cb1ed'),
 ('58', '563', 'en_us', NULL, 'right', NULL, NULL, NULL, '2014-09-10 23:20:34', '2014-09-10 23:22:12', 'ab71d4ad-9172-4786-b6e6-64ede2102eba'),
 ('59', '564', 'en_us', '<p>I think people who are really observant don’t necessarily look for inspiration but stumble upon it. I could be inspired by a conversation that I have with Racha and Wassef about a memory from their childhood, or it could be a memory of my own, or it could be going to a 7-11 at 3 o’clock in the morning and seeing something that I find really delicious. For me, the most important thing about inspiration is that it requires a harmony between two things: there must be a healthy combination of passion and humility. To be inspired by something is to acknowledge that something or someone has done something that is worthy of dedicating your energy to. And then you must have passion in order to put inspiration into motion. Those two things are at the heart of what we do here. This is a truly inspired restaurant. And everything else sort of stems from there. It comes at the most unexpected times and the most unexpected places as long as you’re open to that.</p><p>I really believe that we are at the forefront of the movement for Middle Eastern cuisine. Our restaurant is staying really true to form and doing at a level that the likes of which don’t really exist, but I think that it will one day. In hindsight&mdash;and this doesn’t come from a place of arrogance, it’s a hope&mdash; I would hope that as the movement starts to take places and this becomes more than just a trend, that we will be considered the restaurant that helped shape that and really set the bar for it. I think we’re really paving the way for something greater. You won’t necessarily see it now and you might not see it a year from now, but there is a much larger thing that is happening. It’s not tangible, but is definitely palpable.</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:20:34', '2014-09-10 23:22:12', '96620abf-8357-4e1d-b248-c8a4fa44864c'),
 ('60', '567', 'en_us', '<p><strong>Mamnoon co-owner Racha Haroun on the Middle Eastern palate and impressing the moms.</strong></p>', NULL, NULL, NULL, NULL, '2014-09-10 23:45:14', '2014-09-10 23:46:32', '541824e6-da9b-4e7d-b360-0a420818e8b4'),
 ('61', '568', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 23:45:14', '2014-09-10 23:46:32', '3ad7e661-bd3d-4a0d-a12d-bc28cf3bac24'),
 ('62', '569', 'en_us', '<p>\r\n	<strong>Mamnoon has just recently celebrated one year in business. Congrats! Tell me a bit about the journey so far.</strong>\r\n</p>\r\n<p>\r\n	It\'s been exciting-challenging but necessary. Since I am Syrian and Iranian, I feel that it\'s through the food that guests have been able to appreciate the warmth and compassion that have been part of our cultures for thousands of years.\r\n</p>\r\n<p>\r\n	I grew up eating both foods and for many years shared my love and respect for the food with our friends. It felt like the right time to share with our adopted home, Seattle. We feel honored that people appreciate the experience and share the love of the food.\r\n</p>\r\n<p>\r\n	All the recent events and news are masking the good that’s in these ancient civilizations and I feel compelled to share these positive aspects with Seattle and the greater Northwest community.\r\n</p>\r\n<p>\r\n	<strong>How would you describe the role you play at the restaurant?</strong>\r\n</p>\r\n<p>\r\n	I really love the creative aspect of mamnoon. Art has always been a very important part of my life and I taught myself to cook the foods that I grew up with while living in Seattle.\r\n</p>\r\n<p>\r\n	I am proud to be part of the creative process of bringing mamnoon to life. Curating the guest experience from start to finish, the feel and the taste.\r\n</p>\r\n<p>\r\n	I was raised with the palate to know and appreciate good Lebanese, Syrian and Iranian cuisines. Our culinary team is exceptionally talented, but not necessarily totally experienced in the cuisine and the desired outcomes. I work closely with our executive chef Garrett Melkonian and the rest of the talented kitchen staff and have been excited to see that they\'ve started to acquire the palate and can now make authentic dishes better than I ever made. Even our most critical guests, our moms, approve! We apply a lot of creativity in presenting dishes that are common in the middle east, but new to most of our guests, to help make the dishes less mysterious and more approachable.\r\n</p>\r\n<p>\r\n	<strong>What have been some of the most rewarding and challenging aspects of the process?</strong>\r\n</p>\r\n<p>\r\n	The most rewarding part is realizing that our hearts are in the right place. We are proud of our foods but we wanted to showcase it in a modern Northwest setting.\r\n</p>\r\n<p>\r\n	We noticed that our children are very proud of our achievement and the fact that hard work and perseverance pays off. The hardest part has been the constant awareness that our families are living in a tense war situation with a very uncertain future. Caring and nurturing mamnoon keeps us busy and sane, while really highlighting the beautiful aspects of our culture.\r\n</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:45:14', '2014-09-10 23:46:32', '525a8dbc-48ba-4069-9865-7dc45e4a5b18'),
 ('63', '572', 'en_us', '<p>Below you\'ll find the 1st and 2nd place winners for all 11 our of specialty cocktails.</p><p>Thank you so much to everyone who participated and for all the creative outpouring!</p><p><strong>No. 1</strong><br>1st place: SXSE<br>2nd place: High West Drifter</p><p><strong>No. 2</strong><br>1st place: Desert Rose<br>2nd place: Marianne</p><p><strong>No. 3</strong><br>1st place: Mamnoon Mule<br>2nd place: Kickin’ Kabul</p><p><strong>No. 4</strong><br>1st place: Mighty Aphrodite<br>2nd place: Sassie Lassie</p><p><strong>No. 5</strong><br>1st place: Old Beirut<br>2nd place: Figgin’ A,</p><p><strong>No. 6</strong><br>1st place: Mediterranean Crossing<br>2nd place: Levantine Elixir</p><p><strong>No. 7</strong><br>1st place: The French Rind<br>2nd place: Gin(ie) in a Bottle</p><p><strong>No. 8</strong><br>1st place: Mid East Algonquin<br>2nd place: Chic Sheik</p><p><strong>No. 9</strong><br>1st place: Night Owl<br>2nd place: Turkish Sunrise</p><p><strong>No. 10</strong><br>1st place: Habibti<br>2nd place: Persephone Rising</p><p><strong>No. 11</strong><br>1st place: Sheherazad’s Fire<br>2nd place: The Devil’s Wife</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:51:19', '2014-09-10 23:52:20', 'f89026f5-5f03-45f6-aba3-e93d11aaefcc'),
 ('64', '573', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 23:51:19', '2014-09-10 23:52:20', '52796f67-088c-456c-9e7e-763363ccb6c7'),
 ('65', '576', 'en_us', '<p>The Mamnoon No. 11 is not a cocktail for the faint of heart. We\'ve got plenty of drinks that will please just about anyone with a tongue, but this is a drink order for those who like a little bit of risk. This spice bomb is made with vodka, apricot liqueur and lime juice - then topped with a few hearty squirts of fresno pepper extract. A beautiful way to open up your palate before a meal, the No. 11 will make your mouth-and eyes-water.</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:53:45', '2014-09-10 23:53:45', '4deb042a-e136-4609-a123-3b4802c181e3'),
 ('66', '577', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 23:53:45', '2014-09-10 23:53:45', 'a51ffc15-ad4c-4e71-94b4-9edaa2207322'),
 ('67', '580', 'en_us', '<p>If you\'re lookin\' to add a little romance to your evening, the Mamnoon No. 10 is the cocktail for you. We originally had this brut prosecco, pomegranate syrup and rose water concoction as a Valentine\'s Day special, but it was such a hit we had to add it on full time. Subtly sweet and refreshing, this bubbling beauty is perfect for champagne lovers who like a little adventure.</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:55:18', '2014-09-10 23:55:46', '98698fcf-15ce-4842-bfaf-92366badf86a'),
 ('68', '581', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 23:55:18', '2014-09-10 23:55:46', '38c61471-0e05-4b25-adc0-90c3bb2ec50a'),
 ('69', '584', 'en_us', '<p>The Mamnoon No. 9 is a cocktail, pick-me-up and dessert all rolled into one scrumptious little dollop of drink and this mixology masterpiece deserves a name that conjures the same je ne sais pas as the drink itself. Our master bartender starts with fresh Turkish Coffee (espresso with cardamom) and adds a healthy dose of vodka. He could stop right there. But instead he adds walnut liqueur, coffee liqueur and chocolate bitters and shakes the hell out of it. The result is the beautifully frothy, perfectly drinkable No. 9 that leaves you blissfully buzzed in so many ways.</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:57:08', '2014-09-10 23:57:08', '70b8daaa-5025-4ba9-95a4-c1c5abe3c722'),
 ('70', '585', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 23:57:08', '2014-09-10 23:57:08', '4b1a0bdc-7f83-454f-93be-4a00bc4414ed'),
 ('71', '588', 'en_us', '<p>The Mamnoon No. 8 is a deceptive little number--just because it looks pretty and you may have to stick out your pinky when you drink it, this guy still packs a lot of punch. Made with bourbon, pomegranate grenadine and grapefruit juice, this is a cocktail for those who balk at the word \"cocktail.\" Deliciously tart with a hint of sweetness, the No. 8 will convert even the most steadfast beer drinkers in the group.</p>', NULL, NULL, NULL, NULL, '2014-09-10 23:58:29', '2014-09-10 23:58:29', 'e2a1b912-48c8-4f75-bc6e-6e83eb628792'),
 ('72', '589', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-10 23:58:29', '2014-09-10 23:58:29', '8fb30715-0b7d-4931-b8e6-ef8b0c9b1d2c'),
 ('78', '601', 'en_us', '<p>The Mamnoon No. 7 is as refreshing as it is easy to drink. Not sure what to order? The No. 7 is sure to please even the pickiest palates. Made with gin and moscato wine and floated with grapefruit liqueur, this effervescent cocktail is packed with punch.</p>', NULL, NULL, NULL, NULL, '2014-09-11 00:05:42', '2014-09-11 00:06:32', '113a6e07-d48b-4cbd-881c-0cb4f5870a1b'),
 ('79', '602', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-11 00:05:42', '2014-09-11 00:06:32', 'b2bd6074-88aa-421a-a747-783d1ec32021'),
 ('80', '604', 'en_us', '<p>The Mamnoon No.6 is a delicious symphony of delicate passionfruit syrup and bitingly bitter Aperol. Throw in a healthy glug of vodka and a spritz of Arrack (a traditional Middle Eastern anise-flavored liqueur) this bittersweet fruit bomb will leave you thirsting for more.</p>', NULL, NULL, NULL, NULL, '2014-09-11 00:07:35', '2014-09-11 00:07:35', '8fffbe82-a8d1-4283-8863-2be8cc906d9f'),
 ('81', '605', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-11 00:07:36', '2014-09-11 00:07:36', 'a85cf8dd-7525-4669-9eb8-a3043c0bbe27'),
 ('82', '608', 'en_us', '<p>The No. 5 is a Mamnoon favorite! Our most popular drink deserves a name that lives up to it\'s well-earned reputation. This little daddy is a sipping cocktail made with Johnny Drum Bourbon, walnut liqueur and bitters.  Perfectly fruity and nutty--but not too sweet--the No. 5 is ideal for Manhattan lovers looking to add a little excitement to their routine.</p>', NULL, NULL, NULL, NULL, '2014-09-11 00:08:52', '2014-09-11 00:08:52', '4497455e-ecc2-4ab0-9e3f-4983026075ac'),
 ('83', '609', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-11 00:08:52', '2014-09-11 00:08:52', '50911b9c-fce9-4daf-a9cb-ee3199e7c1b9'),
 ('84', '612', 'en_us', '<p>Those bold enough to try the Mamnoon No. 4 are rewarded with a smooth, uniquely fresh and almost tropical experience. This flirty little number has a greek yogurt base--intrigued yet?--and is made with Swedish Punsch (an aromatic and spicy sugar-cane spirit,) cherry liqueur and orange flower water. It\'s fruity and fun and will surprise even the most well-versed palates!</p>', NULL, NULL, NULL, NULL, '2014-09-11 00:09:51', '2014-09-11 00:09:51', '94be88dc-3f90-499f-a645-71d4a38bc391'),
 ('85', '613', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-11 00:09:51', '2014-09-11 00:09:51', 'fbc72469-fa52-48d5-a5c6-abf9495ec631'),
 ('86', '616', 'en_us', '<p>This super refreshing, easy-to-drink little number is like a Moscow Mule with a twist. It\'s made with Kummel, a caraway and fennel liqueur. It\'s mixed with lime and ginger beer and sprinkled with curry powder.</p>', NULL, NULL, NULL, NULL, '2014-09-11 00:10:48', '2014-09-11 00:10:48', '743b9d39-77c8-447b-87d1-20c0df8d71e7'),
 ('87', '617', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-11 00:10:48', '2014-09-11 00:10:48', '67b861f1-52c8-4c93-8f92-ff8010de4c24'),
 ('88', '620', 'en_us', '<p>The angelic-looking Mamnoon No. 2 is a drink to get the party started. This margherita-all-grown-up is made with blanco tequila, Salers Aperitif (boldly bitter with a touch of sweetness) and grapefruit liqueur. Bright and refreshing, we dare ya to have just one.</p>', NULL, NULL, NULL, NULL, '2014-09-11 00:11:42', '2014-09-11 00:11:42', 'fa49d9ef-4305-45f9-85fd-6314922a24f2'),
 ('89', '621', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-11 00:11:42', '2014-09-11 00:11:42', 'cc898f18-eafb-48fb-ab77-ab5735120c75'),
 ('90', '624', 'en_us', '<p>Let\'s start off the naming game with one for the whiskey lovers. Mamnoon No. 1 is a sipping cocktail with oat whiskey, coffee liqueur and cardamom bitters. Come in and try one to get those gears turning. Submit your ideas in the comment section!</p>', NULL, NULL, NULL, NULL, '2014-09-11 00:13:01', '2014-09-11 00:13:01', 'b18f966e-5a21-47b1-87e9-7382ae281f70'),
 ('91', '625', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-11 00:13:01', '2014-09-11 00:13:01', 'f1b8d45d-da80-49c9-8ab7-ea4f0823068e'),
 ('92', '628', 'en_us', NULL, 'center', NULL, NULL, NULL, '2014-09-11 00:15:14', '2014-09-11 00:15:14', '98c1fff9-39a7-49b7-b25b-1c249540d848'),
 ('93', '629', 'en_us', '<p>Start prepping your palates!</p><p>Mamnoon is hosting a Cocktail Naming Contest to name our drinks #1-11 and we need your help coming up with the most appropriate, creative or outlandish titles.</p><p>The contest runs from December 1- December 31st and we\'ll be accepting submissions on all cocktails throughout the month. Make sure you check back periodically as we\'ll be releasing preparation and ingredient details for each cocktail that will help in the naming process.</p><p>Submissions are limited to one per person per cocktail-- so come up with something fitting for all 11 to increase your chances of winning! Did we mention there\'d be prizes??</p><p>The first place name that is chosen will win a $50 mamnoon gift certificate. The runner-up plus a friend will be able to enjoy a newly-minted mamnoon cocktail on us.</p><p>Submissions will be judged by a panel of mamnoon experts and winners will be announced in early January. </p><p>Submit your names in the comment section of the blog, via Facebook or Twitter or come into the restaurant to fill out a paper submission form.</p><p>Stop by today to sample the cocktails and let the creative juices flow!</p>', NULL, NULL, NULL, NULL, '2014-09-11 00:15:14', '2014-09-11 00:15:14', '4ae583ab-aa22-4e94-a585-f89b9db50db0'),
 ('94', '631', 'en_us', '<p>Hi there and welcome to the blog for mamnoon restaurant!</p><p>We\'ll be using this blog as a place to showcase everything mamnoon so make sure to stay tuned for menu updates, photos, background stories, events, recipes, contests, and much more. We\'ve been going full throttle in Seattle for 1 year now and we anticipate many more years to come. Check back for the background story as to how we got here and how we see it unfolding in the future. We could not have arrived here without your amazing support and for that we say, mamnoon!</p><p>As part of of our blog launch, we will be posting all the details of our upcoming cocktail naming contest which runs from Dec 1st-31st so keep an eye out for the final details (and most importantly the magnificent prizes) as the month unfolds!</p>', NULL, NULL, NULL, NULL, '2014-09-11 00:16:17', '2014-09-11 00:16:17', '8d7c1f7f-9f4f-46f8-95b0-5e6d01b8ebc4'),
 ('96', '779', 'en_us', '<br><table><tbody><tr><td>Go Hawks!<br>The hawks making the superbowl, again, is one of the   good reasons for us to close our dinner service. We are so proud of the   team and want to root for them all the way.  As a result we will be   closing at 2:30 pm on Sunday Feb  1st and then.<br><br>If you are not   lucky to be there in person,  we can help you have the very best   seahawks party at home. check out  this incredible take home or delivery   menu and put your orders in soon -  we don\'t want you to miss out on   shish taouk \"hawk\" wings.  These are chicken wings marinated in our   famous shish taouk marinade served in a bucket with a selection of our   best dips.  <br><br>This meal will set a new high bar for superbowl party food and   make you the most seahawk of hosts. <br><br>Please put your orders in   early by calling in at 206 906 9606 and ask for the superbowl special   and what time you will be picking up.  Delivery is also available via<a href=\"https://www.trycaviar.com/seattle/mamnoon-628\">   mamnoon delivery</a><br><br>Wassef<br><br>ps.  we will be ordering a couple for a party we\'re crashing :)</td><td><img src=\"{asset:777:url}\"></td></tr></tbody></table>', NULL, NULL, NULL, NULL, '2015-01-28 20:12:26', '2015-01-28 20:28:07', '32b7b2a5-7b7c-4a0c-b147-f694c5726443'),
 ('97', '783', 'en_us', '<p><img src=\"{asset:781:url}\"></p><p>After a few month\'s hiatus for the holidays, mamnoon junoon is back for monday feb 2nd dinner!</p><p>While the holidays were a great busy period for us here, it was also an unbelievably terrible period for Syrian refugees. The numbers are increasing, the living conditions are getting harder and most of the levant/turkey was hit with one of the worst winters on record.&nbsp;</p><p>One of mamnoon\'s goals is to connect you with the people and cultures&nbsp;of the Levant in positive, compassionate and delicious ways.  we have always had an active charity component via our giving to UNHCR (over $25K to date). &nbsp;In addition many of you have asked throughout our existence how to help in direct ways, beyond donating through our Khobz for Syria, Mukassarat, or \"mamnoon special\" GlassyBaby.&nbsp; We did some research and&nbsp; decided to focus this junoon and the charity effort where we can all make the most impact.&nbsp; </p><p>We will be offering the net proceeds from the night to the Malki-SCM Children Center. This great effort is made possible by the local <a href=\"https://salaamculturalmuseum.wordpress.com/\">Salaam Cultural Museum</a> organization.&nbsp; They have created a few \"normal\" safe zones with basic schooling, play and art therapy for refugee Syrian children in Jordan. The need is immense and every cent raised here goes directly to the centers.&nbsp; We could not think of a better, more effective way to help those in most need, with the the most future.  <br> </p><p>We need you  to make it a huge night.</p><p>Our famous Chelow Kebab will make a comeback  as well as a special off-menu dessert.  in addition we’ll have live  classical Arabic Oud music courtesy of Stephen Elaimy, House of Tarab.<br> <br> Please reserve and share, this will be a great way to enjoy a mamnoon feast while doing good. hope to see you here</p><p>mamnoon team<br></p>', NULL, NULL, NULL, NULL, '2015-01-28 21:07:21', '2015-01-28 21:07:21', 'cd82cd3c-65cf-4d34-b59c-ab23ae89b3c0'),
 ('98', '823', 'en_us', NULL, 'center', NULL, NULL, NULL, '2015-04-01 20:39:44', '2015-04-01 20:41:12', 'e9c314de-e25b-4c48-afca-4863853369cd'),
 ('99', '824', 'en_us', '<p>\r\n	Art manifests itself in many ways at mamnoon, in the food, in the music and in the art. Our most prominent piece, an installation of thirty fiberglass chickens, hangs over the dining room. \"Simorgh\" is the work of Persian sculptor \r\n	<strong>Nastaran Safaei</strong>. Maintaining an air of playfulness and levity, the artist has instilled a double meaning in \"Simorgh.\" It derives its influence primarily from the character of the same name in Farid al-Din Attar\'s twelfth-century poem \"The Conference of the Birds,\" which follows a flock as they travel through the many valleys of life as they search for illustrious King of the Birds. Safaei plays on the name further: Separately, the syllables of \"Simorgh\" translate to thirty (\'si\') birds (\'morgh\').\r\n</p>', NULL, NULL, NULL, NULL, '2015-04-01 20:39:44', '2015-04-01 20:41:12', 'fd3b9b9d-ada2-4e4d-b3cf-cbeaac89bd3e'),
 ('100', '825', 'en_us', NULL, 'center', NULL, NULL, NULL, '2015-04-01 20:39:44', '2015-04-01 20:41:12', 'c5ca7da4-7352-4b05-8eab-4724d99468ec'),
 ('101', '826', 'en_us', '<p>\r\n	Safaei\'s \"Simorgh\" adds an air of mysticism and tradition to the atmosphere at mamnoon, acting simultaneously as compliment and juxtaposition to mamnoon\'s collection, which includes \r\n	<strong>Hassan Hajjaj</strong>\'s<i>Ya Amina</i>, a colorful portrait of a strong and brightly-dressed young woman. Unafraid of breaking boundaries, Hajjaj employs a boundless color palette and wide-reaching use of mediums to create portraits that both embody and empower the people of his native Morocco.\r\n</p>', NULL, NULL, NULL, NULL, '2015-04-01 20:39:44', '2015-04-01 20:41:12', '8d15b480-e92c-4cf6-9499-0753f7ab242b'),
 ('102', '830', 'en_us', '<p>\r\n	Art at mamnoon\r\n</p><p>\r\n	Our collection has grown! We are excited to feature two pieces from Los Angeles artists \r\n	<a href=\"http://www.davisanddavis.org/gallery.html\" target=\"_blank\">Davis and Davis</a> from their \"Little Talents\" collection. \"Tattoo Baby\" and \"Whirly Girl\" are photographs that employ a rich color palette while using found materials to create images that are both aesthetically pleasing and mentally perplexing. In \"Whirly Girl,\" the doll is depicted as \r\n	<i>literally</i> having the world on a string, while \"Tattoo Baby\" shows a swaddled figurine covered in henna designs. Needless to say, these pieces leave much up to the imagination.\r\n</p>', NULL, NULL, NULL, NULL, '2015-06-06 17:58:40', '2015-06-06 17:58:40', '7582c897-b78f-4462-868b-d095e6b6bd22'),
 ('103', '831', 'en_us', NULL, 'center', NULL, NULL, NULL, '2015-06-06 17:58:40', '2015-06-06 17:58:40', 'fab0b741-84fd-4259-882b-e650977996ae'),
 ('104', '832', 'en_us', '<p>\r\n	 For me, \"Whirly Girl\" is particularly striking, because of its highly-charged duality. As part of a generation who feels like they are entitled to the world, my first read was that the artists\' intentions were to convey that this notion of global possessiveness is a truly epic farce, begging to be mocked. However, in light of the mission of mamnoon, an entirely different message can be begged. By placing the entire world within the grasp of this tiny girl, every corner of the globe is accessible for us to explore, embrace and taste. Ultimately, interpretation is a choice, and I am going to choose the positive.\r\n</p>', NULL, NULL, NULL, NULL, '2015-06-06 17:58:40', '2015-06-06 17:58:40', 'e2f60aff-fb5f-41ad-95ca-74471f88695a'),
 ('105', '833', 'en_us', NULL, 'center', NULL, NULL, NULL, '2015-06-06 17:58:40', '2015-06-06 17:58:40', 'a9a5cee4-1078-44d0-a165-f8a3de0995be'),
 ('106', '834', 'en_us', '<p>\r\n	As far as \"Tattoo Baby\" goes, I would love to think that the artists were depicting the next generation of Capitol Hill hipsters, but something tells me I am a little off in that. The image of a blonde-haired baby covered in tattoos is highly imaginative, unique and totally unheard of. Seeing it for the first time brought back memories of my first dining experience at mamnoon, that \"Holy H*&amp;!\" moment of culinary bliss that comes with trying a dish that blends two things together to create a union that you never would have even considered before. Mamnoon is filled with all of these juicy combinations, from the food on the plates to the art on the walls, and I can\'t wait to see what happens next.\r\n</p><p>\r\n	Come check them out, they can be found deep in the main dining hall, right next the glass kitchen wall. We\'d love to hear your interpretation.\r\n</p><p>\r\n	<br>\r\n</p>', NULL, NULL, NULL, NULL, '2015-06-06 17:58:40', '2015-06-06 17:58:40', '45020d15-276a-4c2a-9cfb-ec6c8c1428ce'),
 ('107', '837', 'en_us', NULL, 'center', NULL, NULL, NULL, '2015-06-26 17:10:13', '2015-06-26 17:11:27', '08ec5682-4485-43d9-a261-b9efaaa5f807');
INSERT INTO `craft_matrixcontent_postblocks` (`id`, `elementId`, `locale`, `field_text_body`, `field_image_position`, `field_recipe_recipeName`, `field_recipe_ingredients`, `field_recipe_instructions`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('108', '838', 'en_us', '<p>\r\n	Community is everything at mamnoon. And it all starts with our staff.\r\n</p><p>\r\n	<br>\r\n</p><p>\r\n	Setting the precedent for hard work and flexibility at mamnoon, Elad wears the many hats of a bartender, server and mamnoon Street \"Window Dude.\" Out of breath? Me too. Elad is there to help with whatever, whenever and wherever. His unparalleled sense of work ethic and unbreakable \"can-do\" attitude help keep mamnoon ticking.\r\n</p><p>\r\n	Outside of mamnoon, you can find Elad engrossed in his art. Specializing in typography and street art, Elad\'s pieces capture life in brilliant color.\r\n</p><p>\r\n	Whatever palette he\'s perfecting, be that color tones or quinoa tabbouleh, Elad can always be counted on to give us his best, smiling all the way.\r\n</p><p>mamnoon to you, Elad!\r\n</p>', NULL, NULL, NULL, NULL, '2015-06-26 17:10:13', '2015-06-26 17:11:27', '4d4b113a-4bfb-4b6e-a8a3-bfde4ad4a6e3'),
 ('109', '865', 'en_us', '<p>\r\n	Join us as we welcome Martin Foradori of J. Hofstatter Estates for a beautifully paired six-course wine dinner on Monday, July 20th. Further details to follow! Contact us today to save your spot... They\'ll go fast!\r\n</p>', NULL, NULL, NULL, NULL, '2015-07-08 05:22:32', '2015-07-08 05:22:32', '89f7ab2f-3816-4ada-acac-9fc8649c5b18'),
 ('110', '866', 'en_us', NULL, 'left', NULL, NULL, NULL, '2015-07-08 05:22:32', '2015-07-08 05:22:32', '5e981b6b-0a12-4378-b12a-07e7c62cc29a'),
 ('111', '922', 'en_us', '<p>Dominating the news from around the world, we are troubled by the plight of Syrian refugees fleeing their country in massive numbers- taking little to nothing of their home and possessions and striving to find a country in which to build a better life.<br>On Thursday, October 22nd, we will partner with local retailer, Elliot Bay Book Company, to organize a fundraising event in the restaurant with 100% of the money designated toward 3 organizations: <a href=\"http://www.mercycorps.org/countries/syria\">Mercy Corps</a>,   <a href=\"http://www.msf.org/syria\">Medecins Sans Frontières</a> and <a href=\"http://www.karamfoundation.org/\">Karam Foundation</a>. We hope that you will come out to support them. <br></p>\r\n\r\n<p>Inspired by the cookbook, <a href=\"http://www.soupforsyria.com/book.php\">Soup for Syria</a>, from Lebanese author, Barbara Massaad, Chef Jason Stratton has enlisted support from Seattle’s culinary community.<br></p>\r\n\r\n<p>In the dining room, Jason and friends will construct a fantastic, multi-course dinner with beverage pairings. The dinner will include a copy of Barbara’s book.  The cost of the dinner is $250 per person (+ tax and gratuity).<br></p>\r\n\r\n<p>Half-dozen chefs will contribute a soup for an all-you-can-eat, Soup, Bread and Beverage for $35, available at the communal table and Mamnoon Street. Seating will be on a first come, first served basis.<br>{Please note that these will be the only menus offered on that evening.}</p>\r\n\r\n<p>plan to come in for the soup or reserve now by calling (206) 906 9606 or emailing reservations@mamnoonrestaurant.com</p>\r\n\r\n<p>mamnoon<br></p>', NULL, NULL, NULL, NULL, '2015-10-08 03:38:22', '2016-08-04 14:53:50', '412c256c-232f-463f-91e5-0bbcf46fb0ba'),
 ('112', '923', 'en_us', NULL, 'right', NULL, NULL, NULL, '2015-10-08 03:38:22', '2016-08-04 14:53:50', '5b3fa6ae-be9a-42f5-8b6c-f3411a660d15'),
 ('113', '926', 'en_us', '<p>By now, we hope that you’ve read the news that Chef Jason Stratton, formerly of Spinasse and Artusi, has come on board to lead the kitchen and front of house at mamnoon. He has also brought on talented pastry chef, Carrie Mashaney to join him, along with Executive Sous Chef, David Gurewitz.  Needless to say, we’re delighted to have them leading our culinary team.</p><p><br></p><p>Additionally, you may have seen that we are expanding mamnoon’s experience to South Lake Union.  We are really excited about these projects and we’ll make sure that you’ll be the first to get the full scoop just as soon as possible.  We think you’ll be delighted with these new food and beverage options.</p>', NULL, NULL, NULL, NULL, '2015-10-08 03:43:10', '2015-10-08 03:45:14', '6d2ca616-ce94-4116-8c9b-7bdf6e7480fb'),
 ('114', '927', 'en_us', NULL, 'right', NULL, NULL, NULL, '2015-10-08 03:43:10', '2015-10-08 03:45:14', '4ff89076-06de-4d2f-a96c-cd75bfac4645'),
 ('115', '1185', 'en_us', NULL, 'center', NULL, NULL, NULL, '2016-07-19 01:08:46', '2016-08-04 14:53:35', '4ab679f1-2202-4fd5-b9d0-15e891043f00'),
 ('116', '1186', 'en_us', NULL, 'right', NULL, NULL, NULL, '2016-07-19 01:08:46', '2016-08-04 14:53:35', 'f553962e-61f2-4d32-bbf3-b8da0c69ffed'),
 ('117', '1187', 'en_us', '<h3><em class=\"redactor-inline-converted\">tarab: &nbsp;a state of euphoria invoked by music</em>&nbsp;<img src=\"{asset:1183:url}\"></h3>\r\n\r\n<div><em>update please donate here if you can\'t make any of the events : <a href=\"https://www.crowdrise.com/tarab-4-syria/fundraiser/tarab4syria\">tarab 4 syria crowdrise page</a></em><br><br>We\'ve all felt it, &nbsp;out of the blue while listening to some piece of music - you get overwhelmed with emotion, get goosebumps, feel ecstatic or feel very sad and start tearing up. Often you\'ll catch yourself unconsciously tapping your feet, humming a tune accompanying a distant radio, or get lost in your work while music is blasting. &nbsp;Sometimes you\'ll burst into song at a concert with thousands of others in unison, other times you\'re with a group of friends jamming endlessly over the same riffs with a simple drum and guitar. &nbsp;Music has its way with us, it connects with higher order perception functions and works on emotions directly, without interpreters, translators or coordinating rational guardians<br></div>\r\n\r\n\r\n\r\n<div><br></div>\r\n\r\n\r\n\r\n<div>Music is a great unifier, &nbsp;even if no one in a group can agree with the interpretation, they will all share a common visceral experience. &nbsp;In that way music is like food, &nbsp;food is experienced in the same visceral way by everyone. &nbsp;&nbsp;I\'ve often said that when you\'re eating a man\'ousheh in mamnoon or mamnoon street, you are so much closer at that moment to someone eating a man\'ousheh in Beirut. This is absolutely true of music, when you hear the traditional&nbsp;<a href=\"https://www.youtube.com/watch?v=DrJ4DUP1oss\" target=\"_blank\">Umm Kalthoum</a>,&nbsp;&nbsp;<a href=\"https://www.youtube.com/watch?v=YZVdkE6e9B4\" target=\"_blank\">Sabah Fakhri</a>, &nbsp;<a href=\"https://www.youtube.com/watch?v=151IbT6ucO4&index=3&list=PL3Onu1mdV7YGWyXc36KrX3mRNvJJmFF9l\" target=\"_blank\">Fairuz</a> or the ultra modern <a href=\"https://www.youtube.com/watch?v=avEm0Rui2N8\" target=\"_blank\">hellopsychaleppo</a> you are so much closer to Middle Easterners through shared experience and emotion.&nbsp;</div>\r\n\r\n\r\n\r\n<div><br></div>\r\n\r\n\r\n\r\n<p>One of the most amazing things to witness at mamnoon is how people of all kinds, races, religions come together, socialize and connect&nbsp;in the same medium of great food, surroundings and music. &nbsp;We\'ve been told&nbsp;that it\'s a unique and very appealing draw&nbsp;of the mamnoon dining experience. A&nbsp;key element for our exciting new <a href=\"https://www.facebook.com/mbarseattle/?fref=ts\" target=\"_blank\">mbar</a> project is to replicate this diverse and ultra-social experience in an unbelievable geographic setting.&nbsp;</p>\r\n\r\n\r\n\r\n<div><br></div>\r\n\r\n\r\n\r\n<div>Charity is a core part of the mamnoon mission. We have raised substantial funds over the years to help Syrian Refugees with incredible support from a generous and worldly Seattle and its amazing inhabitants. &nbsp;Over the years the Refugee crisis has only gotten worse and its effects deeper and deeper. &nbsp;It has all the hallmarks of becoming a multi-generational disaster, impacting not only those fleeing the strife today, but also their kids and depressingly their kids\' kids.&nbsp;</div>\r\n\r\n\r\n\r\n<div><br></div>\r\n\r\n\r\n\r\n<div>It\'s worth reflecting on this fact for a bit - the large scale Palestinian refugee crisis in the Middle East started with the events of 1948. There are Palestinian refugee camps in neighboring countries that have been continuously inhabited since then - 65+ years of refugee-dom. &nbsp;The situation in the camps is deplorable and the worst part is the lack of opportunity afforded the inhabitants. &nbsp;The Syrian Refugee crisis scale is at least 10 times larger than that and there is no end in sight to the conflict. &nbsp; It seems that refugees get stuck in a&nbsp;vicious cycle where one generation leaves the subsequent generation less able to help themselves.&nbsp;Already the impacts on neighboring countries, the EU and events around the world are straining existing aid, financial and political systems. Just imagine what can happen over decades.&nbsp;</div>\r\n\r\n\r\n\r\n<div><br></div>\r\n\r\n\r\n\r\n<div>My experience with higher education and working in the US has taught me a valuable lesson, &nbsp;anyone with some freedom,&nbsp; the right motivation, &nbsp;education and work opportunities can build a good future for themselves, family and give back to the community. &nbsp;It\'s really that simple. &nbsp;If we can help educate and create opportunities for Syrian Refugee children they will be able to build better futures for themselves and help bootstrap others. &nbsp;This is a virtuous cycle. &nbsp;The only downside is that it\'s not immediate and needs to be nurtured for some time to get going.&nbsp;</div>\r\n\r\n\r\n\r\n<div><br></div>\r\n\r\n\r\n\r\n<div>This has changed our strategy for charity, &nbsp;instead of galvanizing giving for general aid (which is still necessary), we\'ve chosen to focus on organizations and set-ups that can provide the safety, education and opportunities to start the virtuous cycle going, even if it is for relatively few. &nbsp;The hope is that by doing so we can positively impact the lives of few today, and many more tomorrow.&nbsp;</div>\r\n\r\n\r\n\r\n<p><br></p>\r\n\r\n\r\n\r\n<p>We\'ve found a great&nbsp;organization to help us with this: &nbsp;<a href=\"https://www.rescue.org/\" target=\"_blank\">International Rescue Committee</a>. &nbsp;The IRC&nbsp;has been at the forefront of aid operations with Syrian Refugees, and has upped its efforts on helping build futures for children. I\'ll post more details on the project we will be targeting:&nbsp;Reyhanli Youth Center in Turkey.&nbsp;</p>\r\n\r\n\r\n\r\n<p>We have close to hand many&nbsp;elements for a primordial soup of humanity, if we can put them together and add some spark maybe we can create something that lives on. &nbsp;That was the idea behind tarab 4 syria - to see if we can put everything together, and apply your spark.&nbsp;</p>\r\n\r\n\r\n\r\n<p>The event takes place over 2 days, in 3 locations:</p>\r\n\r\n\r\n\r\n<p>-&nbsp; On August 4th, and for 35$ there will be an all you can eat&nbsp;mamnoon street and anar food and drink menu and entertained by&nbsp;musicians Black Giraffe and Dj Dana Dub, Dj Spank&nbsp;from 4-9 pm. &nbsp;&nbsp;</p>\r\n\r\n\r\n\r\n<p>- On August 4th we will have an all inclusive&nbsp;special a la zao\'ak menu at mamnoon with Musar Arak and curated paired wines&nbsp;for 250$/person, music provided by House of Tarab. &nbsp;Details of the menu will be available shortly. &nbsp;reservations strongly recommended.&nbsp;</p>\r\n\r\n\r\n\r\n<p>- On August 5th, we will host an invite-only event&nbsp;from 5-9 pm&nbsp;with a special tasting menu by Jason Stratton and some of his Top Chef colleagues. The menu&nbsp;paired with Chateau Musar wines and will be the first ever event held at mbar. &nbsp;Music will be provided by Dj Riz.&nbsp;Please inquire with jonny@mamnoonrestaurant.com about this event.&nbsp;</p>\r\n\r\n\r\n\r\n<p>- On August 5th starting 9 pm, we will host an invite-only&nbsp;tarab 4 syria party on the mbar rooftop deck&nbsp;featuring bites and special drinks, as well as music by DJ Riz and Hellopsycaleppo. &nbsp; Please inquire with jonny@mamnoonrestaurant.com about this event.&nbsp;</p>\r\n\r\n<p><br></p>\r\n\r\n<p>Come join us and get into your tarab and do lasting good.&nbsp; There will be many ways to participate, for all budgets and preferences.&nbsp; I look forward to seeing many of you there.&nbsp;</p>\r\n\r\n<p><br></p>\r\n\r\n<p>Wassef</p>\r\n\r\n\r\n\r\n<p><br></p>\r\n\r\n\r\n\r\n<p><br></p>\r\n\r\n\r\n\r\n<p><br></p>\r\n\r\n\r\n\r\n<p><br></p>\r\n\r\n\r\n\r\n<p><br></p>\r\n\r\n\r\n\r\n<p><br></p>\r\n\r\n\r\n\r\n<p><br></p>', NULL, NULL, NULL, NULL, '2016-07-19 01:08:46', '2016-08-04 14:53:35', '481e9687-fbe9-4661-b14b-9ba6e2cb650b'),
 ('118', '1331', 'en_us', '<p class=\"MsoNormal\">The civil war in Syria is in its 5th year and has taken an immense toll on the lives of everyday people there.&nbsp; The extreme situation, there and elsewhere in the Middle East, weighs heavily on our hearts and minds.&nbsp; mamnoon has successfully corralled the community in Seattle to support several charitable activities to help with this dire situation.&nbsp; Unfortunately, today millions do not have access to basics like bread and clean drinking water.&nbsp; This heartbreaking truth reminds us how lucky we are to live in a place that we do have access to those things and so much more.</p>\r\n\r\n<p class=\"MsoNormal\">mamnoon is a beacon for modern middle eastern hospitality, and for years we’ve welcomed you with our fresh bread and our exclusive za’atar imported from the region – the very best of what our culture can provide.&nbsp; While we still believe in providing this level of hospitality, we can no longer justify giving bread away when so many can’t get it at all.&nbsp; Another impact of the chaos in the region is that our spices and exclusive za\'atar have become very difficult to import.&nbsp; Under the circumstances we are changing the way that we are approaching our bread service.&nbsp; <br><br>Starting on Monday November 21st, we will no longer offer our barbari bread to start our meals.&nbsp; We will continue to offer our incredible, freshly baked pita with your meal, but will move the za\'atar and olive oil to our menu at a nominal charge.&nbsp; We are going to continue to provide the highest quality spices and flavors, and our hope is that everyone will enjoy these offerings with an awareness of the deep connection to a region that is experiencing a shortage of basics, like bread, that we are so lucky to have.<br><br>Our mission is to bridge cultures, and it is sometimes through seemingly very small gestures that this bridge is crossed.&nbsp; If you are moved to do so, we always have ways of donating to charities that have shown their commitment to efficient humanitarian work, and we are happy to connect you to them.&nbsp; Several times throughout the year we host fundraisers, and currently we have retail items available that support charities that we have vetted.&nbsp; Our hope is that our daily work in creating food and flavor experiences, that link us to cultures that are far from Seattle, generates an understanding of the humanity that we all share.&nbsp; <br><br>mamnoon to you.</p>', NULL, NULL, NULL, NULL, '2016-11-19 01:49:37', '2016-11-19 01:52:37', 'e073236a-090f-4c1e-8ce5-90354c060b13'),
 ('119', '1335', 'en_us', NULL, 'left', NULL, NULL, NULL, '2016-11-24 00:43:49', '2016-11-28 21:27:56', 'fee5e931-0bf1-485f-a7f9-aad687637873'),
 ('120', '1336', 'en_us', '<p><strong class=\"redactor-inline-converted\">mamnoon turns 4!</strong></p>\r\n\r\n<p>mamnoon debuted on 11/19/2012. We opened to an incredible reception by the&nbsp; amazing people of Seattle and we have been going strong ever since.&nbsp; &nbsp;<br>mamnoon\'s mission is to bridge the ancient and deep Middle Eastern cultures with the progressive and forward looking Northwest culture.&nbsp; We are doing it by staying as true as possible to the roots of the food and hospitality while projecting these cultures into the future, one that is influenced by our experiences here over the last 25 years. <br>We are proud of what we\'ve been able to do with your help. We are extremely thankful to you for giving us the opportunity to serve you and the community at large, and for making us feel very much part of the fabric of Capitol Hill, Seattle. </p>\r\n\r\n\r\n\r\n<p><strong class=\"redactor-inline-converted\">mamnoon 4th anniversary week</strong><br>There will be many opportunities for you to&nbsp; celebrate and enjoy our 4th anniversary throughout the week starting 11/28. <br>From Monday to Thursday all items on our super hot happy hour menu will be for $4<br>On Friday and Saturday Executive Chef Carrie Marshaney has prepared a special 4 course tasting menu for $44, with special wine pairing for $24.&nbsp; Please mention your interest in the tasting menu when you reserve<br>Through out the week you can enjoy a Champagne and Harra Frites special for $24 - featuring our amazing harra frites, za\'atar mayo and a half bottle of Chandon Brut Classic.</p><p><strong>Helping the White Helmets</strong><br></p><p>We will also be donating 15% of our revenue during this week to the life saving heroes of the White Helmets: <a href=\"https://www.whitehelmets.org/en\">https://www.whitehelmets.org/e...</a>We hope that we can share all our good fortunes with those most needing support in Syria.</p><p>&nbsp;<br>We hope to celebrate with you soon.</p>', NULL, NULL, NULL, NULL, '2016-11-24 00:43:49', '2016-11-28 21:27:56', 'f85edf91-6576-4afe-b606-d9ed4e6fe361'),
 ('121', '1337', 'en_us', NULL, 'left', NULL, NULL, NULL, '2016-11-24 00:43:49', '2016-11-28 21:27:56', '4f169c87-1bd6-4062-ab1d-5df27dc91704'),
 ('122', '1359', 'en_us', '<p>This New Year\'s Eve mamnoon will be offering a four course tasting menu for everyone that comes in for dinner!&nbsp; We will forego our a la carte options for a $65/person menu with an optional wine pairing for $30/person.</p><h5>Course One: Cold Mezze</h5><p>spot prawns with hummus</p><p>fattoush salad</p><p>dolmeh, yogurt, barberries</p><p>lamb kibbeh nayeh</p><p>rabbit liver mousse</p><h5>Course Two: Hot Mezze</h5><p>kibbeh, tarrator</p><p>spinach borek</p><p>eggplant, lamb, yogurt, pomegranate</p><p>khobz bi fleifleh</p><h5>Course Three: Meshoui</h5><p>served with chelow rice</p><p>trout, herbs, barberries, angelica, almonds, new potatoes</p><p><em>or</em></p><p>filet mignon, mushrooms, confit garlic, spiced au jus</p><h5>Course Four: Dessert</h5><p>turkish affogato, cardamom, pistachio biscotti</p><p><em>or</em></p><p>labneh mousse parfait, pear, quince sorbet, turkish delight</p>', NULL, NULL, NULL, NULL, '2016-12-18 02:59:21', '2016-12-18 02:59:21', 'ca75fcf0-1917-4712-82f5-040da3de2ce6'),
 ('123', '1434', 'en_us', NULL, 'center', NULL, NULL, NULL, '2017-02-11 21:40:14', '2017-02-12 02:37:52', 'aa8d90bd-a303-4911-9520-71028298648a'),
 ('124', '1435', 'en_us', '<p>we all need to reach out and get closer to who we love and who loves us back, more than ever.&nbsp; \r\n\r\n  </p>\r\n\r\n<p>for this coming holiday, we have worked hard to create an unparalleled experience for you to share the love with family and friends.&nbsp; please join us this&nbsp;valentine’s day for a very special prix fixe menu and our a la carte offerings that you love.\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>\r\n\r\n  mamnoon to you</p>\r\n\r\n\r\n\r\n\r\n\r\n<hr>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><strong>Valentine’s Day Tasting Menu 2017 </strong>\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><strong>&nbsp;Mezze</strong>\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>moushakal</p>\r\n\r\n\r\n\r\n\r\n\r\n<p><em class=\"redactor-inline-converted\">mezze of hummus, labneh, shamandar bi tahini, baba ganoush</em></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>borek\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>baked phyllo pastries filled with greens\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>tabbouleh shatwieh\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><em class=\"redactor-inline-converted\">parsley, bulgar, fennel, radish, lemon</em>\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>arnabeit makli \r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>fried cauliflower, tarrator, parsley\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><strong>Entrée</strong>\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>mahi-ye sabzi \r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><em class=\"redactor-inline-converted\">boneless stuffed whole trout, barberries, herbs, angelica, almonds, new potatoes</em>\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>dolmeh barg-e kalam\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><em>lamb stuffed cabbage, tomato,&nbsp;</em><em>yogurt powder, dried mint</em></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><strong>Dessert</strong>\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>labneh cheesecake \r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><em class=\"redactor-inline-converted\">huckleberry, caramelized white chocolate walnut croutons</em>\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>tahini truffles\r\n\r\n  </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><em class=\"redactor-inline-converted\">dark chocolate truffles, tahini swirl</em></p>', NULL, NULL, NULL, NULL, '2017-02-11 21:40:14', '2017-02-12 02:37:52', '05c4c134-2ddc-4519-894b-1365e7879516'),
 ('125', '1441', 'en_us', NULL, 'center', NULL, NULL, NULL, '2017-02-12 02:45:28', '2017-02-12 23:35:57', '18fc7cd7-edf2-40fa-9f50-4408e7925d75'),
 ('126', '1442', 'en_us', '<p>Come help us raise money for the ACLU on February 20th, President\'s Day!</p><p>Charity is a core part of the mamnoon mission. We have raised substantial funds over the years to help refugees with incredible support from the&nbsp;generous and worldly city of&nbsp;Seattle and its amazing inhabitants. Over the years the refugee crisis has only gotten worse and its effects continue to grow&nbsp;deeper. That\'s why this&nbsp;President\'s Day, we will be donating 10% of our revenue to the American Civil Liberties Union&nbsp;to fight for the rights of immigrants and refugees.</p>\r\n\r\n<p>Hopefully you\'ve got the day off and will come join us in contributing to the mission of the ACLU by&nbsp;having lunch, happy hour, or dinner with us. We hope to see you here.</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p>mamnoon to you</p>', NULL, NULL, NULL, NULL, '2017-02-12 02:45:28', '2017-02-12 23:35:57', '79e88359-a6f9-41fc-9afe-f6d9ab0483b9'),
 ('127', '1443', 'en_us', NULL, 'center', NULL, NULL, NULL, '2017-02-12 02:45:28', '2017-02-12 23:35:57', '79e7aa75-47c6-42e2-aebd-32c36ac78f97'),
 ('128', '1476', 'en_us', NULL, 'left', NULL, NULL, NULL, '2017-04-18 21:03:41', '2017-04-18 21:19:07', '1a9f416a-c8c7-4082-bfc9-c1b21c42b8c1'),
 ('129', '1477', 'en_us', '<p>We\'re proud to be participating in Lifelong\'s fundraiser, Dining Out for Life! If you don\'t already have plans for Thursday, April 27th, please consider making a reservation or coming in for lunch or happy hour. We\'ll be donating 30%(!) to this important cause on your behalf. Eat your generous heart out!</p><p><a href=\"http://bit.ly/1qoBMik\" target=\"_blank\">Click here to make a reservation!</a></p>\r\n\r\n<p>\"Dining Out for Life is one of our biggest, most important fundraisers of the year&mdash;it’s been going strong in Seattle for over 20 years, and ensures that our food program, Chicken Soup Brigade, can continue to provide our clients with healthy food catered to their specific medical conditions.\" - Lifelong</p>', NULL, NULL, NULL, NULL, '2017-04-18 21:03:41', '2017-04-18 21:19:07', '761f19a4-c738-4b76-a523-dc3d07638be4');
INSERT INTO `craft_matrixcontent_storyslides` (`id`, `elementId`, `locale`, `field_slide_heading`, `field_slide_text`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '650', 'en_us', 'our story', '<p>Food is an essential part of all family and social interactions in the Middle East where people grow up with intense flavors, colorful, vibrant foods fresh from the marketplace, prepared simply and with a lot of passion. Aromatic herbs fill the streets and a spirit of warmth and generosity exudes welcome at any table.</p><p>Here at mamnoon, we share these strengths brought with us from Lebanon and Syria to the new world of Seattle – where modern curiosity, compassion, progressive values and tolerance are paving the way for harmonious integration and celebration of cultures and flavors.</p>', '2014-09-11 23:16:25', '2016-06-11 01:23:05', '247bbcb2-8442-49ed-8f27-9c0e847e840f'),
 ('4', '653', 'en_us', 'Racha', '<p>Owner Racha Haroun was born in London, England to a Syrian father and Iranian mother. Racha came with her family to Houston, Texas from Damascus in 1982 where she attended college and met her husband Wassef. Racha grew up in a household where hospitality was prized and where both cuisines and palates were equally valued and integrated. Racha is deeply involved in the cultural community of Seattle and is a crucial part of the palate, menu development, and creative process behind the mamnoon aesthetic.</p>', '2014-09-11 23:16:25', '2016-06-11 01:23:05', '6a3a4f38-ba79-4041-adb4-de3c422221a8'),
 ('5', '654', 'en_us', 'Wassef', '<p>Owner Wassef Haroun was born in Syria and raised in Lebanon before moving to the United States for school. After leaving a career in technology and computer science, Wassef turned to mamnoon as an experiment to bring the food and traditions of the levant to an American audience and to bridge the apparent gaps between the two cultures he inhabits. True to his geek background, Wassef has his hands in innumerable projects, big and small, around the restaurant in order to make the mamnoon experience universally compelling.</p>', '2014-09-11 23:16:25', '2016-06-11 01:23:05', '7a095e8b-7fa7-4915-88ff-654439c93491'),
 ('6', '655', 'en_us', 'The Team', '<p>None of this would be possible without our spectacular team!</p>', '2014-09-11 23:16:25', '2016-06-11 01:23:05', 'aa867a0e-108e-4ee9-99a3-c91b4cdd498a');
