 ('127', 'field', '37', 'en_us', ' i sg9lhrq 1080 i x9xhm2v 1280 '),
 ('131', 'field', '2', 'en_us', ' our storyfood an essential part of all family and social interactions in the middle east where people grow up with intense flavors colorful vibrant foods fresh from the marketplace prepared simply and with a lot of passion aromatic herbs fill the streets and a spirit of warmth and generosity exudes welcome at any table here at mamnoon we share these strengths brought with us from lebanon and syria to the new world of seattle where modern curiosity compassion progressive values and tolerance are paving the way for harmonious integration and celebration of cultures and flavors '),
 ('134', 'field', '2', 'en_us', ' the manou she is a very common street food found in every damascus and beirut street often made fresh in the same furn bakery that supplies the pita daily bread to the neighborhood ingredients are basically flour water salt olive oil and za atar simple fresh but when put together with the right skill the results are magical experiences of taste and texture this is a centuries old tradition that until now has not been easy to experience in seattle one that we grew up with and missed terribly we believe you will have the same magical experience when you have your first mano ushe '),
 ('165', 'field', '2', 'en_us', ' our monthly series continues on monday june 2nd from 6pm to close join us as we celebrate the restaurant industry with a social event built around food fun and friends $30 per person gets you unlimited access to all food items a free drink ticket price excludes tax and gratuity please call for details '),
