 ('467', 'title', '0', 'en_us', ' cafe blanc '),
 ('467', 'field', '2', 'en_us', ' at the end of every meal at mamnoon we serve all our guests a small carafe of cafe blanc or white coffee to cap off their meal and facilitate digestion known was ahweh bayda in arabic cafe blanc is made with orange blossom extract and hot water and is sometimes sweetened with sugar or honey cafe blanc is thought to have originated in lebanon and is traditionally served after meals as a digestif and offered as a sign of hospitality at special occasions and gatherings all over the arab world naturally caffeine and alcohol free cafe blanc is also said to soothe the nerves and aid with stomach aches many middle eastern mothers will also give their colicky babies a small amount of orange blossom extract with water when making cafe blanc at home remember that a little bit goes a long way we like ours alongside a sweet little treat like nokhochi or baklawa cafe blanc 2 cups hot water1 t orange blossom extractsugar or honey to taste optional '),
 ('467', 'field', '38', 'en_us', ' menu '),
 ('468', 'field', '2', 'en_us', ' we are dedicated to giving back to the people and cultures that inspire all that we do at mamnoon through various fundraising efforts we have donated nearly $25 000 to the unhcr syrian refugee relief fund to aid those displaced by the crisis in syria and the middle east our khobz for syria campaign donates 100% of the proceeds from a $5 basket of house made specialty breads to the unhcr from the start of this project these baskets have been one of our most popular menu items and a wonderful way for the mamnoon community to get involved with the giving effort we are also part of a larger fundraising effort in partnership with glassybaby a seattle based glass blowing studio our restaurant features a mamnoon special glassybaby candle holder in an exclusive dark slate color $20 from the sale of every mamnoon glassybaby is donated to syrian relief the mamnoon special glassbaby is part of the larger glassybaby giving effort a campaign that supports various charities and has donated over $2 000 000 through the sales of these beautifully simple glass candle holders thedouble glazed slate glassybaby votives on display throughout the restaurant are only available at mamnoon we have also had an incredible community support through private events and individual donations for more information on mamnoon giving or to make a donation call 206 906 9606 or visit http www unhcr org emergency 5051e8cd6 52b1c61ec html '),
 ('468', 'field', '38', 'en_us', ' news '),
 ('468', 'slug', '0', 'en_us', ' the power of giving '),
 ('468', 'title', '0', 'en_us', ' the power of giving '),
 ('127', 'field', '49', 'en_us', ' mamnoon '),
 ('127', 'field', '50', 'en_us', ''),
 ('2', 'field', '22', 'en_us', ' i 43bsjhr 1080 i dj79pfr 1080 mamnoon 1 i f2xrttz 1080 habibti website i jwmgf9s 1080 mamnoon 2 i zwz2kps 1080 i rjbvblk 1080 i rpcd3vc 1080 kefta website i v7qhvst 1080 mamnoon 7 i t7fm4jf 1080 mamnoon 5 i pkf3gmz 1080 mamnoon 9 i z76sprc 1080 i mnxv4vn 1080 mamnoon 4 i rbwzbgn 1080 alexandsam helawete el jibne website '),
 ('2', 'field', '46', 'en_us', ' modern union of lebanese syrian persian cuisines lebanese and syrian street foods '),
 ('2', 'field', '37', 'en_us', ' our story screens 1 food is an essential part of all family and social interactions in the middle east where people grow up with intense flavors colorful vibrant foods fresh from the marketplace prepared simply and with a lot of passion aromatic herbs fill the streets and a spirit of warmth and generosity exudes welcome at any table here at mamnoon we share these strengths brought with us from lebanon and syria to the new world of seattle where modern curiosity compassion progressive values and tolerance are paving the way for harmonious integration and celebration of cultures and flavors racha racha bio pic owner racha haroun was born in london england to a syrian father and iranian mother racha came with her family to houston texas from damascus in 1982 where she attended college and met her husband wassef racha grew up in a household where hospitality was prized and where both cuisines and palates were equally valued and integrated racha is deeply involved in the cultural community of seattle and is a crucial part of the palate menu development and creative process behind the mamnoon aesthetic wassef wassefracha owner wassef haroun was born in syria and raised in lebanon before moving to the united states for school after leaving a career in technology and computer science wassef turned to mamnoon as an experiment to bring the food and traditions of the levant to an american audience and to bridge the apparent gaps between the two cultures he inhabits true to his geek background wassef has his hands in innumerable projects big and small around the restaurant in order to make the mamnoon experience universally compelling the team seattlemet secret supper none of this would be possible without our spectacular team '),
