 ('467', 'field', '39', 'en_us', ' at the end of every meal at mamnoon we serve all our guests a small carafe of cafe blanc or white coffee to cap off their meal and facilitate digestion known was ahweh bayda in arabic cafe blanc is made with orange blossom extract and hot water and is sometimes sweetened with sugar or honey cafe blanc is thought to have originated in lebanon and is traditionally served after meals as a digestif and offered as a sign of hospitality at special occasions and gatherings all over the arab world naturally caffeine and alcohol free cafe blanc is also said to soothe the nerves and aid with stomach aches many middle eastern mothers will also give their colicky babies a small amount of orange blossom extract with water when making cafe blanc at home remember that a little bit goes a long way we like ours alongside a sweet little treat like nokhochi or baklawa 2 cups hot water 2 cups hot water 1 t orange blossom extract 1 t orange blossom extract sugar or honey to taste optional sugar or honey to taste optional cafe blanc cafe blanc center '),
