 ('468', 'field', '39', 'en_us', ' khobzforsyria right we are dedicated to giving back to the people and cultures that inspire all that we do at mamnoon through various fundraising efforts we have donated nearly $25 000 to the unhcr syrian refugee relief fund to aid those displaced by the crisis in syria and the middle east our khobz for syria campaign donates 100% of the proceeds from a $5 basket of house made specialty breads to the unhcr from the start of this project these baskets have been one of our most popular menu items and a wonderful way for the mamnoon community to get involved with the giving effort we are also part of a larger fundraising effort in partnership with glassybaby a seattle based glass blowing studio our restaurant features a mamnoon special glassybaby candle holder in an exclusive dark slate color $20 from the sale of every mamnoon glassybaby is donated to syrian relief the mamnoon special glassbaby is part of the larger glassybaby giving effort a campaign that supports various charities and has donated over $2 000 000 through the sales of these beautifully simple glass candle holders thedouble glazed slate glassybaby votives on display throughout the restaurant are only available at mamnoon we have also had an incredible community support through private events and individual donations for more information on mamnoon giving or to make a donation call 206 906 9606 or visit http www unhcr org emergency 5051e8cd6 52b1c61ec html glassybaby2 left '),
