 ('504', 'field', '40', 'en_us', ' the mamnoon project was a complete collaboration between racha and me entering into many areas that we have never been before and like every other project i have been in mamnoon is a headlong full contact affair made more intense by the fact that racha is fully in it as well this is a new and intense family dynamic we both bring it home and live it day and night it has helped us do better for mamnoon in a very natural way and has added a dimension of authenticity that is unparalleled i am talking about mamnoon in very personal way but what really makes it relevant and vibrant to all of us today is the team that has gelled behind the mission we are simply blessed to have some of the most talented individuals in the industry believe in what we are trying to do and to have taken on the mission as their own this is a testament that what we have lived and believe in is universal the excitement passion and drive we see in the staff translates to amazing guest experiences and a net cultural transfer all of it for the better as the main geek at mamnoon my work is endless there is a lot i need to do tinkering here and there helping on the technology working on processes and learning what it is that we can do to make the mamnoon experience universally compelling if you come by one day and see me around with a laptop measuring tape on top of a ladder under a piece of equipment or talking to a guest don t be surprised i m just geeking out wassef '),
