 ('520', 'slug', '0', 'en_us', ' i thought you were closed on mondays an update on whats been going on with mamnoon junoon '),
 ('520', 'title', '0', 'en_us', ' i thought you were closed on mondays an update on what s been going on with mamnoon junoon '),
 ('521', 'field', '40', 'en_us', ' two junoons into our newly launched monday night series and we are off to a rocking start mamnoon junoon was hatched as a way to bust outside the box and serve as a creative and fun way to explore aspects of the food and culture of the levant that we may not fit inside the repertoire of our normal dinner service our kickoff junoon event was a six course moroccan feast that highlighted many of the dishes owner wassef haroun and sous chef sean dominoski discovered on a trip to morocco last year as mamnoon is a syrian lebanese and persian restaurant this junoon was a great chance to experiment with the food of a country that while geographically close is really pretty different than the flavors our kitchen usually employs some of the highlights from the menu were the merguez harissa and lamb sausage seven vegetable tajine with hand rolled couscous and a savory goat cheese and herb pastry '),
