 ('523', 'field', '40', 'en_us', ' we went in a totally different direction for the next month s junoon this time choosing to focus on engaging more than just your taste buds mamnoontv explored the videos and images of the levant in a rethinking of a night at the theater we had projection screens set up throughout the restaurant playing clips from various arabic tv show and music videos and the entertainment was paired with theater style snacks jibneh nachos za atar popcorn kefta sliders and sujuk hot dogs '),
