 ('527', 'field', '39', 'en_us', ' junoonflyer0221 full mamnoontv is the next addition in our monthly mamnoon junoon dinner series join us on monday march 3rd for an evening that is guaranteed to turn your idea of a night at the theater on it s head our talented and twisted kitchen has prepared a menu of theater themed dishes inspired by the tastes and flavors of mamnoon enjoy delicacies like za atar popcorn jibneh nachos and kefta sliders against a backdrop of the videos and images of the levant this playful and casual evening is a mamnoon rethinking of a classic come break bread with friends and treat all your senses to the magic of the middle east call 206 906 9606 or visit http www mamnoonrestaurant com for reservations '),
