 ('544', 'field', '39', 'en_us', ' by zack chamberlainas told to molly sinnott zack 3 right bread is always gonna be bread it s so simple but so necessary and that necessity adds complexity any main dish on a dinner table is going to change but bread is always going to be there and be comprised of more or less the same ingredients there s beauty in that simplicity garrett asked me to come on about two weeks before the restaurant opened and at the beginning it was really just more to help out i think in a lot of ways that helped me learn things from the ground up and get to know people involved in the restaurant in a different way this is my fifth restaurant opening in my career and i really love the energy that comes with opening a restaurant but i ve never worked a streetside window before which is really cool i ve found out that i am much more of a people person than i ever thought i was in terms of being up front and talking to customers it s incredibly dynamic and i find a lot of joy in that we get to see smiling faces all day and we get instant feedback from customers which i really appreciate i also just like making people happy and watching them leave satisfied zack 5 left our front kitchen is specifically designed to produce this lebanese style street food being seattle and not a city that really has a vibrant street food scene it has kind of morphed into a to go window and full service lunch it also offers a great alternative to the more aggressively priced sit down formal dinner that is our back dining room but i think our front window really balances the two types of cuisines we offer as far as fun and functional and takeaway versus fancy and formal and sit down we went through a lot of trial and error just getting people to try our food was really tough and it was hard to get people hooked so we were out there on the street giving out samples and talking things up we opened completely organically though and we haven t really done any advertising at all so throughout the past year there s been a real evolution of the food we offer up front for example we ve changed things from kulage to sandwich because really it just looks like a sandwich and we ve adapted some of the elements from a traditional kulage to make it look more like something that americans will eat for lunch we ve had to make it a bit more accessible and easy to order i think there was a bit of resistance at first but we ve stayed pretty close to our original path and i think we re winning in the long run sometimes you have to wait for people to take and people took it s exciting my job is basically getting everything to function and to be cohesive and i get a huge amount of satisfaction from that the menu was completely made when i got here but i had to pull it off logistically i m really more of a logistical and detail minded person than a fancy creator of brand new foods which really goes back to simplicity and my initial attraction to bread it s the necessities the staples so it s the fact that the two aspects of the restaurant kind of feed each other one is a little more playful and one s more serious but they really balance each other out and the cohesion of the whole place is really important to me bridging the gap between front and back of the house and between the to go window and the back dining room so in a way its larger than a restaurant it s how people come together to celebrate their passions zack 4 center '),
