 ('569', 'field', '40', 'en_us', ' mamnoon has just recently celebrated one year in business congrats tell me a bit about the journey so far it s been exciting challenging but necessary since i am syrian and iranian i feel that it s through the food that guests have been able to appreciate the warmth and compassion that have been part of our cultures for thousands of years i grew up eating both foods and for many years shared my love and respect for the food with our friends it felt like the right time to share with our adopted home seattle we feel honored that people appreciate the experience and share the love of the food all the recent events and news are masking the good that s in these ancient civilizations and i feel compelled to share these positive aspects with seattle and the greater northwest community how would you describe the role you play at the restaurant i really love the creative aspect of mamnoon art has always been a very important part of my life and i taught myself to cook the foods that i grew up with while living in seattle i am proud to be part of the creative process of bringing mamnoon to life curating the guest experience from start to finish the feel and the taste i was raised with the palate to know and appreciate good lebanese syrian and iranian cuisines our culinary team is exceptionally talented but not necessarily totally experienced in the cuisine and the desired outcomes i work closely with our executive chef garrett melkonian and the rest of the talented kitchen staff and have been excited to see that they ve started to acquire the palate and can now make authentic dishes better than i ever made even our most critical guests our moms approve we apply a lot of creativity in presenting dishes that are common in the middle east but new to most of our guests to help make the dishes less mysterious and more approachable what have been some of the most rewarding and challenging aspects of the process the most rewarding part is realizing that our hearts are in the right place we are proud of our foods but we wanted to showcase it in a modern northwest setting we noticed that our children are very proud of our achievement and the fact that hard work and perseverance pays off the hardest part has been the constant awareness that our families are living in a tense war situation with a very uncertain future caring and nurturing mamnoon keeps us busy and sane while really highlighting the beautiful aspects of our culture '),
