 ('629', 'field', '40', 'en_us', ' start prepping your palates mamnoon is hosting a cocktail naming contest to name our drinks 1 11 and we need your help coming up with the most appropriate creative or outlandish titles the contest runs from december 1 december 31st and we ll be accepting submissions on all cocktails throughout the month make sure you check back periodically as we ll be releasing preparation and ingredient details for each cocktail that will help in the naming process submissions are limited to one per person per cocktail so come up with something fitting for all 11 to increase your chances of winning did we mention there d be prizes the first place name that is chosen will win a $50 mamnoon gift certificate the runner up plus a friend will be able to enjoy a newly minted mamnoon cocktail on us submissions will be judged by a panel of mamnoon experts and winners will be announced in early january submit your names in the comment section of the blog via facebook or twitter or come into the restaurant to fill out a paper submission form stop by today to sample the cocktails and let the creative juices flow '),
