 ('632', 'field', '53', 'en_us', ' executive chef garrett melkonian grew up in his grandparents kitchen surrounded by the flavors and personalities of their native armenia while his cooking career has taken him in many directions including he came to mamnoon because the hospitality found here is a direct reflection of the love and respect he remembers from his childhood garrett strives for the delicate balance of inspiration and authenticity and holds himself and his kitchen to the high standards that come with being ambassadors a cuisine relatively unexplored in the pacific northwest '),
 ('632', 'field', '54', 'en_us', ''),
 ('633', 'field', '53', 'en_us', ' mamnoon too chef zack chamberlain was born in the wilds of the green mountains of vermont and made his move from the dish pit to the line as a teenager after attending the culinary institute of america zack came to seattle and began a decades long affair with breads and woodstove ovens zack is the face of our to go window and strives to bring the vibrancy of lebanese street food to a seattle audience '),
 ('633', 'field', '54', 'en_us', ''),
 ('634', 'field', '53', 'en_us', ' owner racha haroun was born in london england to a syrian father and iranian mother racha came with her family to houston texas from damascus in 1982 where she attended college and met her husband wassef racha grew up in a household where hospitality was prized and where both cuisines and palates were equally valued and integrated racha is deeply involved in the cultural community of seattle and is a crucial part of the palate menu development and creative process behind the mamnoon aesthetic '),
 ('634', 'field', '54', 'en_us', ''),
 ('635', 'field', '53', 'en_us', ' owner wassef haroun was born in syria and raised in lebanon before moving to the united states for school after leaving a career in technology and computer science wassef turned to mamnoon as an experiment to bring the food and traditions of the levant to an american audience and to bridge the apparent gaps between the two cultures he inhabits true to his geek background wassef has his hands in innumerable projects big and small around the restaurant in order to make the mamnoon experience universally compelling '),
 ('635', 'field', '54', 'en_us', ''),
