 ('776', 'field', '39', 'en_us', ' go hawks the hawks making the superbowl again is one of the good reasons for us to close our dinner service we are so proud of the team and want to root for them all the way as a result we will be closing at 2 30 pm on sunday feb 1st and then if you are not lucky to be there in person we can help you have the very best seahawks party at home check out this incredible take home or delivery menu and put your orders in soon we don t want you to miss out on shish taouk hawk wings these are chicken wings marinated in our famous shish taouk marinade served in a bucket with a selection of our best dips this meal will set a new high bar for superbowl party food and make you the most seahawk of hosts please put your orders in early by calling in at 206 906 9606 and ask for the superbowl special and what time you will be picking up delivery is also available via mamnoon deliverywassefps we will be ordering a couple for a party we re crashing '),
