 ('783', 'field', '40', 'en_us', ' after a few month s hiatus for the holidays mamnoon junoon is back for monday feb 2nd dinner while the holidays were a great busy period for us here it was also an unbelievably terrible period for syrian refugees the numbers are increasing the living conditions are getting harder and most of the levant turkey was hit with one of the worst winters on record one of mamnoon s goals is to connect you with the people and cultures of the levant in positive compassionate and delicious ways we have always had an active charity component via our giving to unhcr over $25k to date in addition many of you have asked throughout our existence how to help in direct ways beyond donating through our khobz for syria mukassarat or mamnoon special glassybaby we did some research and decided to focus this junoon and the charity effort where we can all make the most impact we will be offering the net proceeds from the night to the malki scm children center this great effort is made possible by the local salaam cultural museum organization they have created a few normal safe zones with basic schooling play and art therapy for refugee syrian children in jordan the need is immense and every cent raised here goes directly to the centers we could not think of a better more effective way to help those in most need with the the most future we need you to make it a huge night our famous chelow kebab will make a comeback as well as a special off menu dessert in addition we ll have live classical arabic oud music courtesy of stephen elaimy house of tarab please reserve and share this will be a great way to enjoy a mamnoon feast while doing good hope to see you heremamnoon team '),
