 ('820', 'field', '39', 'en_us', ' simorgh center art manifests itself in many ways at mamnoon in the food in the music and in the art our most prominent piece an installation of thirty fiberglass chickens hangs over the dining room simorgh is the work of persian sculptor nastaran safaei maintaining an air of playfulness and levity the artist has instilled a double meaning in simorgh it derives its influence primarily from the character of the same name in farid al din attar s twelfth century poem the conference of the birds which follows a flock as they travel through the many valleys of life as they search for illustrious king of the birds safaei plays on the name further separately the syllables of simorgh translate to thirty si birds morgh ya amina center safaei s simorgh adds an air of mysticism and tradition to the atmosphere at mamnoon acting simultaneously as compliment and juxtaposition to mamnoon s collection which includes hassan hajjaj sya amina a colorful portrait of a strong and brightly dressed young woman unafraid of breaking boundaries hajjaj employs a boundless color palette and wide reaching use of mediums to create portraits that both embody and empower the people of his native morocco '),
