 ('829', 'field', '39', 'en_us', ' art at mamnoon our collection has grown we are excited to feature two pieces from los angeles artists davis and davis from their little talents collection tattoo baby and whirly girl are photographs that employ a rich color palette while using found materials to create images that are both aesthetically pleasing and mentally perplexing in whirly girl the doll is depicted as literally having the world on a string while tattoo baby shows a swaddled figurine covered in henna designs needless to say these pieces leave much up to the imagination whirly girl center for me whirly girl is particularly striking because of its highly charged duality as part of a generation who feels like they are entitled to the world my first read was that the artists intentions were to convey that this notion of global possessiveness is a truly epic farce begging to be mocked however in light of the mission of mamnoon an entirely different message can be begged by placing the entire world within the grasp of this tiny girl every corner of the globe is accessible for us to explore embrace and taste ultimately interpretation is a choice and i am going to choose the positive tatoo baby center as far as tattoo baby goes i would love to think that the artists were depicting the next generation of capitol hill hipsters but something tells me i am a little off in that the image of a blonde haired baby covered in tattoos is highly imaginative unique and totally unheard of seeing it for the first time brought back memories of my first dining experience at mamnoon that holy h moment of culinary bliss that comes with trying a dish that blends two things together to create a union that you never would have even considered before mamnoon is filled with all of these juicy combinations from the food on the plates to the art on the walls and i can t wait to see what happens next come check them out they can be found deep in the main dining hall right next the glass kitchen wall we d love to hear your interpretation '),
