 ('830', 'slug', '0', 'en_us', ''),
 ('831', 'field', '41', 'en_us', ' whirly girl '),
 ('831', 'field', '42', 'en_us', ' center '),
 ('831', 'slug', '0', 'en_us', ''),
 ('832', 'field', '40', 'en_us', ' for me whirly girl is particularly striking because of its highly charged duality as part of a generation who feels like they are entitled to the world my first read was that the artists intentions were to convey that this notion of global possessiveness is a truly epic farce begging to be mocked however in light of the mission of mamnoon an entirely different message can be begged by placing the entire world within the grasp of this tiny girl every corner of the globe is accessible for us to explore embrace and taste ultimately interpretation is a choice and i am going to choose the positive '),
 ('832', 'slug', '0', 'en_us', ''),
 ('833', 'field', '41', 'en_us', ' tatoo baby '),
 ('833', 'field', '42', 'en_us', ' center '),
 ('833', 'slug', '0', 'en_us', ''),
 ('834', 'field', '40', 'en_us', ' as far as tattoo baby goes i would love to think that the artists were depicting the next generation of capitol hill hipsters but something tells me i am a little off in that the image of a blonde haired baby covered in tattoos is highly imaginative unique and totally unheard of seeing it for the first time brought back memories of my first dining experience at mamnoon that holy h moment of culinary bliss that comes with trying a dish that blends two things together to create a union that you never would have even considered before mamnoon is filled with all of these juicy combinations from the food on the plates to the art on the walls and i can t wait to see what happens next come check them out they can be found deep in the main dining hall right next the glass kitchen wall we d love to hear your interpretation '),
 ('834', 'slug', '0', 'en_us', ''),
 ('835', 'field', '35', 'en_us', ''),
