 ('836', 'field', '39', 'en_us', ' elad pic for bio center community is everything at mamnoon and it all starts with our staff setting the precedent for hard work and flexibility at mamnoon elad wears the many hats of a bartender server and mamnoon street window dude out of breath me too elad is there to help with whatever whenever and wherever his unparalleled sense of work ethic and unbreakable can do attitude help keep mamnoon ticking outside of mamnoon you can find elad engrossed in his art specializing in typography and street art elad s pieces capture life in brilliant color whatever palette he s perfecting be that color tones or quinoa tabbouleh elad can always be counted on to give us his best smiling all the way mamnoon to you elad '),
