 ('1184', 'field', '39', 'en_us', ' tarab center tarab 4 syria edited right tarab a state of euphoria invoked by music update please donate here if you can t make any of the events tarab 4 syria crowdrise pagewe ve all felt it out of the blue while listening to some piece of music you get overwhelmed with emotion get goosebumps feel ecstatic or feel very sad and start tearing up often you ll catch yourself unconsciously tapping your feet humming a tune accompanying a distant radio or get lost in your work while music is blasting sometimes you ll burst into song at a concert with thousands of others in unison other times you re with a group of friends jamming endlessly over the same riffs with a simple drum and guitar music has its way with us it connects with higher order perception functions and works on emotions directly without interpreters translators or coordinating rational guardians music is a great unifier even if no one in a group can agree with the interpretation they will all share a common visceral experience in that way music is like food food is experienced in the same visceral way by everyone i ve often said that when you re eating a man ousheh in mamnoon or mamnoon street you are so much closer at that moment to someone eating a man ousheh in beirut this is absolutely true of music when you hear the traditional umm kalthoum sabah fakhri fairuz or the ultra modern hellopsychaleppo you are so much closer to middle easterners through shared experience and emotion one of the most amazing things to witness at mamnoon is how people of all kinds races religions come together socialize and connect in the same medium of great food surroundings and music we ve been told that it s a unique and very appealing draw of the mamnoon dining experience a key element for our exciting new mbar project is to replicate this diverse and ultra social experience in an unbelievable geographic setting charity is a core part of the mamnoon mission we have raised substantial funds over the years to help syrian refugees with incredible support from a generous and worldly seattle and its amazing inhabitants over the years the refugee crisis has only gotten worse and its effects deeper and deeper it has all the hallmarks of becoming a multi generational disaster impacting not only those fleeing the strife today but also their kids and depressingly their kids kids it s worth reflecting on this fact for a bit the large scale palestinian refugee crisis in the middle east started with the events of 1948 there are palestinian refugee camps in neighboring countries that have been continuously inhabited since then 65 years of refugee dom the situation in the camps is deplorable and the worst part is the lack of opportunity afforded the inhabitants the syrian refugee crisis scale is at least 10 times larger than that and there is no end in sight to the conflict it seems that refugees get stuck in a vicious cycle where one generation leaves the subsequent generation less able to help themselves already the impacts on neighboring countries the eu and events around the world are straining existing aid financial and political systems just imagine what can happen over decades my experience with higher education and working in the us has taught me a valuable lesson anyone with some freedom the right motivation education and work opportunities can build a good future for themselves family and give back to the community it s really that simple if we can help educate and create opportunities for syrian refugee children they will be able to build better futures for themselves and help bootstrap others this is a virtuous cycle the only downside is that it s not immediate and needs to be nurtured for some time to get going this has changed our strategy for charity instead of galvanizing giving for general aid which is still necessary we ve chosen to focus on organizations and set ups that can provide the safety education and opportunities to start the virtuous cycle going even if it is for relatively few the hope is that by doing so we can positively impact the lives of few today and many more tomorrow we ve found a great organization to help us with this international rescue committee the irc has been at the forefront of aid operations with syrian refugees and has upped its efforts on helping build futures for children i ll post more details on the project we will be targeting reyhanli youth center in turkey we have close to hand many elements for a primordial soup of humanity if we can put them together and add some spark maybe we can create something that lives on that was the idea behind tarab 4 syria to see if we can put everything together and apply your spark the event takes place over 2 days in 3 locations on august 4th and for 35$ there will be an all you can eat mamnoon street and anar food and drink menu and entertained by musicians black giraffe and dj dana dub dj spank from 4 9 pm on august 4th we will have an all inclusive special a la zao ak menu at mamnoon with musar arak and curated paired wines for 250$ person music provided by house of tarab details of the menu will be available shortly reservations strongly recommended on august 5th we will host an invite only event from 5 9 pm with a special tasting menu by jason stratton and some of his top chef colleagues the menu paired with chateau musar wines and will be the first ever event held at mbar music will be provided by dj riz please inquire with jonny mamnoonrestaurant com about this event on august 5th starting 9 pm we will host an invite only tarab 4 syria party on the mbar rooftop deck featuring bites and special drinks as well as music by dj riz and hellopsycaleppo please inquire with jonny mamnoonrestaurant com about this event come join us and get into your tarab and do lasting good there will be many ways to participate for all budgets and preferences i look forward to seeing many of you there wassef '),
