 ('1331', 'field', '40', 'en_us', ' the civil war in syria is in its 5th year and has taken an immense toll on the lives of everyday people there the extreme situation there and elsewhere in the middle east weighs heavily on our hearts and minds mamnoon has successfully corralled the community in seattle to support several charitable activities to help with this dire situation unfortunately today millions do not have access to basics like bread and clean drinking water this heartbreaking truth reminds us how lucky we are to live in a place that we do have access to those things and so much more mamnoon is a beacon for modern middle eastern hospitality and for years we ve welcomed you with our fresh bread and our exclusive za atar imported from the region the very best of what our culture can provide while we still believe in providing this level of hospitality we can no longer justify giving bread away when so many can t get it at all another impact of the chaos in the region is that our spices and exclusive za atar have become very difficult to import under the circumstances we are changing the way that we are approaching our bread service starting on monday november 21st we will no longer offer our barbari bread to start our meals we will continue to offer our incredible freshly baked pita with your meal but will move the za atar and olive oil to our menu at a nominal charge we are going to continue to provide the highest quality spices and flavors and our hope is that everyone will enjoy these offerings with an awareness of the deep connection to a region that is experiencing a shortage of basics like bread that we are so lucky to have our mission is to bridge cultures and it is sometimes through seemingly very small gestures that this bridge is crossed if you are moved to do so we always have ways of donating to charities that have shown their commitment to efficient humanitarian work and we are happy to connect you to them several times throughout the year we host fundraisers and currently we have retail items available that support charities that we have vetted our hope is that our daily work in creating food and flavor experiences that link us to cultures that are far from seattle generates an understanding of the humanity that we all share mamnoon to you '),
 ('1331', 'slug', '0', 'en_us', ''),
 ('1332', 'field', '39', 'en_us', ' mamnoon is 4 left mamnoon turns 4 mamnoon debuted on 11 19 2012 we opened to an incredible reception by the amazing people of seattle and we have been going strong ever since mamnoon s mission is to bridge the ancient and deep middle eastern cultures with the progressive and forward looking northwest culture we are doing it by staying as true as possible to the roots of the food and hospitality while projecting these cultures into the future one that is influenced by our experiences here over the last 25 years we are proud of what we ve been able to do with your help we are extremely thankful to you for giving us the opportunity to serve you and the community at large and for making us feel very much part of the fabric of capitol hill seattle mamnoon 4th anniversary weekthere will be many opportunities for you to celebrate and enjoy our 4th anniversary throughout the week starting 11 28 from monday to thursday all items on our super hot happy hour menu will be for $4on friday and saturday executive chef carrie marshaney has prepared a special 4 course tasting menu for $44 with special wine pairing for $24 please mention your interest in the tasting menu when you reservethrough out the week you can enjoy a champagne and harra frites special for $24 featuring our amazing harra frites za atar mayo and a half bottle of chandon brut classic helping the white helmetswe will also be donating 15% of our revenue during this week to the life saving heroes of the white helmets https www whitehelmets org e we hope that we can share all our good fortunes with those most needing support in syria we hope to celebrate with you soon champagne and frites left '),
